. We have now implemented the eyewash check as part of our weekly lab SOPs.</p>','Complete',NULL,NULL,'2016-08-15 13:16:30',NULL,0,0,0,NULL),(603,1,'2016-08-22 13:20:23','2016-08-22 13:20:23',NULL,NULL,'<p>We had acids and base son separate shelves. We now have removed the one base from the cabinet, which now only contains acids. Thus, the base resides in its own storage cabinet separate from the acids.</p>','Complete',NULL,NULL,'2016-08-15 13:19:39',51,0,0,0,NULL),(604,1,'2016-08-22 13:21:07','2016-08-22 13:21:07',NULL,2066,'<p>We have printed a SDS for all 6 of the PHSs in our lab. They can also be found in our lab folder on our shared drive.</p>','Complete',NULL,NULL,'2016-08-19 13:20:32',NULL,0,0,0,NULL),(605,1,'2016-08-22 13:22:03','2016-08-22 13:22:03',NULL,2068,'<p>All boxes stored above the lab cabinets have been removed, as they were within 18 inches of the ceiling.</p>','Complete',NULL,NULL,'2016-08-15 13:21:28',NULL,0,0,0,NULL),(606,1,'2016-08-22 13:23:21','2016-08-22 13:23:21',NULL,2069,'<p>We completed the monthly fire extinguisher check for August and integrated this into our monthly regular lab duties SOPs by assigning this task to one lab member.</p>','Complete',NULL,NULL,'2016-08-15 13:22:08',NULL,0,0,0,NULL),(607,1,'2016-08-22 17:35:28','2016-08-22 17:35:28',NULL,2049,'<p>Spill kit is now available in lab.</p>','Complete',NULL,NULL,'2016-08-12 17:34:35',NULL,0,0,0,NULL),(608,1,'2016-08-22 17:37:27','2016-08-22 17:37:27',NULL,NULL,'<p>Right now we don\'t have any waste which is older than 6 months. However, we will discurd the waste at the end of the month (august).</p>','Pending','2016-08-31 17:35:53',NULL,NULL,48,0,0,0,NULL),(609,1,'2016-08-22 18:55:45','2016-08-22 18:56:34',NULL,2051,'<p>SOP for PHS&nbsp;chemicals has been reviewed</p>','Complete',NULL,NULL,'2016-08-22 18:55:14',NULL,0,0,0,NULL),(610,1,'2016-08-22 18:57:35','2016-08-22 18:57:35',NULL,2050,'<p>SOP for PHS chemicals has been created and going to be documented (along with SDS) after getting signature from all lab personel</p>','Pending','2016-08-23 18:56:45',NULL,'2016-08-22 18:56:39',NULL,0,0,0,NULL),(611,1,'2016-08-22 20:26:31','2016-08-22 20:26:31',NULL,2067,'<p>EH&amp;S provided 5 out of the 6 template SOP\'s that Dr. Sarzynski needed. &nbsp;He only needs one more SOP for iodoacetamide and EH&amp;S will provide that once it is ready. &nbsp;Jake can make minor modifications to the SOP templates and maintain them in the chemical safety binder once lab members have read and signed the SOP\'s.</p>','Complete',NULL,NULL,'2016-08-22 20:24:14',NULL,0,0,0,NULL),(612,1,'2016-08-22 20:27:20','2016-08-22 20:27:20',NULL,2065,'<p>This is done. &nbsp;EH&amp;S provided all but one SOP for Dr. Sarzynski to use. &nbsp;The last one will be emailed once it is ready.</p>','Complete',NULL,NULL,'2016-08-22 20:26:58',NULL,0,0,0,NULL),(613,1,'2016-08-22 20:46:43','2016-08-22 20:46:43',NULL,1890,'<p>EH&amp;S reviewed Dr. Creek\'s chemical inventory on 8/17/16 and emailed all of the PHS SOP\'s to Diego except for SDS which was emailed a couple days later. &nbsp;The SDS\'s for the PHS\'s need to be attached to the back of the SOP\'s and everyone in the lab needs to read and sign the SOP\'s.</p>','Complete',NULL,NULL,'2016-08-22 20:45:12',NULL,0,0,0,NULL),(614,1,'2016-08-22 20:47:15','2016-08-22 20:47:15',NULL,1888,'<p>All of the required SOP\'s have been emailed to Diego.</p>','Complete',NULL,NULL,'2016-08-22 20:46:59',NULL,0,0,0,NULL),(615,1,'2016-08-22 20:47:40','2016-08-22 20:47:40',NULL,1889,'<p>Diego just needs to attache the SDS for the PHS to the SOP.</p>','Complete',NULL,NULL,'2016-08-22 20:47:32',NULL,0,0,0,NULL),(616,1,'2016-08-22 20:48:38','2016-08-22 20:48:38',NULL,NULL,'<p>EH&amp;S brought Diego all the stickers he needed for his appliances so this corrective action is completed.</p>','Complete',NULL,NULL,'2016-08-22 20:48:13',25,0,0,0,NULL),(617,1,'2016-08-22 20:55:27','2016-08-22 20:55:27',NULL,1872,'<p>EH&amp;S reviewed Dr. Twiss\' chemical inventory on 7/18/16. &nbsp;The PHS\'s were identified on the chemical inventory and emailed with the SOP templates that are currently on-hand to Dr. Twiss, Liz and Sharmina.</p>','Complete',NULL,NULL,'2016-08-22 20:54:36',NULL,0,0,0,NULL),(618,1,'2016-08-22 20:57:58','2016-08-22 20:57:58',NULL,1874,'<p>EH&amp;S emailed the SOP\'s that are currently available to&nbsp;the Twiss Lab on 7/18/16. &nbsp;The remaining SOP\'s will be emailed once they are written.</p>','Pending',NULL,NULL,NULL,NULL,1,0,0,NULL),(619,1,'2016-08-22 21:02:46','2016-08-22 21:03:36',NULL,NULL,'<p>A work order has been submitted to facilities with a department number and fund number to route power to the center island instead of running an extension cord through the ceiling. &nbsp;This will be an on-going project if Dr. Creek approves the funds to do the work.</p>','Pending',NULL,NULL,NULL,19,0,1,0,NULL),(620,1,'2016-08-25 18:29:44','2016-08-25 18:29:44',NULL,1882,'<p>Dr . Creek is working to have Eyewash units checked periodically.</p>','Pending',NULL,NULL,NULL,NULL,0,0,0,'Completion date depends on when and who is designed to do the job.'),(621,1,'2016-08-25 18:31:48','2016-08-25 18:32:14',NULL,1883,'<p>Dr . Creek is working to have Eyewash units checked periodically.</p>','Complete',NULL,NULL,NULL,NULL,0,0,0,'Completion date depends on when and who is designed to do the job.'),(623,1,'2016-08-30 21:04:25','2016-08-30 21:04:25',NULL,2076,'<p><!-- [if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n  <o:PixelsPerInch>96</o:PixelsPerInch>\n </o:OfficeDocumentSettings>\n</xml><![endif]--> <!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther