from lab</p>','Complete',NULL,NULL,'2016-08-24 19:10:47',NULL,0,0,0,NULL),(651,1,'2016-09-01 19:15:08','2016-09-01 19:15:08',NULL,1932,'<p>Chemicals that we are unlikely to use have been removed from lab</p>','Complete',NULL,NULL,'2016-08-24 19:14:40',NULL,0,0,0,NULL),(652,1,'2016-09-01 19:17:45','2016-09-01 19:17:45',NULL,1929,'<p>waiting on EH&amp;S approval and provsion ne wof new SOP</p>','Pending','2016-10-20 19:16:13',NULL,NULL,NULL,0,0,0,NULL),(653,1,'2016-09-01 19:18:25','2016-09-01 19:18:25',NULL,1930,'<p>Several new SOP were written and submitted to EH&amp;S</p>','Pending','2016-10-20 19:18:05',NULL,NULL,NULL,0,0,0,NULL),(660,1,'2016-09-15 16:22:42','2016-09-15 16:22:42',NULL,1733,'<p>EH&amp;S&nbsp;received Dr. Harrod\'s chemical inventory and reviewed it.</p>','Complete',NULL,NULL,'2016-09-15 16:22:06',NULL,0,0,0,NULL),(661,1,'2016-09-15 16:23:19','2016-09-15 16:23:19',NULL,1736,'<p>The SDS\'s have been separated between the PHS and less hazardous chemicals.</p>','Complete',NULL,NULL,'2016-09-15 16:22:52',NULL,0,0,0,NULL),(662,1,'2016-09-15 16:24:19','2016-09-15 16:24:19',NULL,1737,'<p>EH&amp;S emailed Dr. Harrod the SOP\'s for his PHS\'s. &nbsp;He still needs to SOP\'s for Cobalt (III) Chloride and Methyl Methacrylate. &nbsp;Those will be emailed to him once they are written.</p>','Complete',NULL,NULL,'2016-09-15 16:23:22',NULL,0,0,0,NULL),(663,1,'2016-09-15 16:24:49','2016-09-15 16:24:49',NULL,1734,'<p>Most of the SOP\'s have been written for Dr. Harrod\'s PHS except for two of them (see comment above).</p>','Complete',NULL,NULL,'2016-09-15 16:24:22',NULL,0,0,0,NULL),(664,1,'2016-09-15 16:25:26','2016-09-15 16:25:26',NULL,1738,'<p>The template Hazard Information Board was emailed to Dr. Harrod and he said he would fill it out and post it on the outside of the door.</p>','Complete',NULL,NULL,'2016-09-15 16:24:53',NULL,0,0,0,NULL),(665,1,'2016-09-15 16:26:04','2016-09-15 16:26:04',NULL,1739,'<p>The template Hazard Information Board was emailed to Dr. Harrod and he will fill it out completely with all of the required information.</p>','Complete',NULL,NULL,'2016-09-15 16:25:29',NULL,0,0,0,NULL),(666,1,'2016-09-15 16:26:52','2016-09-15 16:26:52',NULL,1740,'<p>The template for the emergency procedures has been emailed to Dr. Harrod and he said that he will fill it out and post it on the inside of the door so students may see it.</p>','Complete',NULL,NULL,'2016-09-15 16:26:07',NULL,0,0,0,NULL),(667,1,'2016-09-15 16:28:01','2016-09-15 16:28:01',NULL,1741,'<p>The template emergency procedure was emailed to Dr. Harrod and he will fill it out and post it. &nbsp;He sent an email back verifying that he received the emergency procedures.</p>','Complete',NULL,NULL,'2016-09-15 16:26:58',NULL,0,0,0,NULL),(668,1,'2016-09-15 16:28:59','2016-09-15 16:28:59',NULL,1742,'<p>Dr. Harrod had some student turn over and they student safety officer who was there during the inspection left soon after the inspection. &nbsp;He now has a new group safety officer who he will designate on the hazard information board.&nbsp;</p>','Complete',NULL,NULL,'2016-09-15 16:28:04',NULL,0,0,0,NULL),(669,1,'2016-09-15 16:52:44','2016-09-15 16:52:44',NULL,1602,'<p>SDS\'s can be online as long as you can access them and your students can access them.</p>','Complete',NULL,NULL,'2016-09-15 16:52:23',NULL,0,0,0,NULL),(670,1,'2016-09-15 16:54:30','2016-09-15 16:54:30',NULL,1603,'<p>EH&amp;S emailed template SOP\'s for the PHS\'s that are currently available on 9/15/16. &nbsp;More SOP\'s will be emailed as they are written.</p>','Complete',NULL,NULL,'2016-09-15 16:53:13',NULL,0,0,0,NULL),(671,1,'2016-09-15 16:55:27','2016-09-15 16:55:27',NULL,1599,'<p>SOP\'s were provided to Dr. Crittenden from EH&amp;S for the PHS\'s where templates exist. &nbsp;Dr. Crittenden has a lot of non-standard PHS\'s for which he needs SOP\'s. &nbsp;They will be written over time and emailed to Dr. Crittenden.</p>','Complete',NULL,NULL,'2016-09-15 16:54:34',NULL,0,0,0,NULL),(672,1,'2016-09-15 16:56:10','2016-09-15 16:56:10',NULL,1606,'<p>A template hazard information board has been emailed to Dr. Crittenden so that he can fill it out and post it outside of his two laboratories in Sumwalt.</p>','Complete',NULL,NULL,'2016-09-15 16:55:33',NULL,0,0,0,NULL),(673,1,'2016-09-15 17:06:54','2016-09-15 17:06:54',NULL,2070,'<p>Eye wash and showers are flushed weekly according to ANSI standard and maintenance is being well documented in a log book.</p>','Complete',NULL,NULL,'2016-09-15 17:06:20',NULL,0,0,0,NULL),(674,1,'2016-09-15 17:08:34','2016-09-15 17:08:34',NULL,2073,'<p>The designated group safety officers and alternate officers names and their phone numbers have been posted on the lab entrance doors and also recorded in the chemical hygiene plan folder.</p>','Complete',NULL,NULL,'2016-09-15 17:07:41',NULL,0,0,0,NULL),(675,1,'2016-09-15 17:09:25','2016-09-15 17:09:25',NULL,2074,'<p>The alternate group safety officers names and their phone numbers have been posted on the lab entrance doors and also recorded in the chemical hygiene plan folder.</p>','Complete',NULL,NULL,'2016-09-15 17:08:37',NULL,0,0,0,NULL),(676,1,'2016-09-15 17:10:24','2016-09-15 17:10:24',NULL,2075,'<p>The designated group safety officers and alternate officers names and their phone numbers have been posted on the lab entrance doors and also recorded in the chemical hygiene plan folder.</p>','Complete',NULL,NULL,'2016-09-15 17:09:29',NULL,0,0,0,NULL),(677,1,'2016-09-15 17:11:25','2016-09-15 17:11:25',NULL,2072,'<p>All authorized lab personnel has undergone hazard-specific SOP training to work in the lab. &nbsp;All the trainings and name of the personnel are well documented in the chemical hygiene folder.</p>','Complete',NULL,NULL,'2016-09-15 17:10:29',NULL,0,0,0,NULL),(678,1,'2016-09-15 17:13:40','2016-09-15 17:13:40',NULL,2071,'<p>All the procedures to use particularly hazardous chemicals (PHS) or SOP\'s indicating protective measures / chemical hygiene plans / control / precautions / mea