NULL,NULL,'2016-09-30 19:17:02',NULL,0,0,0,NULL),(707,1,'2016-10-10 19:27:50','2016-10-10 19:27:50',NULL,2220,'<p>Lab personel instructed to check fire extinguisher the first Monday of every month.&nbsp; The idea is to establish&nbsp;a routine where&nbsp;all personel in the lab check the extinguisher so that&nbsp;in the event that&nbsp;on person forgets to perform the check, two&nbsp;or three others will remember and the check will be conducted.&nbsp;</p>','Complete',NULL,NULL,'2016-09-30 19:19:47',NULL,0,0,0,NULL),(708,1,'2016-10-10 19:28:40','2016-10-10 19:28:40',NULL,NULL,'<p>Conspicuous label added to the refrigerator: \"<strong>FOOD ONLY</strong>\".</p>','Complete',NULL,NULL,'2016-09-30 19:27:57',69,0,0,0,NULL),(709,1,'2016-10-11 19:55:25','2016-10-11 19:55:25',NULL,2210,'<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Forms updated in rooms 2B24 and 1B22, and routine weekly checks of the eyewash stations are now performed on both labs.&nbsp;</span></p>','Complete',NULL,NULL,'2016-10-10 19:54:22',NULL,0,0,0,NULL),(710,1,'2016-10-11 19:55:59','2016-10-12 21:20:01',NULL,2211,'<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Safety shower in room 2B24 is now scheduled for routine checks every six months. Documentation of the inspections are posted next to the shower</span></p>','Complete',N