LL,'2016-11-21 21:43:31',NULL,0,0,0,NULL),(839,1,'2016-11-21 21:44:55','2016-11-21 21:44:55',NULL,NULL,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: normal; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif;\">The high-pressure experimental setup has been designed, fabricated and modified to simulate syngas combustion in a gas turbine. </span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">The pressure vessel was built using type 316 stainless steel, schedule 40, seamless pipe and class 600 ANSI flanges. The nominal pipe size of the main cylinder is 8 in. and the nominal pipe size of the side cylinders (optical ports) is 2 in. Face seals between the slip-on and blind flanges are made using silicone rubber O-rings. For optical access ports, sight glasses were welded on circumference of pipe body.<span style=\"color: #212121; background-image: initial; background-position: initial; b','Pending','2016-11-23 21:40:23',NULL,NULL,132,0,0,0,NULL),(840,1,'2016-11-21 21:45:48','2016-11-21 21:45:48',NULL,NULL,'<p>Cylinders, compatible with the strap size, have been secured by the straps. Others have been stores elsewhere safely</p>','Complete',NULL,NULL,'2016-11-21 21:44:13',130,0,0,0,NULL),(841,1,'2016-11-21 21:46:06','2016-11-21 21:46:06',NULL,NULL,'<p>Label has been corrected to CH4</p>','Complete',NULL,NULL,'2016-11-21 21:46:00',131,0,0,0,NULL),(842,1,'2016-11-21 21:46:27','2016-11-21 21:46:27',NULL,NULL,'<p>Arsine has been listed</p>','Complete',NULL,NULL,'2016-11-21 21:46:23',133,0,0,0,NULL),(843,1,'2016-11-28 14:47:44','2016-11-28 14:47:44',NULL,2365,'<p>Placed up notification board.</p>','Complete',NULL,NULL,'2016-11-17 14:47:28',NULL,0,0,0,NULL),(844,1,'2016-12-01 15:16:43','2016-12-01 15:16:43',NULL,2443,'<p>Wipes completed