 through to A235. This means that all pathways to entry into A235, A236, and A237 now have hazard notifications.</p>\n<p>The class II laser was added to the each hazard notice.</p>','Complete',NULL,NULL,'2016-10-12 19:10:04',NULL,0,0,0,NULL),(896,1,'2016-12-16 20:15:33','2016-12-16 20:15:33',NULL,2113,'<p>Emergency procedures have been posted by all the exit doors in A236 and A237 for fire, chemical spill, and skin/eye chemical exposure.</p>','Complete',NULL,NULL,'2016-12-16 20:13:19',NULL,0,0,0,NULL),(897,1,'2016-12-16 20:17:49','2016-12-16 20:17:49',NULL,2111,'<p>An SOP has been written for the voltage amplifier. We will be sending the draft today to EH&amp;S for review as requested during the inspection. As an interim, the current draft will be prominently posted by&nbsp;the equipment. Once we receive revisions, we will post the revised version immdeiately.</p>','Pending',NULL,NULL,NULL,NULL,1,0,0,NULL),(898,1,'2016-12-16 20:22:32','2016-12-16 20:22:32',NULL,2118,'<p>We have disposed of most of the PHS from&nbsp;A237. One chemical may still need an SOP. We will contact EHS today to ask for clarification.</p>\n<p>We have initiated discussions to have the chemical moved to another room. This room has a chemical storage cabinet, fume hood&nbsp;and safety shower/eyewash station.</p>','Pending',NULL,NULL,NULL,NULL,1,1,0,NULL),(899,1,'2016-12-16 20:52:29','2016-12-16 20:52:29',NULL,2207,'<p><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">The compressed gas cylinder will be securely chained to wall in an upright position</span></p>','Pending','2016-12-29 20:52:03',NULL,NULL,NULL,0,0,0,NULL),(900,1,'2016-12-16 20:53:09','2016-12-16 20:53:09',NULL,2208,'<p>Hazard notification and MSDS have been placed in the lab.</p>','Complete',NULL,NULL,'2016-12-14 20:52:28',NULL,0,0,0,NULL),(901,1,'2016-12-16 20:53:28','2016-12-16 20:53:28',NULL,2209,'<p>Emergency phone numbers have been updated</p>','Complete',NULL,NULL,'2016-12-01 20:53:05',NULL,0,0,0,NULL),(902,1,'2016-12-19 18:58:25','2016-12-19 18:58:25',NULL,NULL,'<p><span style=\"font-size: 12pt; font-family: Calibri, sans-serif;\">There are no more available hazardous waste training classes for the year, however, Coleman Terrapin has e-mailed Jeff Brannon inquiring about the next available class to attend. &nbsp;</span></p>','Pending',NULL,NULL,NULL,123,1,0,0,NULL),(903,1,'2016-12-19 18:59:15','2016-12-19 18:59:15',NULL,NULL,'<p><span style=\"font-size: 12pt; font-family: Calibri, sans-serif;\">MSDS folder has been moved to Horizon lab 025 and placed in overhead&nbsp;cabinet against the west wall.</span></p>','Complete',NULL,NULL,'2016-12-01 18:58:35',124,0,0,0,NULL),(904,1,'2016-12-19 18:59:55','2016-12-19 18:59:55',NULL,NULL,'<p><span style=\"font-size: 12pt; font-family: Calibri, sans-serif;\">Hazard information notice has been posted in Room 025, office side next to door leading into lab. &nbsp;</span></p>','Complete',NULL,NULL,'2016-12-01 18:59:47',121,0,0,0,NULL),(905,1,'2016-12-19 19:00:51','2016-12-19 19:00:51',NULL,NULL,'<p>This notice is on the sheet. &nbsp;It indicates that HF is in storage. &nbsp;This is true for the original sign as well as the one added to the other door leading from the graduate student area.</p>','Complete',NULL,NULL,'2016-12-01 18:59:58',122,0,0,0,NULL),(906,1,'2016-12-19 19:01:25','2016-12-19 19:01:25',NULL,2417,'<p><span style=\"font-family: Calibri, sans-serif;\">Fire extinguisher is now being checked monthly to ensure accessibility, inspection of seals and pull pin, pressure check, and noting any signs of damage. &nbsp;The monthly checks are being recorded in a binder located in overhead cabinet against the&nbsp;west wall of lab 025 labeled \"Fire Extinguisher Log.\" &nbsp;</span></p>','Complete',NULL,NULL,'2016-12-01 19:01:18',NULL,0,0,0,NULL),(907,1,'2017-01-05 18:24:58','2017-01-05 18:24:58',NULL,2234,'<p>Inventory submitted</p>','Complete',NULL,NULL,'2016-12-16 18:24:34',NULL,0,0,0,NULL),(908,1,'2017-01-09 18:11:38','2017-01-09 18:11:38',NULL,2095,'<p>The document has been signed by all lab members.&nbsp;</p>','Complete',NULL,NULL,'2016-12-16 18:11:00',NULL,0,0,0,NULL),(909,1,'2017-02-02 18:55:26','2017-02-02 18:55:26',NULL,2446,'<p>We flushed the Eyewash&nbsp;for this week and also created a table and pasted near&nbsp;all three eyewashes so that it remindes us to check it weekly.&nbsp;</p>','Complete',NULL,NULL,'2017-02-02 18:44:36',NULL,0,0,0,NULL),(910,1,'2017-02-06 18:10:19','2017-02-06 18:10:19',NULL,NULL,'<p>Emergency procedure was filled out, printed, and posted by all exit doors.</p>','Complete',NULL,NULL,'2017-02-06 18:09:05',143,0,0,0,NULL),(911,1,'2017-02-06 20:15:08','2017-02-06 20:15:08',NULL,2457,'<p>Weekly eyewash log created, printed out, and placed at each eyewash station. Eyewashes tested.</p>','Complete',NULL,NULL,'2017-02-06 20:14:04',NULL,0,0,0,NULL),(912,1,'2017-02-06 20:20:27','2017-02-06 20:20:27',NULL,NULL,'<p>Waste pickup was submitted for disposal of cyanide waste.</p>','Complete',NULL,NULL,'2017-02-06 20:20:01',142,0,0,0,NULL),(913,1,'2017-02-06 20:21:31','2017-02-06 20:21:31',NULL,2459,'<p>Sample vials labeled with appropriate information (contents, concentration, etc.).</p>','Complete',NULL,NULL,'2017-02-06 20:20:41',NULL,0,0,0,NULL),(914,1,'2017-02-07 17:55:34','2017-02-07 17:55:34',NULL,2465,'<p>Safety check for the eyewash stations is now being carried out weekly instead of biweekly. Also, items in close proximity to the eyewash stations have been removed for easy access.</p>','Complete',NULL,NULL,'2017-02-07 17:52:35',NULL,0,0,0,NULL),(915,1,'2017-02-07 18:09:25','2017-02-07 18:09:25',NULL,2468,'<p>We have made a request for the EH&amp;S to pick up the waste (solid/liquid) that was in the lab during inspection. In order to avoid waste accumulations,pick up requests will be made as soon as the containers are 75% full.</p>','Complete',NULL,NULL,'2017-02-07 18:03:49',NULL,0,0,0,NULL),(916,1,'2017-02-13 15:52:02','2017-02-13 15:52:02',NULL,2447,'<p>Glass bottles triple rinsed, rinsate collected, and disposed of in dumpster.</p>','Complete',NULL,NULL,'2017-02-13 15:51:13',NULL,0,0,0,NULL),(917,1,'2017-02-13 15:53:08','2017-02-13 15:53:08',NULL,NULL,'<p>Reminded students not to recap needles and dispose of sharps in specified container immediately after use during group meeting</p>','Complete',NULL,NULL,'2017-02-10 15:52:18',140,0,0,0,NULL),(918,1,'2017-02-15 16:58:34','2017-02-15 16:58:34',NULL,2458,'<p>The light in the fume hood has been fixed and is operational.</p>','Complete',NULL,NULL,'2017-02-15 16:58:05',NULL,0,0,0,NULL),(919,1,'2017-02-15 16:59:14','2017-02-15 16:59:14',NULL,2460,'<p>SOPs have been signed by users.</p>','Complete',NULL,NULL,'2017-02-15 16:58:39',NULL,0,0,0,NULL),(920,1,'2017-02-16 16:29:27','2017-02-16 16:29:27',NULL,2448,'<p>The mute buttons were unpressed and the hood sashes were lowered appropriate heights.</p>','Complete',NULL,NULL,'2017-02-16 16:27:49',NULL,0,0,0,NULL),(921,1,'2017-02-16 16:30:55','2017-02-16 16:30:55',NULL,2449,'<p>Old and unused chemicals are being collected and placed aside for disposal on the next chemical amnesty day.</p>','Pending',NULL,NULL,NULL,NULL,0,1,0,NULL),(922,1,'2017-02-16 16:32:53','2017-02-16 16:32:53',NULL,2450,'<p>Waste pickup has been requested.</p>','Pending',NULL,NULL,NULL,NULL,0,0,0,'Some waste has been removed. The rest will be removed next Wednesday.'),(923,1,'2017-02-20 20:41:17','2017-02-20 20:41:17',NULL,NULL,'<p>Hazardous waste scheduled to be picked up this Wednesday.</p>','Pending','2017-02-22 20:40:29',NULL,NULL,139,0,0,0,NULL),(924,1,'2017-02-21 18:00:34','2017-02-21 18:00:34',NULL,NULL,'<p>The waste glass container was emptied and will continually be emptied when 3/4 full</p>','Complete',NULL,NULL,'2017-02-21 17:59:39',156,0,0,0,NULL),(925,1,'2017-02-21 18:01:24','2017-02-21 18:01:24',NULL,NULL,'<p>Hazardous chemicals have now been labeled properly</p>','Complete',NULL,NULL,'2017-02-21 18:00:49',157,0,0,0,NULL),(926,1,'2017-02-21 18:02:22','2017-02-21 18:02:22',NULL,NULL,'<p>New SOPs need to be made for certain chemicals</p>','Pending','2017-02-28 18:01:31',NULL,NULL,155,0,0,0,NULL),(927,1,'2017-02-22 15:08:47','2017-02-22 15:08:47',NULL,NULL,'<p>Flammable solvents were removed from the gas cabinet to be stored elsewhere.&nbsp;</p>','Complete',NULL,NULL,'2017-02-10 15:07:51',137,0,0,0,NULL),(928,1,'2017-02-22 15:09:32','2017-02-22 15:09:32',NULL,2444,'<p>SOPs are signed by users.&nbsp;</p>','Complete',NULL,NULL,'2017-02-22 15:08:39',NULL,0,0,0,NULL),(935,1,'2017-02-22 16:21:16','2017-02-22 16:21:16',NULL,NULL,'<p>done</p>','Complete',NULL,NULL,'2017-02-22 16:21:11',163,0,0,0,NULL),(937,1,'2017-02-22 19:34:13','2017-02-22 19:43:46',NULL,NULL,'<p>We cleaned out solid, glass, needle waste in our lab. The cabinet for gas cylinders are emptied and we found a carbinet to stored all lab waste.</p>\n<!-- [if gte vml 1]><v:shapetype id=\"_x0000_t75\"\n coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\"\n filled=\"f\" stroked=\"f\">\n <v:stroke joinstyle=\"miter\"/>\n <v:formulas>\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\n  <v:f eqn=\"sum @0 1 0\"/>\n  <v:f eqn=\"sum 0 0 @1\"/>\n  <v:f eqn=\"prod @2 1 2\"/>\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\n  <v:f eqn=\"sum @0 0 1\"/>\n  <v:f eqn=\"prod @6 1 2\"/>\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\n  <v:f eqn=\"sum @8 21600 0\"/>\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\n  <v:f eqn=\"sum @10 21600 0\"/>\n </v:formulas>\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\n</v:shapetype><v:shape id=\"_x0000_s1026\" type=\"#_x0000_t75\" style=\'position:absolute;\n left:0;text-align:left;margin-left:-24pt;margin-top:-7','Complete',NULL,NULL,'2017-02-20 19:31:02',141,0,0,0,NULL),(938,1,'2017-02-22 19:34:56','2017-02-22 19:34:56',NULL,2456,'<p class=\"MsoNormal\" style=\"margin-left: 18.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span lang=\"EN-US\">The fire extinguisher was reassembled on the wall and the chimney on the ceiling was repaired.</span></p>','Complete',NULL,NULL,'2017-02-20 19:34:26',NULL,0,0,0,NULL),(939,1,'2017-02-22 19:40:48','2017-02-22 19:40:48',NULL,2461,'<p>Flushes are being done weekly</p>','Complete',NULL,NULL,'2017-02-15 19:40:20',NULL,0,0,0,NULL),(940,1,'2017-02-22 19:41:31','2017-02-22 19:41:31',NULL,2462,'<p>Spill kit (vermiculite sorbent and a plastic bucket) are available</p>','Complete',NULL,NULL,'2017-02-15 19:40:55',NULL,0,0,0,NULL),(941,1,'2017-02-22 19:42:42','2017-02-22 19:42:42',NULL,NULL,'<p>Face shield has been purchased. It&nbsp;has not been received yet.</p>','Pending','2017-03-01 19:41:37',NULL,NULL,147,0,0,0,NULL),(942,1,'2017-02-22 19:43:08','2017-02-22 19:43:08',NULL,2464,'<p><span style=\"color: #333333; font-family: \'Open Sans\', sans-serif; font-size: 18px; letter-spacing: 0.28px; background-color: #ffffb9;\">Face shield has been purchased. It&nbsp;has not been received yet.</span></p>','Pending','2017-03-01 19:43:03',NULL,NULL,NULL,0,0,0,NULL),(943,1,'2017-02-22 19:43:50','2017-02-22 19:43:50',NULL,NULL,'<p>One diethyl ether container has been disposed. Two others will be picked up next time.</p>','Pending','2017-03-01 19:43:19',NULL,NULL,145,0,0,0,NULL),(944,1,'2017-02-22 19:44:31','2017-02-22 19:44:31',NULL,2463,'<p>Waste&nbsp;has been picked by by EHS representatives.</p>','Complete',NULL,NULL,'2017-02-15 19:44:27',NULL,0,0,0,NULL),(945,1,'2017-02-22 19:45:14','2017-02-22 19:45:14',NULL,NULL,'<p>Some waste has been picked up already, some will be picked up next time.</p>','Pending','2017-03-01 19:45:10',NULL,NULL,146,0,0,0,NULL),(946,1,'2017-02-23 13:48:33','2017-02-23 13:48:33',NULL,2478,'<p>Acids and bases were segregated away from organics into the proper storage cabinet</p>','Complete',NULL,NULL,'2017-02-23 13:47:51',NULL,0,0,0,NULL),(947,1,'2017-02-23 13:50:09','2017-02-23 13:50:09',NULL,NULL,'<p>acid and bases were segregated from organic and stored in proper cabinet</p>','Complete',NULL,NULL,'2017-02-23 13:48:45',154,0,0,0,NULL),(948,1,'2017-02-28 20:46:00','2017-02-28 20:46:00',NULL,2451,'<p>New tags have been placed next to the eyewash statements which require weekly checks</p>','Complete',NULL,NULL,'2017-02-14 20:45:26',NULL,0,0,0,NULL),(949,1,'2017-02-28 20:47:17','2017-02-28 20:47:17',NULL,2452,'<p>We are working to reduce the amount of flammables that are in our labs. &nbsp;We have moved several 4-L containers from the fifth to the fourth floor to remain within the storage regulations. &nbsp;We have started purchasing only 4-L bottles from the stockroom, rather than 20 L cans from the manufacturer&nbsp;</p>','Complete',NULL,NULL,'2017-02-07 20:47:13',NULL,0,0,0,NULL),(950,1,'2017-02-28 20:48:22','2017-02-28 20:48:22',NULL,2453,'<p>Once I receive the proper list of PHS materials from Beth, as well as the PHS SOPs, I will tailor them to the Shustova group, as well as print off the respective MSDS and have the laboratory personnel sign them.</p>','Pending',NULL,NULL,NULL,NULL,1,0,0,NULL),(951,1,'2017-02-28 20:48:56','2017-02-28 20:48:56',NULL,2455,'<p>All waste has been submitted, we do not keep anything that is more than a week old. &nbsp;Waste is submitted weekly on Tuesday before noon.</p>','Complete',NULL,NULL,'2017-02-15 20:48:27',NULL,0,0,0,NULL);
