19:56:23',NULL,16,'Gas cylinder is not capped.','NFPA 45 requires all pressurized cylinder, empty or not to have a cap on when not in use.','NFPA 45',NULL),(17,1,'2015-03-19 17:19:43','2015-03-19 17:19:43',NULL,17,'Certification out of date.','OSHA Lab standard requires a functioning fume hood.','OSHA Lab Standard',NULL),(18,1,'2015-03-25 14:47:46','2015-03-25 14:47:46',NULL,18,'Fluctuations of the room air supply and exhaust are interfering with proper BSC operations.','All biological safety cabinets must be certified annually.  This certification involves a process of inspection and testing by trained personnel, following strict protocols, to verify that it is working properly.','BMBL, 5th Edition (Appendix A)',NULL),(19,0,'2015-02-12 19:50:27','2015-03-25 14:46:59',NULL,18,'Inactive Deficiency','All biological safety cabinets must be certified prior to use. This certification involves a process of inspection and testing by trained personnel, following strict protocols, to verify that it is working properly.','BMBL, 5th Edition (Appendix A)',NULL),(20,1,NULL,NULL,NULL,19,'Signage does not include the universal biohazard symbol','A sign incorporating the universal biohazard symbol must be posted at the entrance to the laboratory when infectious agents are present.','BMBL, 5th Edition (Section IV)',NULL),(21,1,NULL,NULL,NULL,19,'Signage does not include the laboratory\'s biosafety level','A sign incorporating the universal biohazard symbol must be posted at the entrance to the laboratory when infectious agents are present. Posted information must include the laboratorys biosafety level..','BMBL, 5th Edition (Section IV)',NULL),(22,1,NULL,NULL,NULL,19,'Signage does not include the Principal Investigator\'s name','A sign incorporating the universal biohazard symbol must be posted at the entrance to the laboratory when infectious agents are present. Posted information must include the supervisors name (or other responsible personnel).','BMBL, 5th Edition (Section IV)',NULL),(23,1,NULL,NULL,NULL,19,'Signage does not include the Principal Investigator\'s telephone number','A sign incorporating the universal biohazard symbol must be posted at the entrance to the laboratory when infectious agents are present. Posted information must include the supervisors name (or other responsible personnel) telephone number.','BMBL, 5th Edition (Section IV)',NULL),(24,1,NULL,NULL,NULL,19,'Signage does not include procedures for entering and exiting the lab','A sign incorporating the universal biohazard symbol must be posted at the entrance to the laboratory when infectious agents are present. Posted information must include required procedures for entering and exiting the laboratory.','BMBL, 5th Edition (Section IV)',NULL),(25,1,NULL,NULL,NULL,19,'No signage posted at lab entrance','A sign incorporating the universal biohazard symbol must be posted at the entrance to the laboratory when infectious agents are present. Posted information must include: the laboratorys biosafety level, the supervisors name (or other responsible personnel), telephone number, and required procedures for entering and exiting the laboratory.','BMBL, 5th Edition (Section IV)',NULL),(26,1,NULL,NULL,NULL,20,'Individuals entering the lab are not advised of potential hazards','All persons entering the laboratory must be advised of the potential hazards and meet specific entry/exit requirements.','BMBL, 5th Edition (Section IV)',NULL),(27,1,NULL,NULL,NULL,20,'Individuals entering the lab do not meet specific entry/exit requirements','All persons entering the laboratory must be advised of the potential hazards and meet specific entry/exit requirements.','BMBL, 5th Edition (Section IV)',NULL),(28,1,NULL,NULL,NULL,21,'Lab personnel are not provided medical surveillance for agents in the lab','Laboratory personnel must be provided medical surveillance and offered appropriate immunizations for agents handled or potentially present in the laboratory.','BMBL, 5th Edition (Section IV)',NULL),(29,1,NULL,NULL,NULL,21,'Lab personnel are not provided appropriate immunizations for agents in the lab','Laboratory personnel must be provided medical surveillance and offered appropriate immunizations for agents handled or potentially present in the laboratory.','BMBL, 5th Edition (Section IV)',NULL),(30,1,NULL,NULL,NULL,22,'Lab personnel are not washing their hands after working with samples','Persons must wash their hands after working with potentially hazardous materials and before leaving the laboratory.',NULL,NULL),(31,1,'2014-06-11 13:49:20','2014-06-11 13:49:20',NULL,22,'Lab personnel are not washing their hands before leaving the lab','Persons must wash their hands after working with potentially hazardous materials and before leaving the laboratory.',NULL,NULL),(32,0,'2014-06-11 13:51:02','2014-06-12 12:52:17',NULL,23,'Personnel are eating in laboratory areas','Eating, drinking, smoking, handling contact lenses, applying cosmetics, and storing food for human consumption must not be permitted in laboratory areas. Food must be stored outside the laboratory area in cabinets or refrigerators designated and used for this purpose.',NULL,NULL),(33,1,NULL,NULL,NULL,23,'Personnel are drinking in laboratory areas','Eating, drinking, smoking, handling contact lenses, applying cosmetics, and storing food for human consumption must not be permitted in laboratory areas. Food must be stored outside the laboratory area in cabinets or refrigerators designated and used for this purpose.',NULL,NULL),(34,0,'2014-06-12 12:52:19','2014-06-12 12:52:19',NULL,23,'Personnel are handling contact lenses in laboratory areas','Eating, drinking, smoking, handling contact lenses, applying cosmetics, and storing food for human consumption must not be permitted in laboratory areas. Food must be stored outside the laboratory area in cabinets or refrigerators designated and used for this purpose.',NULL,NULL),(35,1,NULL,NULL,NULL,23,'Personnel are applying cosmetics in laboratory areas