t her lab in August 2016.'),(289,1,'2015-02-18 19:05:56','2015-10-15 18:16:41',NULL,1072,NULL,NULL),(290,1,'2015-02-18 19:12:37','2015-11-13 20:10:55',NULL,1073,NULL,NULL),(291,1,'2015-02-18 19:25:37','2017-01-10 15:20:56',NULL,1074,NULL,NULL),(292,1,'2015-02-18 19:42:39','2016-05-18 12:28:03',NULL,1075,NULL,'Lab Rooms - CLS (513, 512, 512A, 613/Centrifugation Only).\nBSC Rooms - CLS (512, 512A).\nIBC Protocols - 300039 (Exp. 8/20/17).'),(293,1,'2015-02-19 13:38:45','2017-02-28 17:50:02',NULL,1076,NULL,NULL),(294,1,'2015-02-19 13:47:33','2015-10-16 18:48:56',NULL,1077,NULL,NULL),(295,1,'2015-02-19 13:59:33','2016-06-22 20:11:41',NULL,1078,NULL,'Her inspection should be done at the same time as Alan Waldman and the report should be sent to Alan Waldman.  They want 307, 307A and 309 to be considered one lab.  Barbara Waldman doesn\'t have any students working directly for her and they use her lab primarily for storage.'),(302,1,'2015-03-16 15:56:24','2015-10-29 17:38:42',NULL,172,NULL,NULL),(303,0,'2015-04-08 17:07:52','2015-07-15 19:19:56',NULL,87,NULL,NULL),(304,1,'2015-04-13 16:01:51','2015-11-13 20:17:25',NULL,1081,NULL,NULL),(305,1,'2015-04-14 18:09:05','2015-06-29 12:59:23',NULL,129,NULL,NULL),(306,1,'2015-04-14 19:52:37','2016-05-03 19:49:28',NULL,1085,NULL,'Lab Rooms -CLS(402, 604A).\nBSC Rooms -CLS(402, 604).\nIBC Protocols - 300158 (Exp. 3/25/18).'),(316,0,'2015-04-15 17:57:15','2015-04-15 17:57:30',NULL,180,NULL,NULL),(317,1,'2015-12-14 18:30:07','2016-05-03 20:06:02',NULL,1095,NULL,'Sink in 512A is not located near the exit door.  Met with Erin Anderson to discuss lab setup - chairs covered in non-porous material; vacuum lines protected with HEPA filters; secondary containment for flasks on floor; red biohazard waste container with lid and foot pedal for BSL-2+ viral work; lab will use disposable lab coats for CRISPR/Cas 9 lentiviral experiments.\nLab Rooms - CLS (512A/Main Cell Culture Lab).\nBSC Rooms - CLS (512A).\nIBC Protocols - 300163 (Exp. 2/17/19).'),(319,1,'2015-05-15 17:53:26','2016-11-28 16:27:30',NULL,1098,NULL,NULL),(320,1,'2015-05-15 18:13:36','2016-11-28 19:33:38',NULL,1099,NULL,NULL),(321,1,'2016-11-07 19:03:35','2016-11-07 19:03:35',NULL,1100,NULL,'<p>Minimal chemicals- solid metals, flammables</p>'),(322,1,'2015-05-26 20:22:39','2016-04-26 16:19:54',NULL,1101,NULL,NULL),(323,1,'2015-05-29 19:16:46','2016-05-03 20:01:30',NULL,1102,NULL,'Lab Rooms - SOM 1 (D7A, D10); SOM 4 (C20/21, C17, A32).\nBSC Rooms - SOM 1 (D20B).\nIBC Protocols - 300159 (Exp. 8/12/18).'),(324,1,'2015-06-05 20:04:39','2015-11-13 20:09:51',NULL,1103,NULL,NULL),(325,1,'2015-06-10 20:26:42','2015-07-15 18:49:41',NULL,1104,NULL,NULL),(326,1,'2016-09-29 17:22:32','2016-09-29 17:22:32',NULL,1105,NULL,'<p>Doing air quality research; generate oil droplet, etc. Lab is still setting up; class 4 laser, will need to consult with rad safety to set up use of laser in the future. JL 9/15/16</p>'),(327,1,'2015-06-10 20:27:43','2015-11-13 20:07:18',NULL,1106,NULL,NULL),(328,1,'2016-09-30 15:11:53','2016-09-30 15:11:53',NULL,1107,NULL,'<p>Only cehmicals are ammonium persulfate and developer (+, -). 9/16/16 JL</p>'),(329,1,'2015-06-29 18:57:57','2016-06-03 21:04:22',NULL,1109,NULL,'Room 315 is shared by Mactutus and Booze and is used for rodent surgeries, measuring brain activity. Sevofluorane.'),(330,1,'2015-07-16 12:06:59','2016-05-03 20:03:09',NULL,1120,NULL,'Lab Rooms - SOM 2 (B3, B6).\nBSC Rooms - SOM 2 (B3).\nIBC Protocols - 300160 (Exp. 8/12/18).'),(331,1,'2016-11-22 14:59:58','2017-01-30 02:30:02',NULL,1119,NULL,'<p>Matt Breeden is not a real PI - see <a title=\"USC Website\" href=\"http://www.sc.edu/\">USC Website</a></p>\n<p>We will inspect Matt\'s lab just for <span style=\"text-decoration: underline;\"><strong>entertainment</strong></span> purposes</p>\n<ul>\n<li><strong><span style=\"text-decoration: underline;\">ul</span></strong></li>\n<li>ul</li>\n<li>ol</li>\n</ul>\n<ol>\n<li>ol</li>\n<li>testing</li>\n</ol>'),(332,1,'2015-09-15 20:22:22','2015-09-15 20:22:22',NULL,1124,NULL,NULL),(333,1,'2016-09-29 18:46:43','2016-09-29 18:46:43',NULL,1125,NULL,'<p>Lab just acquired 0B30 which usd to be Koley\'s. &nbsp;Only material in 3D33 is compressed air, no chemical used or stored. JL 9/29/16</p>'),(334,0,'2015-09-15 20:30:43','2016-10-04 19:26:39',NULL,1126,NULL,NULL),(335,1,'2015-09-30 13:32:32','2016-10-31 14:40:59',NULL,102,NULL,NULL),(338,1,'2015-10-28 13:38:59','2016-05-03 20:07:24',NULL,1144,NULL,'Lab Rooms - SOM 4 (C7, C8).\nBSC Rooms - SOM 4 (C7, C8).\nIBC Protocols - 300164 (Exp. 11/11/18).'),(339,1,'2015-11-05 18:34:45','2015-11-05 18:34:45',NULL,1253,NULL,NULL),(340,1,'2015-11-05 18:38:15','2015-11-05 18:38:15',NULL,1254,NULL,NULL),(341,1,'2015-11-09 13:33:57','2016-07-11 19:00:08',NULL,1255,NULL,NULL),(342,1,'2015-12-01 19:42:09','2016-06-09 16:14:36',NULL,1258,NULL,'12/01/15 - New lab startup meeting; lab will use FPLC and run enzymatic assays to test for cholesterol and lipids in human blood samples; lab will eventually perform cell culture work using macrophage cell lines - moving into PHRC 403; Fayad\'s old lab; Lab will be moving/installing BSC in room 403.  Discussed IBC protocol for using human serum/plasma samples.\nLab Rooms - PHRC (305).\nBSC Rooms - N/A.\nIBC Protocols - 300166 (Exp. 2/17/19).'),(343,1,'2016-02-04 16:12:29','2016-02-04 16:12:29',NULL,182,NULL,'This mock inspection is conducted to test hazard inventory, manage inspections, inspection checklist, report generation etc functionality of inspection module'),(344,1,'2015-12-07 16:15:53','2015-12-08 21:14:00',NULL,1259,NULL,NULL),(345,1,'2015-12-21 16:39:28','2016-07-11 18:59:52',NULL,1260,NULL,NULL),(346,0,'2016-02-22 01:49:56','2016-07-29 18:25:42',NULL,1261,NULL,NULL),(347,1,'2017-02-28 18:05:07','2017-02-28 18:05:07',NULL,1263,NULL,'<p>Room 228 is a dark room.</p>\n<p>IBC Protocols - 300110 (Exp. 11/09/19).</p>'),(348,1,'2017-02-28 18:02:59','2017-02-28 18:02:59',NULL,1264,NULL,'<p>Blood and tissue samples from a variety of vertebrates, but primarily wood storks and kiwi.</p>\n<p>Lab performs genomic analysis on birds (bleeding birds in field using needles).&nbsp;</p>'),(349,1,'2016-04-08 14:07:57','2016-04-08 14:07:57',NULL,1267,NULL,NULL),(350,0,'2016-05-17 19:44:04','2016-07-29 14:18:35',NULL,1269,NULL,NULL),(351,1,'2016-06-14 17:11:13','2016-06-14 17:16:56',NULL,1275,NULL,'PI will ask about using room 102 (across the hall) for cell culture work, but if not available then he will purchase a 4 ft BSC for room 103.\nPI uses mice but animal work is only done in ARF.\nPI may begin using lentivirus in late 2016 or early 2017.'),(352,1,'2016-09-19 17:51:59','2016-09-19 17:51:59',NULL,1276,NULL,'<p>No chemicals, laser equipment was moved to PI Office. Verify next year of lab use of space changed.</p>'),(353,1,'2016-06-21 19:28:01','2016-06-21 19:28:02',NULL,1277,NULL,NULL),(355,1,'2016-06-21 19:29:35','2016-06-21 19:29:35',NULL,1279,NULL,NULL),(356,1,'2016-06-21 19:31:02','2016-06-21 19:31:02',NULL,1280,NULL,NULL),(357,1,'2016-08-31 18:38:15','2016-08-31 18:38:15',NULL,1281,NULL,'<p>Lab is carpeted, originally an office. &nbsp;Only chemical used are bonding materials that are flammable (about 6-30 ml bottles).</p>'),(358,1,'2016-06-21 19:35:32','2016-06-22 18:51:40',NULL,1282,NULL,NULL),(361,1,'2016-06-21 19:36:41','2016-11-28 19:39:27',NULL,1285,NULL,NULL),(362,1,'2016-06-21 19:41:02','2017-03-01 14:08:38',NULL,1286,NULL,NULL),(364,1,'2016-06-22 18:14:03','2016-06-22 18:14:03',NULL,1288,NULL,NULL),(366,1,'2016-06-23 12:45:56','2016-06-23 18:07:49',NULL,1290,NULL,'Lab harvests brain tissue from mice.  Rodent surgeries performed in rooms 403 & 404.  Behavioral animal experiments done in ARF.'),(367,1,'2016-09-28 13:52:39','2016-09-28 13:52:39',NULL,1291,NULL,'<p>Sent new lab start-up guidance on 7/18/16. Lab uses mice in animal facility. Lab room 301 has two inner rooms with no other room numbers. No autoclave on 3rd floor, so lab will transport biohazard waste to a different floor (e.g. viral waste). Also transporting samples to 7th floor to use ultra-centrifuge for concentrating virus.</p>\n<p>IBC Protocol - 300173 (Exp. 09/14/19)</p>'),(368,1,'2016-06-27 15:51:22','2016-06-27 15:53:57',NULL,1272,NULL,NULL),(369,NULL,'2016-07-21 20:58:09','2016-07-21 20:58:09',NULL,NULL,NULL,NULL),(371,NULL,'2016-07-21 20:59:10','2016-07-21 20:59:10',NULL,NULL,NULL,NULL),(374,1,'2016-09-28 13:53:13','2016-09-28 13:53:13',NULL,1300,NULL,'<p>IBC Protocol - 300174 (Exp. 09/14/19)</p>'),(378,1,'2016-08-16 13:24:48','2016-08-18 16:24:42',NULL,1308,NULL,NULL),(379,1,'2016-08-25 13:37:58','2016-08-25 13:42:34',NULL,1311,NULL,NULL),(380,1,'2016-09-06 16:22:58','2016-09-06 18:47:50',NULL,1314,NULL,'New lab start-up with Dr. Armstrong on 9/6/16.\nHer lab examines how nutrient sensing by adipocytes control germline stem cell activity in the Drosophila ovary.'),(381,1,'2017-02-26 13:44:01','2017-02-26 13:44:01',NULL,1315,NULL,'<p>Lab uses transgenic zebrafish and mice (no virus in animals). PI indicated CLS 002 will be zebrafish room (add walls for inner room), but IBC protocol indicates CLS 006B for zebrafish housing.</p>\n<p>IBC Protocol - 300185 (Exp: 02/22/20)</p>'),(382,1,'2016-10-03 19:40:12','2016-10-03 19:44:48',NULL,1318,NULL,NULL),(383,1,'2016-10-04 19:25:51','2016-10-04 19:25:51',NULL,1319,NULL,NULL),(384,1,'2017-01-09 20:57:07','2017-01-09 21:10:40',NULL,1353,NULL,NULL),(385,1,'2017-01-11 16:30:27','2017-01-11 16:44:44',NULL,1357,NULL,NULL),(386,1,'2017-01-13 14:51:49','2017-01-13 14:51:49',NULL,1365,NULL,NULL),(387,1,'2017-02-28 17:56:11','2017-02-28 17:56:11',NULL,1366,NULL,'<p>Water samples are analyzed for fecal contamination (collect DNA).</p>\n<p>Lab stores some insecticides and pesticides (not currently used).</p>'),(388,1,'2017-01-13 14:55:50','2017-01-13 14:55:50',NULL,1367,NULL,NULL),(389,0,'2017-02-28 16:10:21','2017-02-28 16:10:21',NULL,1368,NULL,'<p>Garriet Smith will be retiring in 2017.</p>'),(390,1,'2017-02-28 18:12:19','2017-02-28 18:12:19',NULL,1369,NULL,'<p>Rats are housed in Penland rat facility and dissected in Science Building.</p>\n<p>Lab uses rat model to investigate the role of nutrition, exercise and stress on physiology and behavior.</p>'),(391,1,'2017-01-13 15:27:50','2017-01-13 15:27:50',NULL,1370,NULL,NULL),(392,1,'2017-01-13 15:28:38','2017-01-13 15:28:38',NULL,1371,NULL,NULL),(393,1,'2017-01-13 15:29:54','2017-01-13 15:29:54',NULL,1372,NULL,NULL),(394,1,'2017-01-13 15:36:14','2017-01-13 15:36:14',NULL,1373,NULL,NULL),(395,1,'2017-03-03 15:27:32','2017-03-03 15:27:32',NULL,1413,NULL,NULL);
