INSERT INTO `question` VALUES (1,0,'2014-06-11 11:48:20','2015-04-23 15:17:04',NULL,1,'A new test question for biological hazards','test','test',1,NULL,NULL,NULL,NULL),(2,0,'2016-03-10 19:22:06','2016-03-10 19:22:06',NULL,5,'Question #1',NULL,NULL,2,NULL,NULL,NULL,NULL),(3,0,'2014-06-11 11:48:25','2015-04-08 01:25:19',NULL,1,'new question',NULL,NULL,74,NULL,NULL,NULL,NULL),(4,1,NULL,'2015-04-07 23:51:59',NULL,NULL,'a new question',NULL,NULL,4,NULL,NULL,NULL,NULL),(5,1,NULL,'2015-04-07 23:51:59',NULL,NULL,NULL,NULL,NULL,5,NULL,NULL,NULL,NULL),(6,1,NULL,'2015-04-07 23:51:59',NULL,NULL,'new question for test child',NULL,NULL,6,NULL,NULL,NULL,NULL),(7,1,NULL,'2015-04-07 23:51:59',NULL,NULL,'adsfasdfasdfasdfasdf',NULL,NULL,7,NULL,NULL,NULL,NULL),(8,1,NULL,'2015-04-07 23:51:59',NULL,NULL,'asdfadsfasdf',NULL,NULL,8,NULL,NULL,NULL,NULL),(9,1,NULL,'2015-04-07 23:51:59',NULL,NULL,'asdfasdfadsf',NULL,NULL,9,NULL,NULL,NULL,NULL),(10,1,NULL,'2015-04-07 23:51:59',NULL,NULL,'asdfasdf',NULL,NULL,10,NULL,NULL,NULL,NULL),(11,0,'2014-06-11 13:51:13','2015-04-07 23:51:59',NULL,6,'Lab supervisor enforces policies that control access to the laboratory?','The laboratory supervisor must enforce the institutional policies that control access to the laboratory.','BMBL - Section IV (A-1)',11,NULL,NULL,NULL,NULL),(12,1,'2014-06-09 18:09:21','2015-04-07 23:51:59',NULL,7,'Is Chemical Hygiene Plan available, reviewed, signed and all appendices attached?','The OSHA Laboratory Standard requires that each laboratory must establish and maintain a lab-specific Chemical Hygiene Plan (CHP).  This document should include procedures, equipment, PPE and work practices that are designed to protect employees from the health hazards presented by hazardous chemicals used in the laboratory.  A model Chemical Hygiene Plan is available at http://ehs.sc.edu/LabSafety.htm.  This document must be customized for your specific lab by appending your lab chemical inventory standard operating procedures, and training documents for lab staff.  It must be reviewed and updated yearly and the clearance form signed by all lab personnel currently working in the laboratory. Ensure that the CHP is accessible to all lab personnel at all times.','OSHA Lab Standard',12,NULL,NULL,NULL,NULL),(13,0,'2014-06-09 17:37:36','2015-04-07 23:51:59',NULL,7,'INACTIVE Is safety data sheet for each chemical available, organized and accessible?',NULL,'OSHA Hazard Communication Standard',13,NULL,NULL,NULL,NULL),(14,1,NULL,'2015-04-07 23:51:59',NULL,8,'Is written, approved, signed SOP available?',NULL,NULL,14,NULL,NULL,NULL,NULL),(15,1,'2015-01-30 15:03:00','2015-08-07 14:55:46',NULL,9,'Is gas cylinder secured?','Compressed gas cylinders must be either placed on a cylinder stand on the floor or securely strapped/chained to a bench or wall in an upright position when stored or while in use.  This will prevent the cylinder from tipping over if accidentally bumped.','USC Lab Safety Policy',15,NULL,NULL,NULL,NULL),(16,1,'2015-01-29 21:36:46','2015-04-07 23:51:59',NULL,9,'Is gas cylinder capped if no regulator is attached?','Gas cylinders must be fitted with regulators while in use and valve caps when not in use.  Capping the cylinder is required even if the cylinder is empty. This protects the cylinder valve should the cylinder fall over.','USC Lab Safety Policy',16,NULL,NULL,NULL,NULL),(17,1,'2014-10-20 20:21:43','2015-04-07 23:51:59',NULL,10,'Is fume hood certified by EH&S within the last 12 months or after a recent repair?','The OSHA Lab Standard requires that a functional fume hood be provided to users of hazardous chemicals.\nEnvironmental Health and Safety performs the annual certification of all chemical fume hoods at USC. If the fume hood is not currently certified at the time of inspection, the inspector will notify the person in charge of certification.','OSHA Laboratory Standard',17,NULL,NULL,NULL,NULL),(18,1,'2015-02-12 19:49:33','2015-04-07 23:51:59',NULL,11,'Are BSCs installed so that possible airflow disruptions do not interfere with proper operations?','BSCs must be installed so that fluctuations of the room air supply and exhaust do not interfere with proper operations. BSCs should be located away from doors, windows that can be opened, heavily traveled laboratory areas, and other possible airflow disruptions.','BMBL, 5th Edition (Section IV - Part D.6)',18,NULL,NULL,NULL,NULL),(19,0,'2015-04-03 12:46:20','2015-04-07 23:51:59',NULL,12,'Signage is posted at the lab entrance when infectious agents are present?',NULL,NULL,19,NULL,NULL,NULL,NULL),(20,0,'2015-04-03 12:46:21','2015-04-07 23:51:59',NULL,12,'All persons entering the lab are advised of potential hazards and meet entry/exit requirements?',NULL,NULL,20,NULL,NULL,NULL,NULL),(21,0,'2015-04-03 12:46:22','2015-04-07 23:51:59',NULL,12,'Lab staff are provided medical surveillance and offered appropriate immunizations for agents in lab?',NULL,NULL,21,NULL,NULL,NULL,NULL),(22,0,'2014-06-11 13:49:02','2015-04-07 23:51:59',NULL,6,'Persons wash their hands after working with hazardous materials and before leaving the lab?','Persons must wash their hands after working with potentially hazardous materials and before leaving the laboratory.','BMBL - Section IV (A-2)',22,NULL,NULL,NULL,NULL),(23,0,'2014-06-25 17:46:34','2015-04-07 23:51:59',NULL,6,'Eating, drinking, handling contact lenses, applying cosmetics, and storing food are not be permitted in lab areas?','Eating, drinking, smoking, handling contact lenses, applying cosmetics, and storing food for human consumption must not be permitted in laboratory areas. Food must be stored outside the laboratory area in cabinets or refrigerators designated and used for this purpose.','BMBL - Section IV (A-3)',23,NULL,NULL,NULL,NULL),(24,0,'2014-06-11 14:22:39','2015-04-07 23:51:59',NULL,6,'Mouth pipetting is prohibited; mechanical pipetting devices are used?','Mouth pipetting is prohibited; mechanical pipetting devices must be used.','BMBL - Section IV (A-4)',24,NULL,NULL,NULL,NULL),(25,0,'2014-06-06 15:06:33','2015-04-07 23:51:59',NULL,6,'Policies for the safe handling of sharps have been developed and implemented?',NULL,NULL,25,NULL,NULL,NULL,NULL),(26,0,'2014-06-09 13:17:45','2015-04-07 23:51:59',NULL,6,'Needles are never bent, sheared, broken, recapped, removed from disposable syringes, or otherwise manipulated by hand before disposal?','In fact, when I know what is meant by \"mamelon\" and \"ravelin\",\nWhen I can tell at sight a Mauser rifle from a javelin,\nWhen such affairs as sorties and surprises I\'m more wary at,\nAnd when I know precisely what is meant by \"commissariat\",\nWhen I have learnt what progress has been made in modern gunnery,\nWhen I know more of tactics than a novice in a nunnery \nIn short, when I\'ve a smattering of elemental strategy  (bothered for a rhyme)\nYou\'ll say a better Major-General has never sat a gee.\nFor my military knowledge, though I\'m plucky and adventury,\nHas only been brought down to the beginning of the century;\nBut still, in matters vegetable, animal, and mineral,\nI am the very model of a modern Major-General.','testing compliance reference',26,NULL,NULL,NULL,NULL),(27,0,'2014-06-09 13:23:29','2015-04-07 23:51:59',NULL,6,'Used disposable needles and syringes are carefully placed in conveniently located puncture-resistant containers used for sharps disposal?',NULL,NULL,27,NULL,NULL,NULL,NULL),(28,1,'2014-06-09 17:42:06','2015-04-07 23:51:59',NULL,7,'Is EH&S General Lab Safety training completed and documented for all current lab personnel?','All lab personnel including faculty, staff, graduate students and undergraduate students must attend the Basic Laboratory Safety Training offered  by EH&S before commencing work in the laboratory.  Certificates provided after the training must be kept on file. The EH&S training schedule is posted at http://www.sc.edu/ehs/LabSafety.htm under \"Training\".','USC Lab Safety Policy',28,NULL,NULL,NULL,NULL),(29,0,'2014-06-09 17:44:20','2015-04-07 23:51:59',NULL,7,'INACTIVE Is hazardous waste training completed, current and documented for all lab personnel?',NULL,NULL,29,NULL,NULL,NULL,NULL),(30,0,'2014-06-09 17:59:26','2015-04-07 23:51:59',NULL,13,'Is fully stocked first aid kit available?',NULL,NULL,30,NULL,NULL,NULL,NULL),(31,0,'2014-06-09 18:04:15','2015-04-07 23:51:59',NULL,13,'Is safety shower available and functional?',NULL,NULL,31,NULL,NULL,NULL,NULL),(32,0,'2014-06-09 18:06:08','2015-04-07 23:51:59',NULL,13,'Is path to safety shower unobstructed?',NULL,NULL,32,NULL,NULL,NULL,NULL),(33,1,'2014-06-09 18:16:12','2015-04-07 23:51:59',NULL,10,'Is fume hood airflow within 80-150 lfm?','Each hood shall maintain an average face velocity of 80-120 fpm with no face velocity measurement more than plus or minus 20% of average.','ANSI/AIHA Z9.5',33,NULL,NULL,NULL,NULL),(34,1,'2014-06-09 18:27:20','2016-11-07 19:13:18',NULL,14,'Are written standard operating procedures (SOPs) established for each particularly hazardous chemical, procedure and/or equipment?','All procedures that use particularly hazardous chemicals (PHS) or equipment must have a written Standard Operating Procedures (SOPs) that indicate the detailed procedure, required PPE, protective measures/controls, precautionary measures, emergency response and the list of personnel approved to perform the procedure.  For example, equipment that uses high pressure, temperature, high voltage and UV light pose particular hazards and required written SOPs for their use.  Select carcinogens, reporoductive toxins, acutely toxic chemicals and reactive chemicals are all considered particularly hazardous. A list of PHS can be found at https://www.safety.duke.edu/laboratory-safety/chemical-hygiene/particularly-hazardous-substances.  A template SOP can be requested from jlocke@mailbox.sc.edu.\n\nCFR 1910.1450(e)(1)\nWhere hazardous chemicals as defined by this standard are used in the workplace, the employer shall develop and carry out the provisions of a written Chemical Hygiene Plan which is: 1910.1450(e)(3)(i)\nStandard operating procedures relevant to safety and health considerations to be followed when laboratory work involves the use of hazardous chemicals;','OSHA Laboratory Standard CFR 1910.1450 and USC Lab Safety Policy.',34,NULL,NULL,NULL,NULL),(35,1,'2014-06-09 18:41:29','2015-04-07 23:51:59',NULL,9,'Is gas cylinder labeled?','Original cylinder labels from the supplier must be intact and readable.  Cylinder colors may not be used to identify the gas content of cylinders.  Unlabeled cylinders should never be used and returned immediately to the vendor.','USC Lab Safety Policy',35,NULL,NULL,NULL,NULL),(36,1,'2014-06-09 18:43:39','2015-08-07 15:02:39',NULL,9,'Are gas valves and connections leak tested and leak free?','Valves, fittings and connections must be tested initially and periodically for possible leaks.','USC Lab Safety Policy',36,NULL,NULL,NULL,NULL),(37,1,'2014-06-09 18:46:36','2015-04-07 23:51:59',NULL,9,'Is gas cylinder transported with cylinder cart?','Hand trucks with chain must be available and used in labs to enable safe transport of cylinders.','USC Lab Safety Policy',37,NULL,NULL,NULL,NULL),(38,1,'2014-06-09 18:50:51','2015-08-07 15:16:59',NULL,15,'Is written SOP developed for use of nanomaterial?','Use of nanomaterials require a written SOP.  Universal precautions must be observed when handling nanomaterials.  Special techniques and protective measures must be employed when weighing, aerosolizing and other methods of manipulating the materials.','USC Lab Safety Policy',38,NULL,NULL,NULL,NULL),(39,1,'2014-06-09 18:55:58','2015-08-07 15:15:58',NULL,15,'Are proper PPEs used when handling nanomaterials?','Proper PPEs identified for propection when handling nanomaterials must be used.','USC Lab Safety Policy',40,NULL,NULL,NULL,NULL),(40,1,'2014-06-09 18:57:01','2015-08-07 15:15:58',NULL,15,'Is nanomaterial handled inside the fume hood?','Powdered nanomaterials must be handled inside the fume hood as much as possible.  If balance cannot be located inside fume hood, use tare container technique (weighing the container, adding nanomaterials to container inside the fume hood and weighing a closed container with nanomaterials outside of the fume hood).','USC Lab Safety Policy',39,NULL,NULL,NULL,NULL),(41,0,'2014-06-09 19:14:34','2015-04-07 23:51:59',NULL,6,'Non disposable sharps are placed in a hard walled container for transport to a processing area for decontamination, preferably by autoclaving?',NULL,NULL,41,NULL,NULL,NULL,NULL),(42,0,'2014-06-11 12:16:02','2015-04-07 23:51:59',NULL,6,'Broken glassware is not handled directly?',NULL,NULL,42,NULL,NULL,NULL,NULL),(43,0,'2014-06-11 12:23:31','2015-04-07 23:51:59',NULL,6,'Plasticware is substituted for glassware whenever possible?',NULL,NULL,43,NULL,NULL,NULL,NULL),(44,0,'2014-06-11 12:26:26','2015-04-07 23:51:59',NULL,6,'All procedures are performed to minimize the creation of splashes and/or aerosols?',NULL,NULL,44,NULL,NULL,NULL,NULL),(45,0,'2014-06-11 12:29:57','2015-04-07 23:51:59',NULL,6,'Work surfaces are decontaminated after completion of work and after any spill or splash of potentially infectious material with appropriate disinfectant?',NULL,NULL,45,NULL,NULL,NULL,NULL),(46,1,'2014-06-11 14:12:40','2015-08-07 15:23:24',NULL,16,'Are DEA drugs stored in secured place?','DEA-controlled substances must be stored in secured location in permanent locked cabinets or safe.','DEA Policy',46,NULL,NULL,NULL,NULL),(47,1,'2014-06-11 14:17:18','2015-04-07 23:51:59',NULL,16,'Is DEA and State permit available and current?','Laboratory must have an approved and current permit to use DEA-controlled substances for scientific research.','DEA Policy',47,NULL,NULL,NULL,NULL),(48,0,'2014-06-16 14:40:36','2015-04-07 23:51:59',NULL,6,'Biological and infectious waste (e.g. cultures, stocks) are properly decontaminated before disposal?',NULL,NULL,48,NULL,NULL,NULL,NULL),(49,0,'2014-06-18 12:00:42','2015-04-07 23:51:59',NULL,6,'The lab supervisor ensures that lab personnel receive appropriate training regarding their duties, the necessary precautions to prevent exposures, and exposure evaluation procedures?',NULL,NULL,49,NULL,NULL,NULL,NULL),(50,0,'2014-06-26 16:40:07','2015-04-07 23:51:59',NULL,7,'INACTIVE Are safety manuals for laboratory equipment and/or processes available?',NULL,NULL,50,NULL,NULL,NULL,NULL),(51,0,'2014-06-26 16:58:13','2015-04-07 23:51:59',NULL,7,'INACTIVE Chemical fume hood certified',NULL,NULL,51,NULL,NULL,NULL,NULL),(52,0,'2014-06-26 17:04:29','2015-04-07 23:51:59',NULL,7,'INACTIVE Fume hood airflow at 100 lfm',NULL,NULL,52,NULL,NULL,NULL,NULL),(53,0,'2014-06-26 17:08:00','2015-04-07 23:51:59',NULL,7,'INACTIVE Chemical inventory available, complete and up-to date',NULL,NULL,53,NULL,NULL,NULL,NULL),(54,0,'2014-06-26 17:12:21','2015-04-07 23:51:59',NULL,7,'INACTIVE Chemical fume hood has minimal clutter',NULL,NULL,54,NULL,NULL,NULL,NULL),(55,0,'2014-06-26 17:17:06','2015-04-07 23:51:59',NULL,7,'INACTIVE Fume hood sash is clean, clear and in good condition',NULL,NULL,55,NULL,NULL,NULL,NULL),(56,0,'2014-06-26 17:23:03','2015-04-07 23:51:59',NULL,7,'INACTIVE Fume hood airfoil is unobstructed',NULL,NULL,56,NULL,NULL,NULL,NULL),(57,0,'2014-06-26 17:26:23','2015-04-07 23:51:59',NULL,7,'INACTIVE Fume hood light functional',NULL,NULL,57,NULL,NULL,NULL,NULL),(58,0,'2014-06-26 17:27:12','2015-04-07 23:51:59',NULL,7,'INACTIVE Fume hood alarm is functional',NULL,NULL,58,NULL,NULL,NULL,NULL),(59,0,'2014-06-26 17:28:46','2015-04-07 23:51:59',NULL,7,'INACTIVE Fume hood side panels are intact',NULL,NULL,59,NULL,NULL,NULL,NULL),(60,0,'2014-06-26 17:31:33','2015-04-07 23:51:59',NULL,7,'INACTIVE Appropriate fume hood sash height is used',NULL,NULL,60,NULL,NULL,NULL,NULL),(61,0,'2014-06-26 18:23:13','2015-04-08 01:25:15',NULL,1,'Test Question',NULL,NULL,3,NULL,NULL,NULL,NULL),(62,0,'2014-06-26 18:23:37','2015-04-08 01:25:17',NULL,1,'asdf',NULL,NULL,61,NULL,NULL,NULL,NULL),(63,1,'2014-06-26 18:27:48','2015-08-12 13:22:41',NULL,17,'Is the amount of gas reasonable for the procedure so that the IFC\'s MAQ for highly toxic gases is not exceeded in the control are where the lab is located?','The international Fire Code (IFC) lists the Maximum Allowable Quantities (MAQ) for highly toxic gases stored and used in a control area depending on location of the control area relative to ground level. MAQs are reduced accordingly in control areas located on floors above ground level.','International Fire Code',63,NULL,NULL,NULL,NULL),(64,1,'2014-06-26 18:31:06','2015-08-12 13:54:54',NULL,17,'Is highly toxic gas concentration reasonable for lab procedure?','A diluted form of the gas must be used as much as possible to reduce toxicity risk.','USC Lab Safety Policy',64,NULL,NULL,NULL,NULL),(65,1,'2014-06-26 18:32:03','2015-08-12 14:30:09',NULL,17,'Is written SOP for use of highly toxic gas available, approved by PI and signed by authorized users?','Use of highly toxic gases require a written SOP that follows USC Lab Safety-approved format, approved by the PI and signed by authorized users.','USC Lab Safety Policy',68,NULL,NULL,NULL,NULL),(66,1,'2014-06-26 19:07:41','2015-08-12 14:11:12',NULL,17,'Is cylinder of highly toxic gas secured, stored and dispensed in ventilated, sprinklered gas cabinet or chemical fume hood?','Cylinders of highly toxic gases must be secured, stored and dispensed in a ventilated, sprinklered gas cabinet or chemical fume hood.','International Fire Code',65,NULL,NULL,NULL,NULL),(67,1,'2014-06-26 19:12:16','2015-08-12 14:13:51',NULL,17,'Is gas specific detector installed at point of release and point of use, and calibrated bi-annually or as recommended by the manufacturer?','Use of highly toxic gases require a detection system installed at the point of release and point of use. The gas detector must be calibrated periodically as recommended by the manufacturer.','International Fire Code',66,NULL,NULL,NULL,NULL),(68,1,'2014-06-26 19:15:03','2015-04-07 23:51:59',NULL,18,'Is written SOP for use of flammable gas established?','Use of flammable gas requires that a written SOP be established and strictly followed by authorized users of the material.','USC Lab Safety Policy',68,NULL,NULL,NULL,NULL),(69,1,'2014-06-26 19:17:03','2015-04-07 23:51:59',NULL,18,'Are non-sparking tools available for cylinder change-out?','Only non-sparking tools may be used when connecting CGA and piping to the gas cylinder as well as during cylinder change-out.','USC Lab Safety Policy',69,NULL,NULL,NULL,NULL),(70,1,'2014-06-26 19:18:30','2015-04-07 23:51:59',NULL,18,'Is gas cylinder in appropriate location?','Gas cylinders must be located away from means of egress, walkways and from sources of heat, sparks or electricity.','USC Lab Safety Policy',70,NULL,NULL,NULL,NULL),(71,1,'2014-06-26 20:09:12','2015-08-10 18:32:59',NULL,19,'Is cryogen tank/dewar stored in a well-ventilated area?','Large cryogen tanks must be stored in a well-ventilated area.  Storage of cryogens in confined, unventilated spaces such as a cold room is prohibited.  Cryogen tanks are equipped with pressure relief valves to vent out excess gas that would otherwise cause excessive pressure inside the tank.  Gas released from cryogen taks can replace oxygen in the room, causing asphyxiation hazard due to oxygen deficiency.','USC Lab Safety Policy',71,NULL,NULL,NULL,NULL),(72,1,'2014-06-26 20:11:07','2015-08-10 18:36:44',NULL,19,'Is oxygen monitor available where cryogen tanks are stored in a room with unreliable ventilation?','Where cryogen tanks are stored in a room with unreliable ventilation, an oxygen monitor must be mounted on the wall to alert occupants of developing oxygen deficiency.','USC Lab Safety Policy',72,NULL,NULL,NULL,NULL),(73,1,'2014-06-26 20:14:16','2015-08-10 18:37:46',NULL,19,'Are required PPE (cryogen gloves, face shield) available and used when handling cryogens?','Cryogen gloves, face shield over safety goggles and full coverage clothing and footwear are required when handling cryogens.','USC Lab Safety Policy',73,NULL,NULL,NULL,NULL),(74,0,'2014-07-14 21:35:37','2015-04-08 01:25:19',NULL,1,'THIS IS A TEST',NULL,NULL,62,NULL,NULL,NULL,NULL),(75,1,'2014-09-08 16:58:28','2016-11-22 15:03:30',NULL,20,'Does the lab supervisor control access to the laboratory?','<p>The laboratory supervisor must enforce the institutional policies that control access to the laboratory.</p>','<p>BMBL, 5th Edition (Section IV - Part A.1)</p>',75,NULL,NULL,NULL,NULL),(76,1,'2014-09-08 17:03:10','2015-04-07 23:51:59',NULL,20,'Do persons wash their hands after working with potentially hazardous materials and before leaving the lab?','Persons must wash their hands after working with potentially hazardous materials and before leaving the laboratory.','BMBL, 5th Edition (Section IV - Part A.2)',76,NULL,NULL,NULL,NULL),(77,1,'2014-09-08 17:07:05','2016-09-12 18:37:24',NULL,20,'Does the lab prohibit eating and drinking, and storing food in lab areas?','Eating, drinking, smoking, handling contact lenses, applying cosmetics, and storing food for human consumption must not be permitted in laboratory areas. Food must be stored outside the laboratory area in cabinets or refrigerators designated and used for this purpose.','BMBL, 5th Edition (Section IV - Part A.3)',77,NULL,NULL,NULL,NULL),(78,1,'2014-09-08 17:10:01','2015-04-07 23:51:59',NULL,20,'Is mouth pipetting prohibited?','Mouth pipetting is prohibited; mechanical pipetting devices must be used.','BMBL, 5th Edition (Section IV - Part A.4)',78,NULL,NULL,NULL,NULL),(79,0,'2014-09-22 12:50:51','2015-04-07 23:51:59',NULL,20,'Have policies for the safe handling of sharps been developed and implemented?','Policies for the safe handling of sharps, such as needles, scalpels, pipettes, and broken glassware must be developed and implemented. Whenever practical, laboratory supervisors should adopt improved engineering and work practice controls that reduce risk of sharps injuries.','BMBL, 5th Edition (Section IV - Part A.5)',79,NULL,NULL,NULL,NULL),(80,1,'2014-09-24 14:38:24','2015-04-07 23:51:59',NULL,20,'Does the lab carefully manage use of needles (e.g. not recapping needles)?','Careful management of needles and other sharps are of primary importance. Needles must not be bent, sheared, broken, recapped, removed from disposable syringes, or otherwise manipulated by hand before disposal.','BMBL, 5th Edition (Section IV - Part A.5a)',80,NULL,NULL,NULL,NULL),(81,1,'2014-09-24 19:00:51','2015-04-07 23:51:59',NULL,20,'Are used needles and syringes placed in a conveniently located puncture-resistant sharps container?','Used disposable needles and syringes must be carefully placed in conveniently located puncture-resistant containers used for sharps disposal.','BMBL, 5th Edition (Section IV - Part A.5b)',81,NULL,NULL,NULL,NULL),(82,1,'2014-10-09 16:54:03','2015-04-07 23:51:59',NULL,20,'Are non-disposable sharps placed in a hard walled container?','Non disposable sharps must be placed in a hard walled container for transport to a processing area for decontamination, preferably by autoclaving.','BMBL, 5th Edition (Section IV - Part A.5c)',82,NULL,NULL,NULL,NULL),(83,1,'2014-10-09 16:54:43','2015-04-07 23:51:59',NULL,20,'Is a mechanical device (e.g. brush and dustpan) used for handling broken glassware?','Broken glassware must not be handled directly. Instead, it must be removed using a brush and dustpan, tongs, or forceps. Plasticware should be substituted for glassware whenever possible.','BMBL, 5th Edition (Section IV - Part A.5d)',83,NULL,NULL,NULL,NULL),(84,0,'2014-10-17 19:47:55','2015-04-07 23:51:59',NULL,7,'INACTIVE Lab Specific safety training?','Is lab-specific training provided and documented for all lab personnel?','USC Lab Safety Policy',84,NULL,NULL,NULL,NULL),(85,1,'2014-10-17 19:50:11','2015-04-07 23:51:59',NULL,7,'Is lab-specific training provided and documented for lab personnel?','All personnel working in the laboratory requires lab-specific training focusing on specific procedures, use and location of safety equipment, use and location of personal protective equipment, and emergency procedures.','USC Lab Safety Policy',85,NULL,NULL,NULL,NULL),(86,1,'2014-10-17 19:56:28','2015-04-07 23:51:59',NULL,7,'Is EH&S Hazardous Waste Training completed, current and documented for all lab personnel?','All personnel working in the laboratory and generating hazardous waste are required to complete Hazardous Waste training prior to working in the lab and complete a refresher training annually thereafter.','USC Hazardous Waste Policy',86,NULL,NULL,NULL,NULL),(87,1,'2014-10-17 19:59:50','2015-04-07 23:51:59',NULL,7,'Is a chemical inventory complete, updated and accessible?','Laboratories are required to maintain an updated inventory of chemicals that are stored in the laboratory.  At the minimum, the chemical inventory must indicate the name of the chemical, the CAS number and the quantity.  THe chemical inventory must be made accessible to all lab personnel.','USC Lab Safety Policy',87,NULL,NULL,NULL,NULL),(88,1,'2014-10-17 20:03:58','2016-07-18 17:16:24',NULL,7,'Is safety data sheet (SDS) for each chemical available, current, organized and accessible?','A Safety Data Sheet (SDS) must be available for each chemical in the laboratory.  These documents, when provided with the chemical shipment, must be retained in the lab and organized alphabetically in a binder.  If the SDS is not provided with the shipment, the company will provide the location of the SDS on their website.  Visit the website and print out the SDS.  On-line access to SDS is acceptable only for chemicals that do not pose serious and immediate danger to life and health.  Particularly hazardous chemicals must have printed SDS readily accessible in the lab.','USC Lab Safety Policy',88,NULL,NULL,NULL,NULL),(89,1,'2014-10-17 20:10:40','2016-08-08 17:41:14',NULL,7,'Is eyewash available within 50 ft or 10 seconds travel, functional, maintained and maintenance checks documented?','Eyewash must be available within 50 feet or ten seconds of travel without any obstruction along the path.\nEyewash must be flushed weekly to maintain clear running water in the pipes.  Maintenance checks must be documented.','ANSI Standard for Safety Showers and Eyewash',89,NULL,NULL,NULL,NULL),(90,1,'2014-10-17 20:13:51','2015-04-07 23:51:59',NULL,7,'Is safety shower available within 50 ft or 10 seconds travel, functional, maintained and maintenance checks documented?','Safety shower must be available within 50 feet or ten seconds of travel without any obstruction along the path. Maintenance checks must be conducted at least twice a year, and these checks must be documented.','ANSI Standard for Safety Shower and Eyewash',90,NULL,NULL,NULL,NULL),(91,1,'2014-10-17 20:16:43','2015-08-05 13:50:57',NULL,7,'Is path to the eyewash and safety shower clear and free of obstruction?','Path to and around the safety shower and eyewash must be kept free of obstruction.','USC Lab Safey Policy',91,NULL,NULL,NULL,NULL),(92,1,'2014-10-17 20:37:15','2015-04-07 23:51:59',NULL,7,'Is a fully-stocked spill kit available and current?','A fully stocked spill kit is essential for future spill response.  The kit must include inert absorbents (kitty litter, vermiculite), acid neutralizers, base neutralizers, spill pillow, plastic broom,plastic dust pan, non-reactive bags and bucket to contain the chemical spill waste.  Alternatively, a commercial kit that features universal absorbent pillows or wipes can be \npurchased.\nAll laboratories must keep a fully stocked spill kit. Where a departmental or building centralized kit is available, the laboratory must a the minimum store absorbents that can be used to immediately contain a spill.','USC Lab Safety Policy',92,NULL,NULL,NULL,NULL),(93,1,'2014-10-17 20:39:36','2015-04-07 23:51:59',NULL,7,'Is a fully-stocked first-aid kit available and current?','All laboratories are required to keep a first-aid kit to enable treatment of minor cuts and burns and other minor injuries.  The first-aid kit must be fully stocked with expired items removed.','USC Lab Safety Policy',93,NULL,NULL,NULL,NULL),(94,1,'2014-10-20 19:42:37','2015-04-07 23:51:59',NULL,7,'Are approriate hand protection available and in good condition for specific hazardous materials handled in the lab? (e.g., latex, nitrile, leather, cryogen, autoclave)','Lab personnel must consult the glove manufacturer and supplier websites for glove compatibility chart to be able to choose the appropriate gloves for the specific chemicals being handled in the lab.  Cryogenic gloves, autoclave gloves, leather gloves and other specialized gloves must be available as needed.','OSHA PPE Standard',94,NULL,NULL,NULL,NULL),(95,1,'2014-10-20 19:54:29','2015-04-07 23:51:59',NULL,7,'Are approriate eye and face protection available and in good condition for specific hazardous materials handled in the lab? (e.g., safety glasses, safety goggles, face shield, UV shield)','Eye and face protection must be available in the lab.  The Principal Investigator or the Lab Manager must ensure that these PPEs are available, clean, and used by personnel as needed.','OSHA PPE Standard',95,NULL,NULL,NULL,NULL),(96,1,'2014-10-20 19:57:43','2015-04-07 23:51:59',NULL,7,'Is splash apron available and in good condition for handling corrosives?','A chemical splash apron must be available and worn when pouring corrosive chemicals.','OSHA PPE Standard',96,NULL,NULL,NULL,NULL),(97,1,'2014-10-20 20:01:17','2015-08-05 13:54:07',NULL,7,'Are lab coats available and in good condition?','Laboratory coats must be available and worn when working with hazardous materials.','OSHA PPE Standard',97,NULL,NULL,NULL,NULL),(98,1,'2014-10-20 20:04:59','2015-04-07 23:51:59',NULL,7,'Are PPEs used appropriately according to hazards used and/or stored in the laboratory and according to USC PPE policy?','PPE must be available to and used by lab personnel according to the USC PPE Policy.','USC Lab Safety Policy',98,NULL,NULL,NULL,NULL),(99,1,'2014-10-20 20:13:11','2015-04-07 23:51:59',NULL,7,'Is appropriate ear protection available for protection against unusually loud equipments and/or procedures?','Mufflers and ear plugs must be available where high noise equipment are present and used in the lab.','OSHA Hearing Protection Standard',99,NULL,NULL,NULL,NULL),(100,1,'2014-10-20 20:15:29','2015-04-07 23:51:59',NULL,7,'If a respirator/s is/are present in the lab, are lab personnel medically cleared and fit tested to use the respirators?','Engineering controls effectively eliminates inhalation hazards in the laboratory such that the use of a respirator is not required.  In special casess where respirator must be used,  consult Ken Mixon of EH&S to determine the type of respirator needed.  The respirator user is required to participate in the EH&S Respiratory Protection Program by going through a medical evaluation and respirator fit testing before respirator can be worn in the lab.','OSHA Respiratory Protection Standard',100,NULL,NULL,NULL,NULL),(101,1,'2014-10-20 20:18:41','2016-04-13 19:00:32',NULL,7,'Is laboratory free of any sign of release of chemical contaminant?','Any release of chemical and other hazardous substances in the laboratory must be avoided and properly controlled if it does happen.','USC Lab Safety Policy',101,NULL,NULL,NULL,NULL),(102,1,'2014-10-21 19:38:50','2015-08-07 14:41:57',NULL,10,'Is fume hood free of stored unnecessary items?','Fume hoods must be kept clutter-free for effective capture, containment and elimination of contaminants from hazardous materials being handled inside the unit.  The chemical fume hood must have sufficient work space and should be kept clean and free of unnecessary chemicals, glasswares and equipment to ensure that fume hood work space is available when needed.  The chemical fume hood may not be used as storage area for equipment, chemicals or chemical wastes.','USC Lab Safety Policy',102,NULL,NULL,NULL,NULL),(103,1,'2014-10-21 19:42:53','2015-04-07 23:51:59',NULL,10,'Is fume hood sash clear and in good condition?','Fume hood sash must be kept clear to allow clear view of the inside of the fume hood at all times.','USC Lab Safety Policy',103,NULL,NULL,NULL,NULL),(104,1,'2014-10-21 19:46:38','2015-08-07 14:46:07',NULL,10,'Is fume hood airfoil free of obstruction?','Fume hood airfoil must be free of blockage to ensure proper containment and flow of air inside the fume hood.','USC Safety Policy',105,NULL,NULL,NULL,NULL),(105,1,'2014-10-21 19:48:12','2015-08-07 14:46:04',NULL,10,'Is fume hood lighting in good working condition?','Light bulbs must be kept in working condition to provide sufficient lighting inside the fume hood.','USC Lab Safety Policy',106,NULL,NULL,NULL,NULL),(106,1,'2014-10-21 19:50:58','2015-08-07 14:46:02',NULL,10,'Is fume hood alarm, if present, in good working condition?','The fume hood monitor and alarm system is designed to alert workers of insufficient airflow and other problems with the fume hood. NEVER place the alarm on permanent mute mode when it goes off.  Contact Jocelyn Locke at 777-7650 or Facilities 777-WORK if you hear the fume hood alarm to have the problem diagnosed and fixed.','USC Lab Safety Policy',107,NULL,NULL,NULL,NULL),(107,1,'2014-10-21 19:52:26','2015-08-07 14:46:07',NULL,10,'Are fume hood side panels intact?','Fume hood side panels must be kept intact to ensure containment of contaminants inside.','USC Lab Safety Policy',104,NULL,NULL,NULL,NULL),(108,1,'2014-10-21 19:54:49','2015-04-07 23:51:59',NULL,10,'Is proper fume hood sash height adjusted based on fume hood use or status?','Fume hood sash must be kept in closed position when not in use or when unattended operations are on-going.  When working with chemicals, the sash must be kept at 18 inches height or below for maximum protection of the worker.','USC Lab Safety Policy',108,NULL,NULL,NULL,NULL),(109,1,'2014-10-22 15:27:18','2015-04-07 23:51:59',NULL,9,'Is gas cylinder located away from high traffic areas, doorways, electrical sources, heat sources?','Storage areas for gas cylinders must be away from high traffic areas such as walkways and doorways and away from sources of heat and/or electricity.','USC Lab Safety Policy',109,NULL,NULL,NULL,NULL),(110,1,'2014-10-22 15:37:35','2015-04-07 23:51:59',NULL,9,'Are gas cylinders segregated by chemical compatibility?','Flammable gasses must be stored away from oxidizers while toxic gases must be stored separately from inert and simple asphyxiant gases.','USC Lab Safety Policy',110,NULL,NULL,NULL,NULL),(111,1,'2014-10-22 15:40:05','2015-04-07 23:51:59',NULL,9,'Is cylinder hydrostatic test current?','Hydrostatic testing of cylinders are stamped on the cylinder and should not be more than 5 years for most cylinders.  Cylinders that have been stored in the lab for 3 years or more should be checked for hydrostatic test date and returned to the supplier immediately if the testing is not current.','USC Lab Safety Policy',111,NULL,NULL,NULL,NULL),(112,1,'2014-10-22 19:03:48','2016-07-18 17:34:11',NULL,14,'Are printed SDSs for all PHS on file and organized in the lab and readily accessible to all lab personnel?','Safety data sheets for all chemicals in the laboratory must be on file and accessible to all workers at all times.','Hazard Communication Standard',112,NULL,NULL,NULL,NULL),(113,1,'2014-10-22 19:32:41','2015-08-07 12:31:47',NULL,14,'Are lab personnel authorized to work with PHS chemical, equipment and procedure trained on the procedures and the training documented on written SOPs?','Lab personnel authorized to work on PHS materials, equipment and procedures are required to undergo procedure and hazard-specific SOP training and demonstrate proficiency in implementing these procedures.  These trainings must be clearly documented.','USC Lab Safety Policy',113,NULL,NULL,NULL,NULL),(114,1,'2014-11-03 22:34:20','2015-04-08 19:41:43',NULL,22,'Does the lab supervisor control access to the laboratory?','The laboratory supervisor must enforce the institutional policies that control access to the laboratory.','BMBL, 5th Edition (Section IV - Part A.1)',114,NULL,NULL,NULL,NULL),(115,1,'2014-11-03 22:43:56','2015-04-08 19:41:43',NULL,22,'Do persons wash their hands after working with potentially hazardous materials and before leaving the lab?','Persons must wash their hands after working with potentially hazardous materials and before leaving the laboratory.','BMBL, 5th Edition (Section IV - Part A.2)',115,NULL,NULL,NULL,NULL),(116,0,'2014-11-04 15:18:50','2015-04-07 23:51:59',NULL,23,'INACTIVE test question for general hazards','You better do this.','fake reference',116,NULL,NULL,NULL,NULL),(117,1,'2014-11-04 20:11:38','2015-09-23 20:27:31',NULL,24,'Does lab have Radioactive Material Authorization (RMA) available?','XXXXXXXXX YYYYYYY test only','RHA 2.6.1',118,NULL,NULL,NULL,NULL),(118,1,'2014-11-04 20:22:55','2015-09-23 20:27:31',NULL,24,'Is current drawing of the laboratory available and represents authorized and actual work areas?',NULL,'RHA 2.6.2',117,NULL,NULL,NULL,NULL),(119,1,'2014-11-04 20:28:52','2015-04-07 23:51:59',NULL,24,'Are Isotope Usage records properly maintained?',NULL,'RHA 1.5.1',119,NULL,NULL,NULL,NULL),(120,1,'2014-11-12 19:16:02','2015-04-07 23:51:59',NULL,27,'Are written operating procedures available and posted near the laser?',NULL,'ANSI 4.4.1',120,NULL,NULL,NULL,NULL),(121,1,'2014-11-12 19:17:44','2015-04-07 23:51:59',NULL,27,'Are written emergency procedures available and posted near the laser?',NULL,'4.4.1',121,NULL,NULL,NULL,NULL),(122,1,'2014-11-12 19:23:56','2015-04-07 23:51:59',NULL,27,'Are alignment procedures available and posted near the laser?',NULL,'4.4.5',122,NULL,NULL,NULL,NULL),(123,1,'2014-11-12 19:30:06','2015-04-07 23:51:59',NULL,27,'Have all operators of laser(s) been trained in the use of the specific laser and completed in laboratory training?',NULL,'4.4.3',123,NULL,NULL,NULL,NULL),(124,1,'2014-11-12 19:41:45','2015-04-07 23:51:59',NULL,27,'Are all laser areas properly posted with appropriate warning signs?',NULL,'4.3.9',124,NULL,NULL,NULL,NULL),(125,1,'2014-11-12 19:46:01','2015-04-07 23:51:59',NULL,27,'Is access to the laser area controlled with appropriate engineering or procedural entry way control?',NULL,'4.3.10.2',125,NULL,NULL,NULL,NULL),(126,1,'2014-11-12 20:09:05','2015-04-07 23:51:59',NULL,27,'Are only authorized personnel allowed in laser area and to operate the laser?',NULL,'4.4.4',126,NULL,NULL,NULL,NULL),(127,1,'2014-11-12 20:12:14','2015-04-07 23:51:59',NULL,27,'Is appropriate eye protection for the laser available and worn?',NULL,'4.6.2.1',127,NULL,NULL,NULL,NULL),(128,1,'2014-11-12 20:21:16','2015-04-07 23:51:59',NULL,24,'Are radioactive material transfer records properly maintained?',NULL,'1.5.1',128,NULL,NULL,NULL,NULL),(129,1,'2014-11-12 20:51:31','2015-04-07 23:51:59',NULL,24,'Are radioactive waste disposal logs properly maintained?',NULL,'1.5.1',129,NULL,NULL,NULL,NULL),(130,1,'2014-11-12 20:54:13','2015-04-07 23:51:59',NULL,24,'Are the quarterly inventories of radioactive material properly maintained?',NULL,'1.5.1',130,NULL,NULL,NULL,NULL),(131,1,'2014-11-12 20:54:56','2015-04-07 23:51:59',NULL,24,'Have weekly wipe surveys of isotope work areas been properly maintained?',NULL,'3.36.1; 1.7.2',131,NULL,NULL,NULL,NULL),(132,1,'2014-11-12 20:55:37','2015-04-07 23:51:59',NULL,24,'Is the annual in-laboratory training log current?',NULL,'6.4',132,NULL,NULL,NULL,NULL),(133,1,'2014-11-12 20:56:55','2015-04-07 23:51:59',NULL,24,'Are copies of training certificates available for all personnel working with the material?',NULL,'6.4',133,NULL,NULL,NULL,NULL),(134,1,'2014-11-12 20:58:17','2015-04-07 23:51:59',NULL,24,'Are the current versions of the Title A card, RHA20, and Emergency Phone numbers posted in the lab?',NULL,'6.3;5.24.2.7',134,NULL,NULL,NULL,NULL),(135,1,'2014-11-12 20:59:56','2015-04-07 23:51:59',NULL,24,'Are appropriate warning signs posted?',NULL,'3.22.5',135,NULL,NULL,NULL,NULL),(136,1,'2014-11-12 21:02:48','2015-04-07 23:51:59',NULL,28,'Is atmospheium being used in posted work area?',NULL,NULL,136,NULL,NULL,NULL,NULL),(137,1,'2014-11-12 21:03:12','2015-04-07 23:51:59',NULL,28,'Is atmospherium a real isotope??',NULL,NULL,137,NULL,NULL,NULL,NULL),(138,1,'2014-11-12 21:03:58','2015-04-07 23:51:59',NULL,24,'Are the isotope work areas properly labeled and restricted?',NULL,NULL,138,NULL,NULL,NULL,NULL),(139,1,'2014-11-24 16:46:57','2015-04-07 23:51:59',NULL,20,'Are all procedures performed to minimize the creation of splashes and/or aerosols?','Perform all procedures to minimize the creation of splashes and/or aerosols.','BMBL, 5th Edition (Section IV - Part A.6)',139,NULL,NULL,NULL,NULL),(140,1,'2014-12-19 12:43:10','2015-04-07 23:51:59',NULL,20,'Are work surfaces decontaminated with appropriate disinfectant?','Decontaminate work surfaces after completion of work and after any spill or splash of potentially infectious material with appropriate disinfectant.','BMBL, 5th Edition (Section IV - Part A.7)',140,NULL,NULL,NULL,NULL),(141,1,'2014-12-19 12:45:11','2015-04-07 23:51:59',NULL,20,'Are all potentially infectious materials decontaminated before disposal using an effective method?','Decontaminate all cultures, stocks, and other potentially infectious materials before disposal using an effective method.','BMBL, 5th Edition (Section IV - Part A.8)',141,NULL,NULL,NULL,NULL),(142,1,'2014-12-19 12:46:06','2015-04-07 23:51:59',NULL,20,'Are materials to be decontaminated outside of the lab placed in a durable, leak proof container and secured for transport?','Materials to be decontaminated outside of the immediate laboratory must be placed in a durable, leak proof container and secured for transport.','BMBL, 5th Edition (Section IV - Part A.8a)',142,NULL,NULL,NULL,NULL),(143,0,'2014-12-19 12:46:58','2015-04-07 23:51:59',NULL,20,'Are materials to be removed from the facility for decontamination packed in accordance with applicable regulations?','Materials to be removed from the facility for decontamination must be packed in accordance with applicable local, state, and federal regulations.','BMBL, 5th Edition (Section IV - Part A.8b)',143,NULL,NULL,NULL,NULL),(144,1,'2014-12-19 12:47:53','2016-08-29 20:22:34',NULL,20,'Is a biohazard sign posted at the entrance to the lab when infectious agents are present?','A sign incorporating the universal biohazard symbol must be posted at the entrance to the laboratory when infectious agents are present. The sign may include the name of the agent(s) in use, and the name and phone number of the laboratory supervisor or other responsible personnel. Agent information should be posted in accordance with the institutional policy.','BMBL, 5th Edition (Section IV - Part A.9)',144,NULL,NULL,NULL,NULL),(145,1,'2015-01-05 13:51:29','2015-04-07 23:51:59',NULL,29,'Is a \"Caution:-X-Ray Equipment\" sign or sign of similar intent posted on doors leading into the area?','Sign or sign of similar intent not posted on doors leading to area.\nSign or sign of similar intent needs replacing.','R.H.B.7.4.2',145,NULL,NULL,NULL,NULL),(146,1,'2015-01-05 13:52:36','2015-04-07 23:51:59',NULL,25,NULL,NULL,NULL,146,NULL,NULL,NULL,NULL),(147,1,'2015-01-05 14:01:50','2015-04-07 23:51:59',NULL,25,'Is a \"Caution: X-ray Equipment\" sign or sign of similar intent posted on doors leading into the area?','A \"Caution: X-ray Equipment\" sign or one of similar intent must be posted on doors leading to rooms housing X-Ray equipment.','R.H.B.7.4.2',147,NULL,NULL,NULL,NULL),(148,1,'2015-01-05 14:04:30','2015-04-07 23:51:59',NULL,25,'Is an OSHA formRHA.-20 \"Notice To Employees\" posted in the area near the x-ray equipment?','An OSHA form R.H.A.-20 must be posted in all areas containing X-ray machines.','R.H.B.10.2.1.',148,NULL,NULL,NULL,NULL),(149,1,'2015-01-05 14:17:48','2015-04-07 23:51:59',NULL,25,'Do employees know how to access Part 3 and Part 9 of \"Title B, South Carolina Rules and Regulations for Radiation control?\"','Employees are required to know how to access a copy of \"Title B\" which are the state of SC rules and regulation governing compliance for x-ray equipment.','R.H.B.10.2.1.',149,NULL,NULL,NULL,NULL),(150,1,'2015-01-05 14:54:14','2015-04-07 23:51:59',NULL,25,'Is equipment arranged so radiation levels to individuals do not exceed limits set forth in R.H.B.3.4?','Equipment must be arranged so that radiaiton levels do not exceed limits set forth in R.H.B.3.4','R.H.B.7.7.1',150,NULL,NULL,NULL,NULL),(151,1,'2015-01-05 15:02:14','2015-04-07 23:51:59',NULL,25,'Is radiation area survey performed as required?','A radiation area survey must be performed: following any change in the initial arrangement, number or type of local components; following any change in operating parameters; following any maintenance requiring the dis-assembly or removal of a local component in system.during maintenance and alignment procedures if the procedures require the presence of a primary X-Ray beam; when any local component in the system is dis-assembled or removed; when a visual inspection of the local components in the system reveals abnormal conditions; when personnel or area monitoring devices show a significant increase over the previous monitoring period or the readings are approaching the radiation dose limits; upon installation or every 12 months thereafter.','R.H.B.7.7.2',151,NULL,NULL,NULL,NULL),(152,1,'2015-01-05 18:07:11','2015-04-07 23:51:59',NULL,25,'Have all operators completed the Basic X-Ray Safety course and all laboratory personnel signed the in-laboratory training log?','All personnel operating analytical X-Ray equipment must complete the Basic X-Ray Safety course offered through USC Radiation Safety Office.','R.H.B.7.9.1/R.H.B.8.7.2',152,NULL,NULL,NULL,NULL),(153,1,'2015-01-05 18:20:41','2015-04-07 23:51:59',NULL,25,'Have all non-X-Ray equipment operators signed the in-laboratory training log.','All laboratory personnel, including those not using the equipment, must have basic instruction in recognizing X-Ray equipment, signage associated with equipment and the hazardous nature of the equipment.','in house',153,NULL,NULL,NULL,NULL),(154,1,'2015-01-05 18:38:17','2015-04-07 23:51:59',NULL,25,'Are normal operating and emergency procedures written and available for review by operators?','Operating and emergency procedures must be written and available for all X-Ray equipment operators to review.','R.H.B.7.9.3/R.H.B.8.8',154,NULL,NULL,NULL,NULL),(155,1,'2015-01-06 18:56:05','2015-04-07 23:51:59',NULL,25,'If warranted, are personnel properly monitored for radiation exposure?','Under certain circumstances, personnel must be monitored for radiation exposure.','R.H.B.7.10/R.H.B.8.10',155,NULL,NULL,NULL,NULL),(156,1,'2015-01-07 17:54:27','2015-04-07 23:51:59',NULL,24,'Is the \"hot\" sink(s) properly labeled and restricted for isotope use?',NULL,'3.22.5',156,NULL,NULL,NULL,NULL),(157,1,'2015-01-07 17:57:12','2015-04-07 23:51:59',NULL,24,'Are the refrigerator(s) or freezer(s) marked for isotope storage?',NULL,'3.22.5',157,NULL,NULL,NULL,NULL),(158,1,'2015-01-07 17:59:13','2015-04-07 23:51:59',NULL,24,'Are supplies and equipment properly labeled and restricted for isotope use?',NULL,'3.22.5',158,NULL,NULL,NULL,NULL),(159,1,'2015-01-07 18:02:28','2015-04-07 23:51:59',NULL,24,'Do all personnel know how to access U.S.C. Radiation Safety Manual from the EHS website?',NULL,'3.35',159,NULL,NULL,NULL,NULL),(160,1,'2015-01-08 15:26:18','2015-04-07 23:51:59',NULL,24,'Is proper shielding available ?',NULL,'3.4.2',160,NULL,NULL,NULL,NULL),(161,1,'2015-01-08 15:30:08','2015-04-07 23:51:59',NULL,24,'Are the waste area(s) and procedures adequate?',NULL,'3.20',161,NULL,NULL,NULL,NULL),(162,1,'2015-01-08 15:42:33','2015-04-07 23:51:59',NULL,24,'Is the Geiger Counter calibrated and in working order?',NULL,'3.16.2',162,NULL,NULL,NULL,NULL),(163,1,'2015-01-08 18:47:16','2015-04-07 23:51:59',NULL,20,'Is an effective integrated pest management program established?','An effective integrated pest management program is required. See Appendix G.','BMBL, 5th Edition (Section IV - Part A.10)',163,NULL,NULL,NULL,NULL),(164,1,'2015-01-09 14:51:38','2015-04-07 23:51:59',NULL,25,'Is a \"Caution-Radiation -This Equipment Produces Radiation When Energized\" label or one of similar intent located near the \"X-Ray-On\" switch.','Each X-Ray machine must have a label which states \"Caution-Radiation-This Equipment Produces Radiation When Energized\" or one of similar intent located near the X-Ray On switch','R.H.B>7.4.3',164,NULL,NULL,NULL,NULL),(165,1,'2015-01-09 15:01:42','2015-04-07 23:51:59',NULL,25,'Is \"Caution-High Intensity X-Ray Beam\" label located on or immediately adjacent to the X-Ray source housing?','Each X-Ray machine must have a \"Caution-High Intensity X-Ray Beam\" label located on or immediately adjacent the X-Ray source housing.','R.H.B.7.4.3.2',165,NULL,NULL,NULL,NULL),(166,1,'2015-01-09 15:11:56','2015-04-07 23:51:59',NULL,24,'Are eating and drinking prohibited in restricted areas?',NULL,NULL,166,NULL,NULL,NULL,NULL),(167,1,'2015-01-09 15:14:10','2015-04-07 23:51:59',NULL,25,'Is an \"X-Ray On\" light located near the power swicth and illuminated only when the X-Ray tube is energized?','Each X-Ray machine must have an \"X-Ray On\" light located near the power switch and illuminated on when the tube is energized.','R.H.B.7.4.4.1',167,NULL,NULL,NULL,NULL),(168,1,'2015-01-09 15:15:00','2015-04-07 23:51:59',NULL,24,'Are the laboratory and/or isotopes secured during absence of personnel?',NULL,'3.20.1',168,NULL,NULL,NULL,NULL),(169,1,'2015-01-09 15:16:47','2015-04-07 23:51:59',NULL,24,'Are personnel properly wearing dosimetry device(s)?',NULL,'3.17.1',169,NULL,NULL,NULL,NULL),(170,1,'2015-01-09 15:17:40','2015-04-07 23:51:59',NULL,24,'Are lab personnel using appropriate PPE?',NULL,NULL,170,NULL,NULL,NULL,NULL),(171,1,'2015-01-09 15:22:11','2015-04-07 23:51:59',NULL,25,'Are warning devices \"Fail-Safe?\"','Warning devices on X-Ray equipment must be \"Fail-Safe.\"','R.H.B.7.4.4.2',171,NULL,NULL,NULL,NULL),(172,1,'2015-01-09 15:26:49','2015-04-07 23:51:59',NULL,25,'Are safety devices operational or variance granted?','All safety devices on X-Ray machines must be operational or have been granted a Variance by SCDHEC.','R.H.B.7.4.5.1',172,NULL,NULL,NULL,NULL),(173,1,'2015-01-09 15:30:49','2015-04-07 23:51:59',NULL,25,'Are safety devices checked annually and records kept?','Each safety device on the x-ray machine must be checked annually.','R.H.B.7.4.5.2',173,NULL,NULL,NULL,NULL),(174,1,'2015-01-21 14:47:33','2015-04-07 23:51:59',NULL,20,'Has the lab supervisor ensured that lab personnel receive appropriate training?','The laboratory supervisor must ensure that laboratory personnel receive appropriate training regarding their duties, the necessary precautions to prevent exposures, and exposure evaluation procedures. Personnel must receive annual updates or additional training when procedural or policy changes occur. Personal health status may impact an individuals susceptibility to infection, ability to receive immunizations or prophylactic interventions. Therefore, all laboratory personnel and particularly women of child-bearing age should be provided with information regarding immune competence and conditions that may predispose them to infection. Individuals having these conditions should be encouraged to self-identify to the institutions healthcare provider for appropriate counseling and guidance.','BMBL, 5th Edition (Section IV - Part A.11)',174,NULL,NULL,NULL,NULL),(175,0,'2015-01-21 14:55:44','2015-04-07 23:51:59',NULL,20,'BMBL, 5th Edition (Section IV - Part C.1)','Special containment devices or equipment, such as BSCs, are not generally required.','BMBL, 5th Edition (Section IV - Part C.1)',175,NULL,NULL,NULL,NULL),(176,1,'2015-01-21 15:14:27','2015-04-07 23:51:59',NULL,20,'Are protective laboratory coats, gowns, or uniforms used to prevent contamination of personal clothing?','Protective laboratory coats, gowns, or uniforms are recommended to prevent contamination of personal clothing.','BMBL, 5th Edition (Section IV - Part C.2)',176,NULL,NULL,NULL,NULL),(177,1,'2015-01-21 15:15:31','2015-04-07 23:51:59',NULL,20,'Is protective eyewear worn when conducting procedures that have the potential to create splashes of microorganisms?','Wear protective eyewear when conducting procedures that have the potential to create splashes of microorganisms or other hazardous materials. Persons who wear contact lenses in laboratories should also wear eye protection.','BMBL, 5th Edition (Section IV - Part C.3)',177,NULL,NULL,NULL,NULL),(178,1,'2015-01-21 15:16:27','2015-04-07 23:51:59',NULL,20,'Are gloves worn to protect hands from exposure to hazardous materials?','Gloves must be worn to protect hands from exposure to hazardous materials. Glove selection should be based on an appropriate risk assessment. Alternatives to latex gloves should be available. Wash hands prior to leaving the laboratory.','BMBL, 5th Edition (Section IV - Part C.4)',178,NULL,NULL,NULL,NULL),(179,1,'2015-01-21 15:17:33','2015-04-07 23:51:59',NULL,20,'Are gloves changed when contaminated, integrity has been compromised, or when otherwise necessary?','Change gloves when contaminated, integrity has been compromised, or when otherwise necessary.','BMBL, 5th Edition (Section IV - Part C.4a)',179,NULL,NULL,NULL,NULL),(180,1,'2015-01-21 15:18:35','2015-04-07 23:51:59',NULL,20,'Are gloves removed and hands washed when work with hazardous materials has been completed and before leaving the lab?','Remove gloves and wash hands when work with hazardous materials has been completed and before leaving the laboratory.','BMBL, 5th Edition (Section IV - Part C.4b)',180,NULL,NULL,NULL,NULL),(181,1,'2015-01-21 15:19:24','2015-04-07 23:51:59',NULL,20,'Are disposable gloves never reused, and are used gloves disposed with other contaminated lab waste?','Do not wash or reuse disposable gloves. Dispose of used gloves with other contaminated laboratory waste. Hand washing protocols must be rigorously followed.','BMBL, 5th Edition (Section IV - Part C.4c)',181,NULL,NULL,NULL,NULL),(182,1,'2015-01-21 15:20:26','2015-04-07 23:51:59',NULL,20,'Does the lab have doors for access control?','Laboratories should have doors for access control.','BMBL, 5th Edition (Section IV - Part D.1)',182,NULL,NULL,NULL,NULL),(183,1,'2015-01-21 15:21:14','2015-04-07 23:51:59',NULL,20,'Do labs have a sink for hand washing?','Laboratories must have a sink for hand washing.','BMBL, 5th Edition (Section IV - Part D.2)',183,NULL,NULL,NULL,NULL),(184,1,'2015-01-21 15:22:00','2015-04-07 23:51:59',NULL,20,'Is the lab designed so that it can be easily cleaned (e.g. no carpets or rugs in labs)?','The laboratory should be designed so that it can be easily cleaned. Carpets and rugs in laboratories are not appropriate.','BMBL, 5th Edition (Section IV - Part D.3)',184,NULL,NULL,NULL,NULL),(185,1,'2015-01-21 15:22:36','2015-04-07 23:51:59',NULL,20,'Is lab furniture capable of supporting anticipated loads and uses?','Laboratory furniture must be capable of supporting anticipated loads and uses. Spaces between benches, cabinets, and equipment should be accessible for cleaning.','BMBL, 5th Edition (Section IV - Part D.4)',185,NULL,NULL,NULL,NULL),(186,1,'2015-01-21 15:23:17','2015-04-07 23:51:59',NULL,20,'Are bench tops impervious to water and resistant to heat and chemicals?','Bench tops must be impervious to water and resistant to heat, organic solvents, acids, alkalis, and other chemicals.','BMBL, 5th Edition (Section IV - Part D.4a)',186,NULL,NULL,NULL,NULL),(187,1,'2015-01-21 15:23:54','2015-04-07 23:51:59',NULL,20,'Are chairs used in lab work covered with a non-porous material that can be easily decontaminated with disinfectant?','Chairs used in laboratory work must be covered with a non-porous material that can be easily cleaned and decontaminated with appropriate disinfectant.','BMBL, 5th Edition (Section IV - Part D.4b)',187,NULL,NULL,NULL,NULL),(188,1,'2015-01-21 15:24:30','2015-04-07 23:51:59',NULL,20,'Are lab windows that open to the exterior fitted with screens?','Laboratories windows that open to the exterior should be fitted with screens.','BMBL, 5th Edition (Section IV - Part D.5)',188,NULL,NULL,NULL,NULL),(189,1,'2015-01-21 15:51:23','2015-04-07 23:51:59',NULL,22,'Does the lab prohibit eating and drinking, and storing food in lab areas?','Eating, drinking, smoking, handling contact lenses, applying cosmetics, and storing food for human consumption must not be permitted in laboratory areas. Food must be stored outside the laboratory area in cabinets or refrigerators designated and used for this purpose.','BMBL, 5th Edition (Section IV - Part A.3)',189,NULL,NULL,NULL,NULL),(190,1,'2015-01-21 15:52:06','2015-04-07 23:51:59',NULL,22,'Is mouth pipetting prohibited?','Mouth pipetting is prohibited; mechanical pipetting devices must be used.','BMBL, 5th Edition (Section IV - Part A.4)',190,NULL,NULL,NULL,NULL),(191,0,'2015-01-21 15:52:52','2015-04-07 23:51:59',NULL,22,'Have policies for the safe handling of sharps been developed and implemented?','Policies for the safe handling of sharps, such as needles, scalpels, pipettes, and broken glassware must be developed and implemented. Whenever practical, laboratory supervisors should adopt improved engineering and work practice controls that reduce risk of sharps injuries.','BMBL, 5th Edition (Section IV - Part A.5)',191,NULL,NULL,NULL,NULL),(192,1,'2015-01-21 15:53:56','2015-04-07 23:51:59',NULL,22,'Does the lab carefully manage use of needles (e.g. not recapping needles)?','Careful management of needles and other sharps are of primary importance. Needles must not be bent, sheared, broken, recapped, removed from disposable syringes, or otherwise manipulated by hand before disposal.','BMBL, 5th Edition (Section IV - Part A.5a)',192,NULL,NULL,NULL,NULL),(193,1,'2015-01-21 15:54:31','2015-04-07 23:51:59',NULL,22,'Are used needles and syringes placed in a conveniently located puncture-resistant sharps container?','Used disposable needles and syringes must be carefully placed in conveniently located puncture-resistant containers used for sharps disposal.','BMBL, 5th Edition (Section IV - Part A.5b)',193,NULL,NULL,NULL,NULL),(194,1,'2015-01-21 15:55:20','2015-04-07 23:51:59',NULL,22,'Are non-disposable sharps placed in a hard walled container?','Non-disposable sharps must be placed in a hard walled container for transport to a processing area for decontamination, preferably by autoclaving.','BMBL, 5th Edition (Section IV - Part A.5c)',194,NULL,NULL,NULL,NULL),(195,1,'2015-01-21 15:56:01','2015-04-07 23:51:59',NULL,22,'Is a mechanical device (e.g. brush and dustpan) used for handling broken glassware?','Broken glassware must not be handled directly. Instead, it must be removed using a brush and dustpan, tongs, or forceps. Plasticware should be substituted for glassware whenever possible.','BMBL, 5th Edition (Section IV - Part A.5d)',195,NULL,NULL,NULL,NULL),(196,1,'2015-01-21 15:56:55','2015-04-07 23:51:59',NULL,22,'Are all procedures performed to minimize the creation of splashes and/or aerosols?','Perform all procedures to minimize the creation of splashes and/or aerosols.','BMBL, 5th Edition (Section IV - Part A.6)',196,NULL,NULL,NULL,NULL),(197,1,'2015-01-21 15:57:37','2015-04-07 23:51:59',NULL,22,'Are work surfaces decontaminated with appropriate disinfectant?','Decontaminate work surfaces after completion of work and after any spill or splash of potentially infectious material with appropriate disinfectant.','BMBL, 5th Edition (Section IV - Part A.7)',197,NULL,NULL,NULL,NULL),(198,1,'2015-01-21 15:59:04','2015-04-07 23:51:59',NULL,22,'Are all potentially infectious materials decontaminated before disposal using an effective method?','Decontaminate all cultures, stocks, and other potentially infectious materials before disposal using an effective method.','BMBL, 5th Edition (Section IV - Part A.8)',198,NULL,NULL,NULL,NULL),(199,1,'2015-01-21 15:59:55','2015-04-07 23:51:59',NULL,22,'Are materials to be decontaminated outside of the lab placed in a durable, leak proof container and secured for transport?','Materials to be decontaminated outside of the immediate laboratory must be placed in a durable, leak proof container and secured for transport.','BMBL, 5th Edition (Section IV - Part A.8a)',199,NULL,NULL,NULL,NULL),(200,0,'2015-01-21 16:00:53','2015-04-07 23:51:59',NULL,22,'Are materials to be removed from the facility for decontamination packed in accordance with applicable regulations?','Materials to be removed from the facility for decontamination must be packed in accordance with applicable local, state, and federal regulations.','BMBL, 5th Edition (Section IV - Part A.8b)',200,NULL,NULL,NULL,NULL),(201,1,'2015-01-21 16:01:35','2015-04-07 23:51:59',NULL,22,'Is a biohazard sign posted at the entrance to the lab when infectious agents are present?','A sign incorporating the universal biohazard symbol must be posted at the entrance to the laboratory when infectious agents are present. Posted information must include: the laboratorys biosafety level, the supervisors name (or other responsible personnel), telephone number, and required procedures for entering and exiting the laboratory. Agent information should be posted in accordance with the institutional policy.','BMBL, 5th Edition (Section IV - Part A.9)',201,NULL,NULL,NULL,NULL),(202,1,'2015-01-21 16:02:31','2015-04-07 23:51:59',NULL,22,'Is an effective integrated pest management program established?','An effective integrated pest management program is required.','BMBL, 5th Edition (Section IV - Part A.10)',202,NULL,NULL,NULL,NULL),(203,1,'2015-01-21 16:03:17','2015-04-07 23:51:59',NULL,22,'Has the lab supervisor ensured that lab personnel receive appropriate training?','The laboratory supervisor must ensure that laboratory personnel receive appropriate training regarding their duties, the necessary precautions to prevent exposures, and exposure evaluation procedures. Personnel must receive annual updates or additional training when procedural or policy changes occur. Personal health status may impact an individuals susceptibility to infection, ability to receive immunizations or prophylactic interventions. Therefore, all laboratory personnel and particularly women of child-bearing age should be provided with information regarding immune competence and conditions that may predispose them to infection. Individuals having these conditions should be encouraged to self-identify to the institutions healthcare provider for appropriate counseling and guidance.','BMBL, 5th Edition (Section IV - Part A.11)',203,NULL,NULL,NULL,NULL),(204,1,'2015-01-21 16:04:12','2015-04-07 23:51:59',NULL,22,'Are all persons entering the lab advised of the potential hazards and meet specific entry/exit requirements?','All persons entering the laboratory must be advised of the potential hazards and meet specific entry/exit requirements.','BMBL, 5th Edition (Section IV - Part B.1)',204,NULL,NULL,NULL,NULL),(205,0,'2015-01-21 16:06:59','2015-04-07 23:51:59',NULL,22,'Are lab personnel provided medical surveillance and offered appropriate immunizations for agents handled or present in the lab?','Laboratory personnel must be provided medical surveillance and offered appropriate immunizations for agents handled or potentially present in the laboratory.','BMBL, 5th Edition (Section IV - Part B.2)',205,NULL,NULL,NULL,NULL),(206,0,'2015-01-21 16:08:02','2015-04-07 23:51:59',NULL,22,'Has the institution established policies and procedures describing the collection and storage of serum samples from at-risk personnel?','Each institution must establish policies and procedures describing the collection and storage of serum samples from at-risk personnel.','BMBL, 5th Edition (Section IV - Part B.3)',206,NULL,NULL,NULL,NULL),(207,1,'2015-01-21 16:09:53','2015-04-07 23:51:59',NULL,22,'Is a lab-specific biosafety manual prepared and adopted as policy, and is the manual available and accessible?','A laboratory-specific biosafety manual must be prepared and adopted as policy. The biosafety manual must be available and accessible.','BMBL, 5th Edition (Section IV - Part B.4)',207,NULL,NULL,NULL,NULL),(208,1,'2015-01-21 16:10:55','2015-04-07 23:51:59',NULL,22,'Does the lab supervisor ensure that lab personnel demonstrate proficiency in microbiological practices before working with BSL-2 agents?','The laboratory supervisor must ensure that laboratory personnel demonstrate proficiency in standard and special microbiological practices before working with BSL-2 agents.','BMBL, 5th Edition (Section IV - Part B.5)',208,NULL,NULL,NULL,NULL),(209,1,'2015-01-21 16:11:34','2015-04-07 23:51:59',NULL,22,'Are potentially infectious materials placed in a durable, leak proof container during collection, handling, processing, storage, or transport?','Potentially infectious materials must be placed in a durable, leak proof container during collection, handling, processing, storage, or transport within a facility.','BMBL, 5th Edition (Section IV - Part B.6)',209,NULL,NULL,NULL,NULL),(210,1,'2015-01-21 16:12:35','2015-04-07 23:51:59',NULL,22,'Is lab equipment routinely decontaminated, as well as, after spills, splashes, or other potential contamination?','Laboratory equipment should be routinely decontaminated, as well as, after spills, splashes, or other potential contamination.','BMBL, 5th Edition (Section IV - Part B.7)',210,NULL,NULL,NULL,NULL),(211,1,'2015-01-21 16:13:17','2015-04-07 23:51:59',NULL,22,'Are spills involving infectious materials contained, decontaminated, and cleaned up by staff properly trained and equipped for this work?','Spills involving infectious materials must be contained, decontaminated, and cleaned up by staff properly trained and equipped to work with infectious material.','BMBL, 5th Edition (Section IV - Part B.7a)',211,NULL,NULL,NULL,NULL),(212,1,'2015-01-21 16:14:05','2015-04-07 23:51:59',NULL,22,'Is equipment decontaminated before repair, maintenance, or removal from the lab?','Equipment must be decontaminated before repair, maintenance, or removal from the laboratory.','BMBL, 5th Edition (Section IV - Part B.7b)',212,NULL,NULL,NULL,NULL),(213,1,'2015-01-21 16:14:38','2015-04-07 23:51:59',NULL,22,'Are incidents that may result in exposure immediately evaluated and treated according to proper procedures, and reported to the lab supervisor?','Incidents that may result in exposure to infectious materials must be immediately evaluated and treated according to procedures described in the laboratory biosafety safety manual. All such incidents must be reported to the laboratory supervisor. Medical evaluation, surveillance, and treatment should be provided and appropriate records maintained.','BMBL, 5th Edition (Section IV - Part B.8)',213,NULL,NULL,NULL,NULL),(214,1,'2015-01-21 16:15:32','2015-04-07 23:51:59',NULL,22,'Are animals and plants not associated with the work being performed prohibited from the lab?','Animals and plants not associated with the work being performed must not be permitted in the laboratory.','BMBL, 5th Edition (Section IV - Part B.9)',214,NULL,NULL,NULL,NULL),(215,0,'2015-01-21 16:16:08','2015-04-07 23:51:59',NULL,22,'Are all procedures involving infectious materials that may generate an aerosol conducted within a BSC or other physical containment devices?','All procedures involving the manipulation of infectious materials that may generate an aerosol should be conducted within a BSC or other physical containment devices.','BMBL, 5th Edition (Section IV - Part B.10)',215,NULL,NULL,NULL,NULL),(216,0,'2015-01-21 16:21:29','2015-04-07 23:51:59',NULL,22,'BMBL, 5th Edition (Section IV - Part C.1)','Properly maintained BSCs (preferably Class II), other appropriate personal protective equipment, or other physical containment devices must be used whenever:','BMBL, 5th Edition (Section IV - Part C.1)',216,NULL,NULL,NULL,NULL),(217,1,'2015-01-21 16:22:18','2015-04-07 23:51:59',NULL,22,'Are BSCs, protective equipment, or other containment devices used whenever procedures creating infectious aerosols or splashes are conducted?','Properly maintained BSCs (preferably Class II), other appropriate personal protective equipment, or other physical containment devices must be used whenever procedures with a potential for creating infectious aerosols or splashes are conducted. These may include pipetting, centrifuging, grinding, blending, shaking, mixing, sonicating, opening containers of infectious materials, inoculating animals intranasally, and harvesting infected tissues from animals or eggs.','BMBL, 5th Edition (Section IV - Part C.1a)',217,NULL,NULL,NULL,NULL),(218,1,'2015-01-21 16:23:34','2015-04-07 23:51:59',NULL,22,'Are BSCs, protective equipment, or other containment devices used whenever high concentrations or large volumes of infectious agents are used?','Properly maintained BSCs (preferably Class II), other appropriate personal protective equipment, or other physical containment devices must be used whenever high concentrations or large volumes of infectious agents are used. Such materials may be centrifuged in the open laboratory using sealed rotor heads or centrifuge safety cups.','BMBL, 5th Edition (Section IV - Part C.1b)',218,NULL,NULL,NULL,NULL),(219,1,'2015-01-21 16:24:52','2016-09-20 13:57:27',NULL,22,'Are lab coats designated for lab use worn while working with hazardous materials, and is protective clothing removed before leaving for non-lab areas?','Protective laboratory coats, gowns, smocks, or uniforms designated for laboratory use must be worn while working with hazardous materials. Remove protective clothing before leaving for non-laboratory areas (e.g., cafeteria, library, administrative offices). Dispose of protective clothing appropriately, or deposit it for laundering by the institution. It is recommended that laboratory clothing not be taken home.','BMBL, 5th Edition (Section IV - Part C.2)',219,NULL,NULL,NULL,NULL),(220,1,'2015-01-21 16:26:08','2015-04-07 23:51:59',NULL,22,'Is eye and face protection used for anticipated splashes or sprays when the microorganisms must be handled outside the BSC or containment device?','Eye and face protection (goggles, mask, face shield or other splatter guard) is used for anticipated splashes or sprays of infectious or other hazardous materials when the microorganisms must be handled outside the BSC or containment device. Eye and face protection must be disposed of with other contaminated laboratory waste or decontaminated before reuse. Persons who wear contact lenses in laboratories should also wear eye protection.','BMBL, 5th Edition (Section IV - Part C.3)',220,NULL,NULL,NULL,NULL),(221,1,'2015-01-21 16:28:22','2015-04-07 23:51:59',NULL,22,'Are gloves worn to protect hands from exposure to hazardous materials, and not worn outside the lab?','Gloves must be worn to protect hands from exposure to hazardous materials. Glove selection should be based on an appropriate risk assessment. Alternatives to latex gloves should be available. Gloves must not be worn outside the laboratory.','BMBL, 5th Edition (Section IV - Part C.4)',221,NULL,NULL,NULL,NULL),(222,1,'2015-01-21 16:29:32','2015-04-07 23:51:59',NULL,22,'Are gloves changed when contaminated or when otherwise necessary, and are two pairs of gloves worn when appropriate?','Change gloves when contaminated, integrity has been compromised, or when otherwise necessary. Wear two pairs of gloves when appropriate.','BMBL, 5th Edition (Section IV - Part C.4a)',222,NULL,NULL,NULL,NULL),(223,1,'2015-01-21 16:30:46','2015-04-07 23:51:59',NULL,22,'Are gloves removed and hands washed when work with hazardous materials has been completed and before leaving the lab?','Remove gloves and wash hands when work with hazardous materials has been completed and before leaving the laboratory.','BMBL, 5th Edition (Section IV - Part C.4b)',223,NULL,NULL,NULL,NULL),(224,1,'2015-01-21 16:31:45','2015-04-07 23:51:59',NULL,22,'Are disposable gloves never reused, and are used gloves disposed with other contaminated lab waste?','Do not wash or reuse disposable gloves. Dispose of used gloves with other contaminated laboratory waste. Hand washing protocols must be rigorously followed.','BMBL, 5th Edition (Section IV - Part C.4c)',224,NULL,NULL,NULL,NULL),(225,1,'2015-01-21 16:32:46','2015-04-07 23:51:59',NULL,22,'Is proper eye, face and respiratory protection used in rooms containing infected animals?','Eye, face and respiratory protection should be used in rooms containing infected animals as determined by the risk assessment.','BMBL, 5th Edition (Section IV - Part C.5)',225,NULL,NULL,NULL,NULL),(226,0,'2015-01-21 16:35:53','2015-04-07 23:51:59',NULL,22,'Are lab doors self-closing and have locks in accordance with the institutional policies?','Laboratory doors should be self-closing and have locks in accordance with the institutional policies.','BMBL, 5th Edition (Section IV - Part D.1)',226,NULL,NULL,NULL,NULL),(227,1,'2015-01-21 16:36:32','2015-04-07 23:51:59',NULL,22,'Do labs have a sink for hand washing?','Laboratories must have a sink for hand washing. The sink may be manually, hands-free, or automatically operated. It should be located near the exit door.','BMBL, 5th Edition (Section IV - Part D.2)',227,NULL,NULL,NULL,NULL),(228,1,'2015-01-21 16:37:17','2015-04-07 23:51:59',NULL,22,'Is the lab designed so that it can be easily cleaned (e.g. no carpets or rugs in labs)?','The laboratory should be designed so that it can be easily cleaned and decontaminated. Carpets and rugs in laboratories are not permitted.','BMBL, 5th Edition (Section IV - Part D.3)',228,NULL,NULL,NULL,NULL),(229,1,'2015-01-21 16:38:22','2015-04-07 23:51:59',NULL,22,'Is lab furniture capable of supporting anticipated loads and uses?','Laboratory furniture must be capable of supporting anticipated loads and uses. Spaces between benches, cabinets, and equipment should be accessible for cleaning.','BMBL, 5th Edition (Section IV - Part D.4)',229,NULL,NULL,NULL,NULL),(230,1,'2015-01-21 16:38:59','2015-04-07 23:51:59',NULL,22,'Are bench tops impervious to water and resistant to heat and chemicals?','Bench tops must be impervious to water and resistant to heat, organic solvents, acids, alkalis, and other chemicals.','BMBL, 5th Edition (Section IV - Part D.4a)',230,NULL,NULL,NULL,NULL),(231,1,'2015-01-21 16:40:05','2015-04-07 23:51:59',NULL,22,'Are chairs used in lab work covered with a non-porous material that can be easily decontaminated with disinfectant?','Chairs used in laboratory work must be covered with a non-porous material that can be easily cleaned and decontaminated with appropriate disinfectant.','BMBL, 5th Edition (Section IV - Part D.4b)',231,NULL,NULL,NULL,NULL),(232,1,'2015-01-21 16:42:02','2015-04-07 23:51:59',NULL,22,'Are lab windows that open to the exterior fitted with screens?','Laboratory windows that open to the exterior are not recommended. However, if a laboratory does have windows that open to the exterior, they must be fitted with screens.','BMBL, 5th Edition (Section IV - Part D.5)',232,NULL,NULL,NULL,NULL),(233,0,'2015-01-21 16:43:18','2015-04-07 23:51:59',NULL,22,'BSC CHECKLIST - Are BSCs installed so that possible airflow disruptions do not interfere with proper operations?','BSCs must be installed so that fluctuations of the room air supply and exhaust do not interfere with proper operations. BSCs should be located away from doors, windows that can be opened, heavily traveled laboratory areas, and other possible airflow disruptions.','BMBL, 5th Edition (Section IV - Part D.6)',233,NULL,NULL,NULL,NULL),(234,0,'2015-01-21 16:44:21','2015-04-07 23:51:59',NULL,22,'BSC CHECKLIST - Are vacuum lines protected with HEPA filters or their equivalent, and are filters replaced as needed?','Vacuum lines should be protected with High Efficiency Particilate Air (HEPA) filters, or their equivalent. Filters must be replaced as needed. Liquid disinfectant traps may be required.','BMBL, 5th Edition (Section IV - Part D.7)',234,NULL,NULL,NULL,NULL),(235,1,'2015-01-21 16:45:32','2015-04-07 23:51:59',NULL,22,'Is an eyewash station readily available?','An eyewash station must be readily available.','BMBL, 5th Edition (Section IV - Part D.8)',235,NULL,NULL,NULL,NULL),(236,0,'2015-01-21 16:46:09','2015-04-07 23:51:59',NULL,22,'BMBL, 5th Edition (Section IV - Part D.9)','There are no specific requirements on ventilation systems. However, planning of new facilities should consider mechanical ventilation systems that provide an inward flow of air without recirculation to spaces outside of the laboratory.','BMBL, 5th Edition (Section IV - Part D.9)',236,NULL,NULL,NULL,NULL),(237,0,'2015-01-21 16:47:18','2015-04-07 23:51:59',NULL,22,'BSC CHECKLIST - Are provisions to assure proper biosafety cabinet performance and air system operation verified (e.g. annual BSC certification)?','HEPA filtered exhaust air from a Class II BSC can be safely re-circulated back into the laboratory environment if the cabinet is tested and certified at least annually and operated according to manufacturers recommendations. BSCs can also be connected to the laboratory exhaust system by either a thimble (canopy) connection or a direct (hard) connection. Provisions to assure proper safety cabinet performance and air system operation must be verified.','BMBL, 5th Edition (Section IV - Part D.10)',237,NULL,NULL,NULL,NULL),(238,0,'2015-01-21 16:47:59','2015-04-07 23:51:59',NULL,22,'Is a method for decontaminating all lab wastes available in the facility (e.g., autoclave, chemical disinfection, incineration)?','A method for decontaminating all laboratory wastes should be available in the facility (e.g., autoclave, chemical disinfection, incineration, or other validated decontamination method).','BMBL, 5th Edition (Section IV - Part D.11)',238,NULL,NULL,NULL,NULL),(239,1,'2015-01-29 13:59:33','2015-08-06 15:39:58',NULL,26,'Is Hazard Notification board posted by ALL entrance doors with updated hazard and emergency contact information?','NFPA 45 requires facilities to be identified by signs to warn Emergency Personnel of the hazards they may be exposed to in the laboratory. University policy requires the use of the Hazard Information Notice for this purpose. Hazards listed and contact information, including names and phone numbers, must always be up to date. A template is available on-line at http://ehs.sc.edu/LabSafety/Labstartup.htm.','NFPA 45',239,NULL,NULL,NULL,NULL),(240,1,'2015-01-29 14:42:22','2015-04-07 23:51:59',NULL,26,'Are emergency procedures for fire, chemical spill and chemical exposure available and posted by all exit doors?','All laboratories must have a written procedure for response to emergencies including but not limited to fire, chemical spill and chemical exposure.  Written emergency procedures must describe in detail who to call, the information to be provided to emergency dispatch, what to do and the location and use of safety equipment necessary during the emergency response.','USC Policy',240,NULL,NULL,NULL,NULL),(241,1,'2015-01-29 15:33:59','2015-04-07 23:51:59',NULL,30,'If an electrical panel box is present in the laboratory, is the panel secured and locked and is there a 3-ft clearance around it?','Electrical panels must be kept accessible by maintaining a 3-ft clearance around the panel.','USC Policy',241,NULL,NULL,NULL,NULL),(242,1,'2015-01-29 15:39:44','2015-04-07 23:51:59',NULL,31,'Are food and drink stored and/or consumed only in designated non-laboratory area, away from hazards?','Drinking, eating, or storage of food and drinks are prohibited in USC laboratories and may be consumed only in designated non-laboratory areas.','USC Policy',242,NULL,NULL,NULL,NULL),(243,1,'2015-01-29 15:45:24','2015-04-07 23:51:59',NULL,31,'Are home-type appliances such as microwaves, refrigerators, freezers, ice machines and others designated and labeled \"for lab use only\"?','Refrigerators, freezers, microwaves, ice machines and similar home-type appliances must be labeled \"for lab use only\", \"no food or drinks\", \"no flammable storage\" or \"not for human consumption\" , as applicable.','USC Policy',243,NULL,NULL,NULL,NULL),(244,1,'2015-01-29 16:02:30','2015-04-07 23:51:59',NULL,31,'Are human food items used for research designated and labeled \"for lab use only\"?','Human food items used for research must be designated and labeled accordingly.','USC Policy',244,NULL,NULL,NULL,NULL),(245,1,'2015-01-29 16:08:55','2015-04-07 23:51:59',NULL,31,'Are work benches, sinks, other work areas, walkways free of clutter?','Clutter contributes to many laboratory incidents.  Work areas and walkways must be kept clutter-free.','USC Policy',245,NULL,NULL,NULL,NULL),(246,1,'2015-01-29 16:14:33','2015-04-07 23:51:59',NULL,31,'Are chemical spills cleaned up promptly and completely?','Chemical spills must be cleaned-up promptly and completely by laboratory personnel.  Spills of mercury and HF must be referred to EH&S at 777-5269.','USC Policy',246,NULL,NULL,NULL,NULL),(247,1,'2015-01-29 16:25:29','2015-04-07 23:51:59',NULL,31,'Are personal protective equipment used while in the lab and removed before leaving the lab?','Minimum PPE must be worn when entering the laboratory and additional PPEs as required by procedures being performed or materials being handled. In addition,  PPEs may not be worn in public places and corridors and must be removed before leaving the lab.  Hands must be washed thoroughly before leaving the lab.',NULL,247,NULL,NULL,NULL,NULL),(248,1,'2015-01-29 18:21:39','2015-04-07 23:51:59',NULL,31,'Are designated computer or office work area away from hazards?','Computer and office work area must be located away from areas where hazards are used and/or stored.','USC Policy',248,NULL,NULL,NULL,NULL),(249,1,'2015-01-29 18:39:24','2015-04-07 23:51:59',NULL,31,'Are work areas for use and/or storage of particularly hazardous materials and procedures designated and labeled?','Specific work areas for and storage of biological materials, radioactive materials, particularly hazardous substances, and the like must be designated and labeled accordingly.','USC Lab Safety Policy',249,NULL,NULL,NULL,NULL),(250,1,'2015-01-29 18:44:02','2015-08-06 16:24:20',NULL,31,'Are unattended operations stable and protected from outside disturbances such as water or power outage?','Unattended operations must be stabilized and protected from outside disturbances such as water, power outage and others.','USC Lab Safety Policy',250,NULL,NULL,NULL,NULL),(251,1,'2015-01-29 18:52:36','2015-08-06 16:20:56',NULL,31,'Are mechanical pipeting devices available and used in lieu of mouth pipeting?','Mechanical pipeting devices must be available and used in lieu of mouth pipeting.','USC Lab Safety Policy',251,NULL,NULL,NULL,NULL),(252,1,'2015-01-29 19:45:35','2015-04-07 23:51:59',NULL,21,'Are chemicals segregated based on compatibility?','Chemicals should not be arranged in alphabetical order without first segregating incompatible compounds. Chemicals that react with each other may not be stored together in the same cabinet.  Examples are acids and bases, oxidizers and organic compounds, nitric acid and acetic acid.  Contact Jocelyn Locke at jlocke@mailbox.sc.edu if guidance is needed in segregating chemicals.  The NIOSH High School Chemistry Laboratory Safety Guide has excellent guidelines on segregating chemicals based on classes of compounds.','USC Lab Safety Policy',252,NULL,NULL,NULL,NULL),(253,1,'2015-01-29 19:52:43','2015-04-07 23:51:59',NULL,21,'Are hazardous chemicals stored below shoulder level but not on the floor?','All chemicals must be stored in secured cabinets or shelvings to prevent accidental spills.  Liquid chemicals must be stored below shoulder height but not on the floor.','USC Lab Safety Policy',253,NULL,NULL,NULL,NULL),(254,1,'2015-01-29 20:06:24','2015-04-07 23:51:59',NULL,21,'Are chemicals stored in appropriate cabinets with secured shelving?','All chemicals must be stored in cabinets designed for specific type of chemicals and with secured shelving to prevent accidental spills.','USC Lab Safety Policy',254,NULL,NULL,NULL,NULL),(255,1,'2015-01-29 20:14:51','2015-08-07 14:51:45',NULL,21,'Are flammables stored in appropriate fire-rated cabinets or flammable-safe refrigerator or freezer?','It is recommended that all laboratories minimize stored flammable liquids below 10 gallons.  Any mount in excess of 10 gallons must be stored in flammable cabinets with sealed vents.\n\nHousehold-type refrigerators may not be used to store flammable chemicals.  Electrical components inside these type of refrigerators will be a source of spark or ignition, which, combined with enough flammable vapors can result to an explosion.  Flammable-safe and explosion-proof refrigerators do not have electrical components inside the unit and therefore are safe for storage of flammable chemicals.','USC Lab Safety Policy',255,NULL,NULL,NULL,NULL),(256,1,'2015-01-29 20:21:32','2015-04-07 23:51:59',NULL,21,'Are all chemicals kept in capped, sealed leak-proof containers?','Chemical must be kept in capped, sealed, leak-proof containers and may not be left open unless in active use.',NULL,256,NULL,NULL,NULL,NULL),(257,1,'2015-01-29 20:44:51','2015-04-07 23:51:59',NULL,21,'Are labels on original containers intact and readable?','Original container labels must be intact.  Containers must be relabeled if the original labels start to peel off or deteriorate due to aging on the shelf or reaction with chemical fumes in the storage cabinet.','USC Lab Safety Policy',257,NULL,NULL,NULL,NULL),(258,1,'2015-01-29 21:28:53','2015-04-07 23:51:59',NULL,21,'Are secondary containers (containers of solutions and mixtures)  labeled properly?','Unlabeled chemical containers often result in unknown hazardous waste, which is more expensive to dispose of compared to known waste.  All containers of chemical solutions must be labeled with the name of the chemical constituents, the concentration, date prepared and name of the person who prepared the solution.  Abbreviations, if used in labeling, must be defined in a laboratory notebook.','USC Lab Safety Policy',258,NULL,NULL,NULL,NULL),(259,1,'2015-01-29 21:53:59','2015-08-07 15:26:00',NULL,16,'Is annual drug inventory and drug usage log kept current?','An inventory reflecting the controlled substances available on hand must be kept up-to-date.\nUsage of controlled substances must be recorded on a log sheet.','DEA Policy',259,NULL,NULL,NULL,NULL),(260,1,'2015-01-30 13:29:04','2015-08-07 15:31:34',NULL,13,'Is a written safety SOP available, approved and signed by the PI and authorized users?','Laboratories using equipment that generate or pose chemical or physical hazards must develop a written SOP for safe use of these equipment.','USC Lab Safety Policy',260,NULL,NULL,NULL,NULL),(261,1,'2015-01-30 13:30:03','2015-08-07 15:36:05',NULL,13,'Is manufacturer-issued safety manual available for reference?','Manufacturer-issued safety and operation manual for the equipment must be kept on file and available as a reference for users of the equipment.','USC Lab Safety Policy',262,NULL,NULL,NULL,NULL),(262,1,'2015-01-30 13:30:27','2015-08-18 13:26:11',NULL,13,'Are built-in safety mechanism in place and functional?','Built-in safety mechanism must be in place, functional and periodically tested on equipment posing or generating physical and/or chemical hazards.','USC Lab Safety Policy',263,NULL,NULL,NULL,NULL),(263,1,'2015-01-30 13:31:13','2015-08-07 15:36:01',NULL,13,'Is periodic maintenance check performed and documented?','Testing and maintenance of equipment must be performed at least annually or as recommended by the manufacturer.','USC Lab Safety Policy',264,NULL,NULL,NULL,NULL),(264,1,'2015-01-30 13:32:04','2015-08-07 15:35:59',NULL,13,'Is a written lock-out tag-out procedure available and implemented when equipment is being serviced?','A written lock-out tag-out procedure must be in place and implemented when periodic maintenance or repair is being performed on the equipment.','USC Lab Safety Policy',265,NULL,NULL,NULL,NULL),(265,1,'2015-01-30 13:35:53','2015-04-07 23:51:59',NULL,33,'Do containers of peroxide formers indicate date of receipt and date opened?','Peroxide formers have specific shelf life based often on when the container was received and when it was first opened.','USC Lab Safety Policy',265,NULL,NULL,NULL,NULL),(266,1,'2015-01-30 13:38:04','2015-04-07 23:51:59',NULL,33,'Are peroxide formers discarded according to their expected shelf-life and ability to form peroxides?','Based on the characteristics of the peroxide former and the conditions that allow formation of peroxides, specific guidelines must be followed on proper timing of disposal based on date of container receipt and when container was opened.  Specific guidelines are available here: http://weill.cornell.edu/ehs/static_local/pdfs/Peroxide_Formers.pdf.','USC Lab Safety Policy',266,NULL,NULL,NULL,NULL),(267,1,'2015-01-30 13:38:47','2015-08-10 18:46:35',NULL,33,'Is inhibited counterpart of the peroxide former purchased if available and usable?','An inhibited form of the peroxide former must be purchased if available and usable in the specific procedure that uses the chemical.','USC Lab Safety Policy',267,NULL,NULL,NULL,NULL),(268,1,'2015-01-30 13:41:09','2015-08-10 18:50:09',NULL,34,'Is solvent pump available and used for dispensing from large flammable liquid containers?','Solvent pump is required to dispense flammable solvents from 5-gallon or bigger containers.','USC Lab Safety Policy',268,NULL,NULL,NULL,NULL),(269,1,'2015-01-30 13:42:42','2015-08-10 18:54:41',NULL,34,'Is 55-gal drum containing flammable liquid properly grounded and bonded?','Large containers of flammable liquids are not recommended in laboratories because of the serious fire hazard associated with them.  It is recommended that one-gallon containers be purchased instead.  In cases where the use of  a 55-gal metal drum of flammable liquid is justified, the metal drum must be grounded and bonded properly.  A solvent pump must be used to dispense the liquid to a smaller container.','USC Lab Safety Policy',269,NULL,NULL,NULL,NULL),(270,1,'2015-01-30 13:44:49','2015-04-07 23:51:59',NULL,35,'Is waste storage minimized in the lab?','Accumulation of wastes must be minimized by requesting EH&S to have the wastes picked up once a considerable amount (about 10 gallons) have accumulated.','USC Safety Policy',270,NULL,NULL,NULL,NULL),(271,1,'2015-01-30 13:45:29','2016-10-25 15:39:28',NULL,35,'Are old and/or unused, unidentified or unlabeled chemicals discarded as hazardous waste?','The laboratory must periodically check chemicals for expiration dates and dispose of unused and outdated chemicals as hazardous waste through EH&S.  Pick-up request can be initiated on-line at http://www.sc.edu/ehs/hazwaste/hw2.htm.','USC Hazardous Waste Policy',271,NULL,NULL,NULL,NULL),(272,1,'2015-01-30 13:47:06','2015-08-07 15:07:50',NULL,35,'Is chemical waste container capped and sealed unless waste is actively being added to the container?','EPA (40 CFR 265.173(a)) requires that containers holding hazardous waste be kept closed during storage, except when it is necessary to add or remove waste.','EPA (40 CFR 265.173(a))',272,NULL,NULL,NULL,NULL),(273,1,'2015-01-30 13:47:59','2015-04-07 23:51:59',NULL,35,'Is designated collection area in the vicinity of where waste is generated?','Collection area for hazardous waste must be within the vicinity of where the wastes are being generated.','USC Hazardous Waste Policy',273,NULL,NULL,NULL,NULL),(274,1,'2015-01-30 13:48:45','2015-04-07 23:51:59',NULL,35,'Is container used for collection compatible with the waste?','Containers are compatible with their contents to avoid reactions between the contents and the container; and are made of, or lined with, material that is compatible with the unwanted material so that the container\'s integrity is not impaired.','CFR 40 Part 262.206 b2.',274,NULL,NULL,NULL,NULL),(275,1,'2015-01-30 13:50:29','2015-04-07 23:51:59',NULL,35,'Is offical USC Hazardous Waste tag used to label containers and no chemical abbreviations are used?','EPA (40 CFR 262.32) requires that all containers offered for transport be identified with generator information. DOT [49 CFR 172.301(b) and 49 CFR 172.308] requires that all packages offered for transport be marked with technical names without any abbreviations.','EPA (40 CFR 262.32), DOT [49 CFR 172.301(b) and 49 CFR 172.308]',275,NULL,NULL,NULL,NULL),(276,1,'2015-01-30 13:54:02','2015-08-07 15:12:37',NULL,36,'Is broken glass collected in sturdy cardboard box, lined with thick plastic bag or in plastic bucket and not overfilled and/or more than 10 lbs?s','To prevent lab or custodial personnel from getting injured handling wastes, all broken glass must be disposed of in a small plastic lined cardboard box. A heavy-duty plastic lining will catch excess liquids from the glassware and also prevent sharp edges from sticking through the cardboard box. The size of the box must be small enough such that the resulting weight of a full container is not more than 10 lbs.  DO NOT OVERFILL. The box must be sealed with tape when full and labeled  Broken Glass and placed by the regular trash. All sharps (syringes and needles, scalpels, blades) must be placed in a sharps container, not in broken glass box.','USC Lab Safety Policy',276,NULL,NULL,NULL,NULL),(277,1,'2015-01-30 13:55:00','2015-08-07 15:14:16',NULL,36,'Are used oil, used lamps, bulbs and batteries or other universal waste collected in compatible containers, labeled and disposed of through EH&S?','Universal wastes such as used oil, lamps, bulbs and batteries must be stored in compatible containers or boxes and disposed of through EH&S.  Used oil is collected during hazardous waste pick-up.  For all other universal waste, please call Roddy Whitaker at 7-2839.','USC Hazardous Waste Policy',277,NULL,NULL,NULL,NULL),(278,1,'2015-01-30 13:56:43','2015-04-07 23:51:59',NULL,16,'Are expiration dates of drugs closely monitored and expired drugs disposed of properly?','DEA drugs may not be used beyond their expiration dates.  Expired drugs must be disposed through a vendor legally permitted to accept and dispose of DEA drugs.','DEA Policy',278,NULL,NULL,NULL,NULL),(279,1,'2015-01-30 13:59:12','2015-04-07 23:51:59',NULL,26,'Is Group Safety Officer for the laboratory and an alternate designated and listed on the Hazard Notification Board?','Each laboratory must designate a Group Safety Officer and an alternate who will be, in addition to the Principal Investigator, will be the primary contact in the event that an emergency occur in the laboratory.','USC Policy',279,NULL,NULL,NULL,NULL),(280,1,'2015-01-30 14:01:36','2015-04-07 23:51:59',NULL,26,'Are lab personnel knowledgeable on building emergency procedure including but not limited to evacuation routes, assembly points, areas of refuge, laboratory shutdown and responsibilities in case an emergency evacuation occur?','All personnel entering and or working in the laboratory must receive safety training on building emergency procedures.','USC Policy',280,NULL,NULL,NULL,NULL),(281,1,'2015-01-30 14:03:02','2015-04-07 23:51:59',NULL,26,'Are walkways unobstructed and exits clearly marked in and within the vicinity of the laboratory?','Walkways inside and out of the laboratory must be free of obstruction and exits must be clearly marked.','USC Policy',281,NULL,NULL,NULL,NULL),(282,1,'2015-01-30 14:04:17','2015-08-06 16:04:08',NULL,26,'Are sprinkler heads unobstructed within 18 inches from the ceiling for buildings with sprinklers and 24 inches from the ceiling for buildings without sprinklers?','Sprinkler spacing. The employer shall assure that sprinklers are spaced to provide a maximum protection area per sprinkler, a minimum of interference to the discharge pattern by building or structural members or building contents and suitable sensitivity to possible fire hazards. The minimum vertical clearance between sprinklers and material below shall be 18 inches (45.7 cm).','29 CFR 1910.159(c)(10). Automatic Sprinkler Systems',282,NULL,NULL,NULL,NULL),(283,1,'2015-01-30 14:05:25','2016-07-06 15:39:22',NULL,26,'Is  portable fire extinguisher available, mounted by exit door, unobstructed, checked monthly and monthly checks documented on the hangtag?','1910.157(c)(1)\nThe employer shall provide portable fire extinguishers and shall mount, locate and identify them so that they are readily accessible to employees without subjecting the employees to possible injury.\n\nDocument checks on the hangtag attached to the cylinder.\n\nFire extinguisher checks must be performed monthly.  Verify that the needle indicating charge status is in the green area, the pin is intact, and the nozzle and cylinder are in good condition (no cracks, dents, punctures, etc.)\n\nDocument checks on the hangtag attached to the cylinder.','CFR 1910.157 Portable fire extinguishers',283,NULL,NULL,NULL,NULL),(284,1,'2015-01-30 14:07:28','2015-04-07 23:51:59',NULL,30,'Are circuit panels, electrical outlets and receptacles covered?',NULL,NULL,284,NULL,NULL,NULL,NULL),(285,1,'2015-01-30 14:08:13','2015-04-07 23:51:59',NULL,30,'Are GFCI outlets installed around sinks and other areas where water is used?',NULL,NULL,285,NULL,NULL,NULL,NULL),(286,1,'2015-01-30 14:09:22','2015-04-07 23:51:59',NULL,30,'Are large appliances and high amperage equipment plugged into individual wall outlets, not extension cords?',NULL,NULL,286,NULL,NULL,NULL,NULL),(287,1,'2015-01-30 14:30:04','2015-04-07 23:51:59',NULL,37,'Is mercury spill kit available?','A mercury spill kit, or a the minimum, a mercury absorbent must be available in the lab where mercury (including mercury thermometers) is used and/or stored.','USC Lab Safety Policy',287,NULL,NULL,NULL,NULL),(288,1,'2015-01-30 14:30:38','2015-04-07 23:51:59',NULL,37,'Is alcohol-based thermometer used if mercury thermometer is not necessary?','If mercury thermometers are not necessary, mercury thermometers must be replaced by alcohol-based units to avoid the need to clean-up potential mercury spills from broken mercury thermometers.','USC Lab Safety Policy',288,NULL,NULL,NULL,NULL),(289,1,'2015-01-30 14:32:11','2015-04-07 23:51:59',NULL,38,'Is calcium gluconate gel and eyewash available and not expired?','Laboratories that store and/or use HF are required to keep calcium gluconate gel and calcium gluconate eyewash as HF antidote for skin and eye exposure, respectively.  Ensure that these antidotes are not expired before starting work with HF.','USC Lab Safety Policy',289,NULL,NULL,NULL,NULL),(290,1,'2015-01-30 14:33:34','2015-04-07 23:51:59',NULL,38,'Is neoprene gloves, tyvek suit, acid resistant apron, acid resistant shoe cover, face shield available?',NULL,NULL,290,NULL,NULL,NULL,NULL),(291,1,'2015-01-30 14:33:55','2015-04-07 23:51:59',NULL,38,'Is HF signage posted in HF work area?','\"Danger, Extremely Corrosive HF in Use, Exposure can be Deadly\" must be posted on fume hood sash and immediate work area where HF is used and/or stored.','USC Lab Safety Policy',291,NULL,NULL,NULL,NULL),(292,1,'2015-01-30 14:35:10','2015-04-07 23:51:59',NULL,38,'Is written HF SOP available, and signed by PI and authorized users?','Written SOP for use of HF is required where HF is used and/or stored.','USC Lab Safety Policy',292,NULL,NULL,NULL,NULL),(293,1,'2015-01-30 14:36:03','2015-04-07 23:51:59',NULL,38,'Is HF-specific procedure and safety training of authorized users performed and documented?','All personnel handling HF must undergo HF-specific procedure and safety training.  Only personnel who demonstrates proficiency on the scientific methodology and safety procedures described in the SOP may be authorized to work with HF.  \n\nAdditionally, everyone who enters and work in the lab using HF, though not directly handling the material, must undergo a safety training to ensure that they are aware of the hazards and the emergency procedures in case a spill or an exposure occur.','USC Lab Safety Policy',293,NULL,NULL,NULL,NULL),(294,1,'2015-01-30 14:37:26','2015-08-12 14:10:48',NULL,39,'Is cylinder of toxic gas secured, stored and dispensed in ventilated gas cabinet or chemical fume hood?','Cylinders of toxic gases must be secured, stored and dispensed in a ventilated gas cabinet or chemical fume hood.','International Fire Code',296,NULL,NULL,NULL,NULL),(295,1,'2015-01-30 14:38:44','2015-08-12 14:11:54',NULL,39,'Is gas specific detector installed at point of release and point of use, and calibrated bi-annually or as recommended by the manufacturer?','Use of toxic and highly toxic gases require a detection system installed at the point of release and point of use. The gas detector must be calibrated periodically as recommended by the manufacturer.','International Fire Code',297,NULL,NULL,NULL,NULL),(296,1,'2015-01-30 14:40:32','2015-08-12 14:25:48',NULL,39,'Is gas detection system for toxic gas attached to an alarm system that is monitored 24 hours a day?','Use of toxic gases require that the gas detection system that initiates a local alarm, both audible and visual, and a signal transmitted to a constantly attended control station such as a fire alarm system.','International Fire Code',298,NULL,NULL,NULL,NULL),(297,1,'2015-01-30 14:41:16','2015-08-12 14:31:57',NULL,39,'Is written SOP for use of toxic gas available, approved by PI and signed by authorized users?','Use of toxic gases require a written SOP that follows USC Lab Safety-approved format, approved by the PI and signed by authorized users.','USC Lab Safety Policy',313,NULL,NULL,NULL,NULL),(298,1,'2015-01-30 14:41:55','2015-08-12 14:57:34',NULL,39,'Are authorized users of toxic gases trained on safe handling of compressed gases, cylinder change-out and specific SOPs? Are their trainings documented?','Personnel must demonstrate proficiency in safe handling of compressed gases and complete cylinder change-out and SOP-specific safety trainings before they can be authorized to work with these materials.  Trainings must be clearly documented in the Chemical Hygiene Plan.','USC Lab Safety Policy',314,NULL,NULL,NULL,NULL),(299,1,'2015-02-12 19:53:36','2015-04-07 23:51:59',NULL,11,'Are vacuum lines protected with HEPA filters or their equivalent, and are filters replaced as needed?','Vacuum lines should be protected with High Efficiency Particilate Air (HEPA) filters, or their equivalent. Filters must be replaced as needed. Liquid disinfectant traps may be required.','BMBL, 5th Edition (Section IV - Part D.7)',299,NULL,NULL,NULL,NULL),(300,1,'2015-02-12 19:54:55','2015-04-07 23:51:59',NULL,11,'Are provisions to assure proper biosafety cabinet performance and air system operation verified (e.g. annual BSC certification)?','HEPA filtered exhaust air from a Class II BSC can be safely re-circulated back into the laboratory environment if the cabinet is tested and certified at least annually and operated according to manufacturers recommendations. BSCs can also be connected to the laboratory exhaust system by either a thimble (canopy) connection or a direct (hard) connection. Provisions to assure proper safety cabinet performance and air system operation must be verified.','BMBL, 5th Edition (Section IV - Part D.10)',300,NULL,NULL,NULL,NULL),(301,1,'2015-03-05 21:24:25','2015-08-06 16:07:29',NULL,26,'Are accidents/incidents and near misses reported and documented in the Chemical Hygiene Plan?','It is the responsibility of ALL laboratory personnel to document in the CHP and report to EH&S all incidents, accidents or near misses that occur in the laboratory.','USC Policy',301,NULL,NULL,NULL,NULL),(302,1,'2015-03-05 21:26:36','2015-08-06 16:23:25',NULL,31,'Do lab personnel work with a buddy outside of reguar office hours?','Lab personnel are not allowed to work alone in high risk laboratories outside of regular office hours.','USC Lab Safety Policy',302,NULL,NULL,NULL,NULL),(303,0,'2015-03-05 22:06:04','2015-04-07 23:51:59',NULL,1,'new question','l;kjasdl;fjasldjflasdjf;lasdkj;f','klasdflkajsl;',303,NULL,NULL,NULL,NULL),(304,0,'2015-03-05 22:08:26','2015-04-07 23:51:59',NULL,40,'If an electrical panel box is present in the laboratory, is there a 3-ft clearance around it?',NULL,NULL,304,NULL,NULL,NULL,NULL),(305,0,'2015-03-05 22:09:34','2015-04-07 23:51:59',NULL,40,'Are circuit panels, electrical outlets and receptacles covered?',NULL,NULL,305,NULL,NULL,NULL,NULL),(306,0,'2015-03-05 22:10:11','2015-04-07 23:51:59',NULL,40,'Are GFCI outlets installed around sinks and other areas where water is used?',NULL,NULL,306,NULL,NULL,NULL,NULL),(307,0,'2015-03-05 22:11:14','2015-04-07 23:51:59',NULL,40,'Are large appliances and high amperage equipment plugged into individual wall outlets, not extension cords?',NULL,NULL,307,NULL,NULL,NULL,NULL),(308,0,'2015-03-06 06:25:47','2015-04-07 23:51:59',NULL,1,'test','test','test',308,NULL,NULL,NULL,NULL),(309,1,'2015-03-06 14:55:36','2015-04-07 23:51:59',NULL,41,'Is access to the lab restricted to PI\'s personnel and authorized users only?','Access to the laboratory must be restricted to lab personnel under direct supervision of the Principal Investigator.  Authorized access may be granted to other users by the Principal Investigator and this authorization documented in the CHP.','USC Policy',309,NULL,NULL,NULL,NULL),(310,1,'2015-03-06 14:57:43','2015-04-07 23:51:59',NULL,42,'Is floor drain available to direct flow of water from the safety shower upon activation?','It is recommended for some laboratories that a floor drain be installed to direct flow of water from safety shower upon activation.','USC Policy',310,NULL,NULL,NULL,NULL),(311,1,'2015-03-20 14:58:07','2015-04-07 23:51:59',NULL,43,'Is a class D fire extinguisher available in the lab?','A class D fire extinguisher must be available where water-reactive substances are stored and/or used.','USC Lab Safety Policy',311,NULL,NULL,NULL,NULL),(312,1,'2015-03-20 15:18:18','2015-04-07 23:51:59',NULL,38,'Is HF spill kit available?','HF spill kit is necessary to clean-up spilled HF.','USC Lab Safety Policy',312,NULL,NULL,NULL,NULL),(313,1,'2015-03-20 18:11:12','2015-08-12 15:00:50',NULL,39,'Is written SOP for cylinder change-out available and followed?','Use of toxic gases require a written SOP for gas cylinder change-out that must be strictly followed by authorized users.','USC Lab Safety Policy',316,NULL,NULL,NULL,NULL),(314,1,'2015-03-20 18:38:31','2015-08-10 18:24:22',NULL,44,'Is flame resistant clothing and flame resistant lab coat available and used when handling pyrophoric liquid?','Handling of pyrophoric liquid requires the use of flame resistant clothing and flame resistant lab coat.','USC Lab Safety Policy',316,NULL,NULL,NULL,NULL),(315,1,'2015-03-20 18:40:39','2015-08-10 18:23:26',NULL,44,'Is written SOP for use of pyrophoric liquid available, signed and implemented?','Use of pyrophoric liquid require a written SOP signed by the PI and all authorized users.','USC Lab Safety Policy',314,NULL,NULL,NULL,NULL),(316,1,'2015-03-20 18:44:22','2015-08-10 18:27:04',NULL,44,'Are authorized users of pyrophoric liquid trained on safe handling of pyrophoric liquid and their training documented?','Lab personnel authorized to handle pyrophoric liquid must complete hazard-specific safety training and demonstrate proficiency in implementing the scientific methodology and as well as procedures described in the SOP.\n\nTrainings must be clearly documented.','USC Lab Safety Policy',315,NULL,NULL,NULL,NULL),(317,1,'2015-04-02 18:01:31','2015-04-07 23:51:59',NULL,45,'Is laboratory officially closed out by EH&S?','All laboratories that are to be vacated due to Principal Investigator leaving the university, retiring, losing the space, moving to another space or the lab space slated for renovation must be officially closed-out by EH&S.','USC Laboratory Safety Policy',317,NULL,NULL,NULL,NULL),(318,1,'2015-08-06 15:58:44','2015-08-06 15:58:44',NULL,26,'Is emergency lighting available and comes on to light the egress areas when power goes out ?','Emergency lighting must be available to provide lighting to egress areas when electricity in the building goes out.','USC Policy',302,NULL,NULL,NULL,NULL),(319,1,'2015-08-06 16:17:11','2015-08-06 16:17:11',NULL,45,'Did the PI of the new laboratory consulted with EH&S to complete New Lab Start-up?','Principal Investigators establishing new laboratories are required to consult with EH&S to ensure that the new lab complies with all applicable safety policies and regulations. Download New Lab start-up form at http://www.sc.edu/ehs/LabSafety/Labstartup.htm and submit to jlocke@mailbox.sc.edu.  You will be contacted to schedule a meeting to discuss applicable safety policies and requirements for your new laboratory.','USC Policy',319,NULL,NULL,NULL,NULL),(320,1,'2015-08-07 15:20:14','2015-08-07 15:20:14',NULL,15,'Are personnel authorized to work with nanomaterials trained specifically for safe use of this hazard and is the training documented in the CHP?','Are personnel authorized to work with nanomaterials must complete nanomaterials safety training.  This training must be properly documented in the CHP.','USC Safety Policy',41,NULL,NULL,NULL,NULL),(321,1,'2015-08-07 15:34:22','2015-08-07 15:36:05',NULL,13,'Are lab personnel authorized to use hazardous equipment provided hazard-specific training and is the training clearly documented in the CHP?','Laboratory personnel authorized to use hazardous equipment must be provided hazard-specific training.  This training must be clearly documented in the CHP.','USC Lab Safety Policy',261,NULL,NULL,NULL,NULL),(322,1,'2015-08-12 13:24:22','2015-08-12 13:28:26',NULL,39,'Is the amount of gas reasonable for the procedure so that the IFC\'s MAQ for highly toxic gases is not exceeded in the control are where the lab is located?',NULL,'International Fire Code',294,NULL,NULL,NULL,NULL),(323,1,'2015-08-12 13:56:51','2015-08-12 14:10:48',NULL,39,'Is toxic gas concentration reasonable for lab procedure?','A diluted form of the gas must be used as much as possible to reduce toxicity risk.','USC Lab Safety Policy',295,NULL,NULL,NULL,NULL),(324,1,'2015-08-12 14:21:44','2015-08-12 14:25:14',NULL,17,'Is gas detection system for highly toxic gas attached to fire alarm system that is monitored 24 hours a day?','Use of highly toxic gases require that the gas detection system that initiates a local alarm, both audible and visual, and a signal transmitted to a constantly attended control station such as a fire alarm system.','International Fire Code',67,NULL,NULL,NULL,NULL),(325,1,'2015-08-12 14:49:00','2015-08-12 14:58:25',NULL,17,'Are authorized users of highly toxic gases trained on safe handling of compressed gases, cylinder change-out and specific SOPs? Are their trainings documented?','Personnel must demonstrate proficiency in safe handling of compressed gases and complete cylinder change-out and SOP-specific safety trainings before they can be authorized to work with these materials. Trainings must be clearly documented in the Chemical Hygiene Plan.','USC Lab Safety Policy',69,NULL,NULL,NULL,NULL),(326,1,'2015-08-12 15:02:04','2015-08-12 15:02:04',NULL,17,'Is written SOP for cylinder change-out available and followed?','Use of toxic gases require a written SOP for gas cylinder change-out that must be strictly followed by authorized users.','USC Lab Safety Policy',70,NULL,NULL,NULL,NULL),(327,1,'2015-09-24 16:05:06','2015-09-24 16:05:06',NULL,45,'Is the lab actively being used?','Inactive labs may or may not be inspected based on the type of hazardous materials stored.\nLabs storing high risk chemicals or equipment will be inspected to verify the status of such materials.','USC Lab Policy',321,NULL,NULL,NULL,NULL),(328,1,'2016-02-16 18:34:24','2016-02-16 18:34:24',NULL,48,'Test Question','Test Comp Descr','Test Comp Ref',0,NULL,NULL,NULL,NULL),(329,1,'2016-04-13 18:40:40','2016-04-13 18:40:40',NULL,30,'Are experimental set-ups and all electrical equipment free of electrocution hazard?','Electrical equipment and all experimental set up must be designed to be free of any potential electrocution hazard such as frayed wires, open wires and others.','USC Policy',287,NULL,NULL,NULL,NULL),(330,1,'2016-04-13 18:48:31','2016-06-07 18:44:41',NULL,9,'Are old gas cylinders disposed of properly or returned to the vendor?','Gas cylinders that are old and/or unused must be returned to the vendor or disposed of properly by contacting EH&S Hazardous Waste at 777-5269.','USC Policy',112,NULL,NULL,NULL,NULL),(331,1,'2016-04-15 12:52:06','2016-04-15 14:45:43',NULL,21,'Are old and/or unused (not used within the last three years) chemicals disposed of as hazardous waste and purged from the chemical inventory?','Old and unused (not used within the last three years) chemicals must be disposed of as chemical waste and purged from the chemical inventory.','USC Lab Safety Policy',259,NULL,NULL,NULL,NULL),(332,1,'2016-04-15 13:01:58','2016-04-15 13:01:58',NULL,21,'Is amount of each chemical reasonable for research need?','Storage of chemicals in laboratories must be minimized by purchasing and storing reasonable amounts based on research needs.','USC Lab Safety Policy',260,NULL,NULL,NULL,NULL),(333,1,'2016-04-25 16:13:44','2016-04-25 16:13:44',NULL,50,'Does the lab have access to the USC Bloodborne Pathogens Exposure Control Plan','Each employer having an employee(s) with occupational exposure to bloodborne pathogens (as defined in OSHA standard) shall establish a written Exposure Control Plan designed to eliminate or minimize employee exposure.','29 CFR 1910.1030(c)(1)(i)',0,NULL,NULL,NULL,NULL),(334,1,'2016-04-25 16:45:59','2016-04-25 16:45:59',NULL,50,'Has the Hepatitis B vaccination been made available to lab members with occupational exposure to bloodborne pathogens?','Hepatitis B vaccination shall be made available after the employee has received bloodborne pathogens training and within 10 working days of initial assignment to all employees who have occupational exposure unless the employee has previously received the complete hepatitis B vaccination series, antibody testing has revealed that the employee is immune, or the vaccine is contraindicated for medical reasons.','29 CFR 1910.1030(f)(2)(i)',1,NULL,NULL,NULL,NULL),(335,1,'2016-04-25 17:00:59','2016-04-25 17:00:59',NULL,50,'Have lab members with occupational exposure to bloodborne pathogens completed the USC bloodborne pathogens training?','The employer shall train each employee with occupational exposure to bloodborne pathogens. Such training must be provided at no cost to the employee and during working hours. The employer shall institute a training program and ensure employee participation in the program.','29 CFR 1910.1030(g)(2)(i)',2,NULL,NULL,NULL,NULL),(336,1,'2016-05-17 14:35:22','2016-05-17 14:35:22',NULL,51,'Is the area posted with Radiation Area signs?','All entrances to the room/area are posted appropriately.',NULL,0,NULL,NULL,NULL,NULL),(337,1,'2016-05-17 14:39:17','2016-05-17 14:39:17',NULL,51,'Is a pregnancy Poster posted?','A poster to notify the operator of the DXA if the subject is pregnant or possible pregnancy is posted and recognizable.',NULL,1,NULL,NULL,NULL,NULL),(338,1,'2016-05-17 14:41:14','2016-05-17 14:41:14',NULL,51,'Is the \"Notice to Employees\" posted?','The form must be posted for employees.','RHB',2,NULL,NULL,NULL,NULL),(339,1,'2016-05-17 14:42:24','2016-05-17 14:42:24',NULL,51,'Are Personnel Monitoring reports available?','Reports must be available for DHEC review',NULL,3,NULL,NULL,NULL,NULL),(340,1,'2016-05-17 14:44:24','2016-05-17 14:44:24',NULL,51,'Are previous occupational dose for employees and records of dose who work at other facilities are exposure exposure reports maintained?','Previous dose is not available.',NULL,4,NULL,NULL,NULL,NULL),(341,1,'2016-05-17 14:45:26','2016-05-17 14:45:26',NULL,51,'Are Patient logs maintained and available?','Records are maintained of all DXA scans performed on human subjects.',NULL,5,NULL,NULL,NULL,NULL),(342,1,'2016-05-17 14:46:46','2016-05-17 14:46:46',NULL,51,'Are all operators of DXA certified through SCRQSA and received specialized training?','All operators of X-ray equipment on humans must be certified through the SCRQSA',NULL,6,NULL,NULL,NULL,NULL),(343,0,'2016-05-17 14:48:38','2016-05-17 14:51:08',NULL,51,'Has any misadministration events been reported?','Misadministration events are reported and records maintained.',NULL,7,NULL,NULL,NULL,NULL),(344,1,'2016-05-17 14:49:24','2016-05-17 14:49:24',NULL,51,'Is a list of all operators of the unit available with their certification number?',NULL,NULL,8,NULL,NULL,NULL,NULL),(345,1,'2016-05-17 14:51:01','2016-05-17 14:51:01',NULL,51,'Has any misadministration events been reported?',NULL,NULL,9,NULL,NULL,NULL,NULL),(346,1,'2016-05-17 14:51:50','2016-05-17 14:51:50',NULL,51,'Are written operating procedures for the DXA available?',NULL,NULL,10,NULL,NULL,NULL,NULL),(347,1,'2016-05-17 14:52:51','2016-05-17 14:52:51',NULL,51,'Are the written policies on Pregnant workers and pregnant patients available?',NULL,NULL,11,NULL,NULL,NULL,NULL),(348,1,'2016-05-17 14:53:33','2016-05-17 14:53:33',NULL,51,'Are policies on Patient Holding, personnel monitoring, training procedures, and Quality Assurance available?',NULL,NULL,12,NULL,NULL,NULL,NULL),(349,1,'2016-05-17 14:58:10','2016-05-17 14:58:10',NULL,51,'Can operator view the patient and be within 1 meter of the DXA unit while it is scanning a patient?','Operator must be able to view patient and remain within 1 meter from the table.',NULL,13,NULL,NULL,NULL,NULL),(350,1,'2016-05-17 15:00:12','2016-05-17 15:00:12',NULL,51,'Is a technique chart available stating kvp and mA of exams?','A technique chart with kvp and mA must be posted for operator.',NULL,14,NULL,NULL,NULL,NULL),(351,1,'2016-05-17 15:01:07','2016-05-17 15:01:07',NULL,51,'Are QA protocols being followed?',NULL,NULL,15,NULL,NULL,NULL,NULL),(352,0,'2016-05-17 15:01:49','2016-05-17 15:09:37',NULL,51,'Is Gonadal shielding available?',NULL,NULL,16,NULL,NULL,NULL,NULL),(353,1,'2016-05-17 15:14:40','2016-05-17 15:14:40',NULL,52,'Is a protective housing in place and fitted?',NULL,'ANSI - 4.3.1',0,NULL,NULL,NULL,NULL),(354,1,'2016-05-17 15:16:21','2016-05-17 15:16:21',NULL,52,'If no housing, are other controls available?',NULL,'4.3.1.1',1,NULL,NULL,NULL,NULL),(355,1,'2016-06-24 15:00:53','2016-06-24 15:48:34',NULL,7,'Is a chemical fume hood available for use of volatile flammable and/or inhalation hazards?','CFR 1910.1450(e)(3) The Chemical Hygiene Plan shall include each of the following elements and shall indicate specific measures that the employer will take to ensure laboratory employee protection; 1910.1450(e)(3)(i) Standard operating procedures relevant to safety and health considerations to be followed when laboratory work involves the use of hazardous chemicals; 1910.1450(e)(3)(ii) Criteria that the employer will use to determine and implement control measures to reduce employee exposure to hazardous chemicals including engineering controls, the use of personal protective equipment and hygiene practices; particular attention shall be given to the selection of control measures for chemicals that are known to be extremely hazardous; 1910.1450(e)(3)(iii) A requirement that fume hoods and other protective equipment are functioning properly and specific measures that shall be taken to ensure proper and adequate performance of such equipment;\n\nNFPA 45 7.2.6.   The release of chemical vapors into the laboratory shall be controlled by enclosure(s) or captured to prevent any flammable and/or combustible concentration of vapors from reaching any source of ignition.','OSHA Laboratory Standard CFR 1910.1450, NFPA 45 7.2.6',102,NULL,NULL,NULL,NULL),(356,1,'2016-07-06 15:16:23','2016-07-08 18:04:56',NULL,35,'Is chemical waste removed from the lab accumulation area within 6 months of generating the waste or as soon as 10 gallon limit is reached; whichever comes first?','Chemical waste must be removed from the lab accumulation area within 6 months of generating the waste or as soon as the 10-gallon limit is reached; whichever comes first.  Request hazardous waste pick-up on-line as soon as possible.','USC Hazardous Waste Policy',276,NULL,NULL,NULL,NULL),(357,1,'2016-07-06 19:31:16','2016-07-06 19:31:16',NULL,35,'Is waste container filled to the level where there is head space to allow liquid expansion?','Chemical waste container must be filled to a level where sufficient head space is left to allow expansion of liquid inside the container.','USC Lab Safety Policy',277,NULL,NULL,NULL,NULL),(358,1,'2016-07-15 18:16:41','2016-07-15 18:16:41',NULL,54,'Is LSC located in the specified room?',NULL,NULL,0,NULL,NULL,NULL,NULL),(359,1,'2016-07-15 18:21:02','2016-07-15 18:21:02',NULL,54,'Has LSC source been removed from system?','Sources must not be removed from the LSC',NULL,1,NULL,NULL,NULL,NULL),(360,1,'2016-07-18 17:28:31','2016-07-18 17:28:31',NULL,35,'Are used chemicals that are hazardous (toxic, corrosive, flammable, reactive) collected as hazardous waste?','Chemicals that qualify under the RCRA definition of \"hazardous (toxic, corrosive, flammable, reactive) must be collected as hazardous waste and disposed of through EH&S.','USC Hazardous Waste Policy',278,NULL,NULL,NULL,NULL),(361,1,'2016-07-21 14:11:43','2016-07-21 14:11:43',NULL,26,'Are flammable chemicals and other combustible materials (paper, cardboard) minimized in the laboratory?','Total volume of flammables that exceed 10 gallons must be kept inside a flammable-safe cabinet.  Storage of paper products, card board boxes and other combustible material must be minimized in the laboratory.','USC Fire Safety Policy',303,NULL,NULL,NULL,NULL),(362,1,'2016-10-25 14:40:35','2016-10-25 14:40:35',NULL,55,'Is written SOP for use of corrosive gas established?','<p>OSHA Laboratory standard required that written standard operating procedures be established for use of hazardpous chemicals in the laboratory.</p>','<p>OSHA Laboratory Standard</p>',1,NULL,NULL,NULL,NULL),(363,1,'2016-10-25 14:45:16','2016-10-25 14:45:16',NULL,55,'Is corrosive gas stored/used inside a ventilated enclosure such as a fume hood or gas cabinet?','<p>Engineering controls must be implemented to effectively reduce potential exposure to corrosive gases in case of an accidental release.</p>','<p>USC Lab Safety Policy and OSHA Lab Standard</p>',2,NULL,NULL,NULL,NULL),(364,1,'2016-10-25 14:48:06','2016-10-25 14:48:06',NULL,55,'Is a gas sensor and alarm system installed to detect accidental release of corrosive gas?','<p>Gas sensor and alarm system must be installed to warn users in case of an accidental release and enable users to respond appropriately.</p>','<p>USC Lab SAfety Policy and OSHA Lab Standard</p>',3,NULL,NULL,NULL,NULL),(365,1,'2016-10-25 15:54:37','2016-10-25 15:54:37',NULL,42,'Are all equipment in good working condition?','<p>All equipment must be in good working condition.</p>','<p>USC Lab Safety Policy</p>',311,NULL,NULL,NULL,NULL),(366,1,'2016-10-28 17:25:46','2016-10-28 17:25:46',NULL,36,'Are syringes and needles and other sharps such as blades and scalpels, etc. used for chemical/mechanical work disposed of appropriately?','<p>Syringes, needles, scalpels, blades and other sharps used for chemical and/or mechnical work must be disposed of in sharps containers and disposed of as biohazard waste.</p>','<p>USC Lab Safety Policy</p>',278,NULL,NULL,NULL,NULL),(367,1,'2016-11-01 17:26:51','2016-11-01 17:26:51',NULL,36,'Are empty chemical containers disposed of?','<p>Chemicals containers that are empty can be disposed of as normal trash. &nbsp;Before disposing of empty containers, ensure that the containers are completely empty, triple rinsed and rinsate collected as hazardous waste (if a P-listed chemical only), and the label defaced or marked with an \"X\".&nbsp;</p>','<p>USC Lab Safety Policy</p>',280,NULL,NULL,NULL,NULL);
