 stored in a gas cabinet.  I asked Tianyu to dispose (request pick up) for all of the hazardous waste and solid waste being stored in GSRC 425 and 426.  This includes 3 full red sharps containers, 2 empty diethyl ether containers, 2 plastic bottles, 5 empty 4 L amber bottles and 2 mercury thermometers.  There is other waste around the lab that needs to be discarded as well.  I also asked the students to dispose of the waste when it is 3/4 full.',NULL,0,0),(142,1,'2017-02-06 15:19:38','2017-02-06 15:19:38',NULL,18762,'There is a bucket labeled as cyanide waste in lab 237 that was there last year during the inspection.  I asked Josh to have it picked up.',NULL,0,0),(143,1,'2017-02-06 15:21:27','2017-02-06 15:21:27',NULL,18783,'I asked Josh to update the emergency procedures posted by each exit.  I emailed him the template on 2/6/17.',NULL,0,0),(144,1,'2017-02-06 15:40:18','2017-02-06 15:40:18',NULL,NULL,'The fume hood (#438) in 512 is not working.  I submitted a work order to facilities to have it repaired.',NULL,0,0),(145,1,'2017-02-06 15:42:04','2017-02-06 15:42:04',NULL,18843,'There are three containers of diethyl ether that had expired that need to be disposed of immediately as hazardous waste.  Diethyl ether has a one year expiration from the time of receipt or a 6 month expiration after opening the container, whichever comes first.',NULL,0,0),(146,1,'2017-02-06 15:43:55','2017-02-06 15:43:55',NULL,18856,'Please discard of all hazardous waste and solid waste that has accumulated in the lab.  Waste should be discarded when the container is 3/4 full and/or every 6 months.',NULL,0,0),(147,1,'2017-02-06 15:45:03','2017-02-06 15:45:03',NULL,18817,'Please purchase a face shield to be used with cryogens.',NULL,0,0),(148,0,'2017-02-06 15:46:03','2017-02-06 15:46:03',NULL,18867,'Please be sure that needles are not recapped prior to disposal.',NULL,1,0),(149,1,'2017-02-08 18:59:10','2017-02-08 18:59:10',NULL,19118,'I will need a chemical inventory for GSRC 529.  Please email it to ebair@mailbox.sc.edu.',NULL,0,0),(150,1,'2017-02-08 19:03:39','2017-02-08 19:03:39',NULL,19165,'The hazardous waste sitting in the fume hood in GSRC 529 needs to be tagged and disposed of.  There is also a solid waste container that is full and needs to be disposed of.',NULL,0,0),(151,1,'2017-02-08 19:04:22','2017-02-08 19:04:22',NULL,19173,'The broken glass container is full and needs to be disposed of.',NULL,0,0),(152,1,'2017-02-08 19:05:31','2017-02-08 19:05:31',NULL,19185,'The hazard notification board on the outside of the lab needs to be updated to reflect the current occupants of the lab and their emergency telephone numbers.',NULL,0,0),(153,1,'2017-02-08 19:06:01','2017-02-08 19:06:01',NULL,19186,'The emergency procedures were old.  I emailed Derek a copy of the new template that he can fill out and post inside the lab by the exit.',NULL,0,0),(154,1,'2017-02-09 13:17:20','2017-02-09 13:17:20',NULL,19238,'There was a cabinet that had flammables and acids and bases all stored together.  It\'s very important that chemicals are segregated based on compatibility.  Acids must be in a separate cabinet than bases and flammables should be in an approved flammables cabinet.  I pointed this out to Esteban.',NULL,0,0),(155,1,'2017-02-09 13:12:58','2017-02-09 13:12:58',NULL,19248,'I asked Esteban to attach the SDS to the back of the SOP.',NULL,0,0),(156,1,'2017-02-09 13:14:22','2017-02-09 13:14:22',NULL,19262,'The broken glass container was full and needs to be discarded.',NULL,0,0),(157,1,'2017-02-09 13:15:09','2017-02-09 13:15:09',NULL,19254,'There was some waste in the lab that was not labeled.  Everything in the lab has to be labeled including waste.',NULL,0,0),(158,1,'2017-02-09 14:45:34','2017-02-09 14:45:34',NULL,19389,'Everyone working in the lab needs to read and sign the chemical hygiene plan.',NULL,0,0),(159,1,'2017-02-09 14:52:13','2017-02-09 14:52:13',NULL,19425,'There are some very old looking chemicals in the labs that I brought to the attention of the 3 students who assisted me during the inspection.  They should be disposed of with our next chemical amnesty event.',NULL,0,0),(160,1,'2017-02-09 14:53:38','2017-02-09 14:53:38',NULL,19436,'Li needs to attach the SDS(s) to the back of the SOP\'s for the current PHS\'s in the lab.',NULL,0,0),(161,1,'2017-02-09 14:54:48','2017-02-09 14:54:48',NULL,19435,'Most if not all of the PHS SOP\'s reference phone numbers and websites for UCLA.  EH&S has a lot of SOP\'s written that can be used in place of the UCLA SOP\'s.',NULL,0,0),(162,1,'2017-02-09 14:57:45','2017-02-09 14:57:45',NULL,19460,'The pumps that are sitting in the water buckets in the sinks in rooms 437 and 436 must be plugged into GFCI outlets.',NULL,0,0),(164,1,'2017-02-22 18:04:50','2017-02-22 18:04:50',NULL,19569,'There appears to have been a spill in the fume hood in 203 next to the furnace.  It\'s orange in color.  That will need to be cleaned up.',NULL,0,0);
