ydrofluoric acid is to be discarded as soon as possible.',NULL),(21,1,'2016-04-03 20:40:58','2016-04-03 20:40:58',NULL,3465,'A few changes and additions need to be made to the HINs. lab personnel informed of what is needed.',NULL),(22,1,'2016-04-04 17:55:43','2016-04-04 17:55:43',NULL,3527,'They need to copy the SDS for the PHS and attach it to the SOP',NULL),(23,1,'2016-04-04 17:56:49','2016-04-04 17:56:49',NULL,3528,'They have an excel inventory',NULL),(24,1,'2016-04-04 18:01:13','2016-04-04 18:01:13',NULL,3538,'Facilities was in the lab working on the lab air flow when we arrived to do the inspection',NULL),(25,1,'2016-04-04 18:02:26','2016-04-04 18:02:26',NULL,3543,'The fume hoods were not working at the time',NULL),(26,1,'2016-04-04 18:06:31','2016-04-04 18:06:31',NULL,3551,'The floor drain in room 538 smells very strongly of acetone. The solvent is entering the drain from another lab.',NULL),(27,1,'2016-04-04 18:08:00','2016-04-04 18:08:00',NULL,3552,'There\'s a can of ether dated 2/2016 that needs to be discarded.',NULL),(28,1,'2016-04-04 18:08:54','2016-04-04 18:08:54',NULL,3553,'She got rid of the ether immediately',NULL),(29,1,'2016-04-04 18:19:33','2016-04-04 18:19:33',NULL,3580,'We found some very old chemicals where you couldn\'t read the original label. There were also beakers with acid stored in the acid cabinet that had been there for a while.',NULL),(30,1,'2016-04-06 10:38:15','2016-04-06 10:38:15',NULL,3586,'Only chemicals in GSRC 210 are ones used in class demonstrations. They are kept in plastic boxes one for each demonstration, and chemicals are listed on the outside of the boxes. Actual lab work done by only researcher is done in GSRC 211.',NULL),(31,1,'2016-04-06 10:39:42','2016-04-06 10:39:42',NULL,3587,'SDSs should be included in the class demonstration boxes for chemicals in each box.',NULL),(32,1,'2016-04-06 10:44:59','2016-04-06 10:44:59',NULL,3601,'GSRC 210 has no hood.',NULL),(33,1,'2016-04-06 10:50:16','2016-04-06 10:50:16',NULL,3617,'SOPs on hand for nitric acid and sulfuric acid which are used in 211 and included in Dr. Morgan\'s inventory.',NULL),(34,1,'2016-04-06 11:05:13','2016-04-06 11:05:13',NULL,3645,'GSRC 210 mainly is a storage area for old equipment and the boxes for the class demonstrations. Dr. Goode\'s use of GSRC  211 is preparation of samples by his one researcher.',NULL),(35,1,'2016-04-07 05:18:09','2016-04-07 05:18:09',NULL,3696,'Progress has been made toward discarding old chemicals but there is still work to be done.',NULL),(36,1,'2016-04-11 13:53:58','2016-04-11 13:53:58',NULL,3777,'We saw some capped needles in the red biohazard sharps container and told Savannah, Matt, Naimah and Clorissa to make sure they do not recap needles prior to disposing them in the sharps container.  Everyone working in the lab should be made aware of this policy so that they don\'t stick themselves when trying to recap a needle.',NULL),(37,1,'2016-04-11 14:04:07','2016-04-11 14:04:07',NULL,3820,'I emailed the chemical inventory we have on file for Dr. Outten\'s lab to Savannah.  She needs to review the inventory, make any necessary changes, and email it back to me as soon as possible.',NULL),(38,1,'2016-04-11 14:06:45','2016-04-11 14:06:45',NULL,3828,'There needs to be a face shield kept in Room 320 where the cryo gasses are maintained and used.',NULL),(39,1,'2016-04-11 14:09:33','2016-04-11 14:09:33',NULL,3841,'A work order needs to be placed to facilities via email (fmcnotify@fmc.sc.edu) to replace one of the fume hood lights in Room 303.',NULL),(40,1,'2016-04-11 14:20:02','2016-04-11 14:20:02',NULL,3843,'It appeared that the fume hood mute button was purposely silenced using a pipet tip.  All problems with fume hoods in GSRC should be reported to facilities using the email address fmcnotify@fmc.sc.edu or someone at EHS can be contacted and we will submit the work order to address any problems with the fume hoods.',NULL),(41,1,'2016-04-25 01:30:10','2016-04-25 01:30:10',NULL,4934,'Responses pertaining to hoods apply to #571 in GSRC 209 and #572 in Gsrc 237. #501 is being installed in GSRC 209.',NULL),(42,1,'2016-04-25 01:57:32','2016-04-25 01:57:32',NULL,4962,'The toxic gas present is diazomethane that is generated and used in solution when needed. Precautions are for remote chance that free diazomethane would be released',NULL),(43,1,'2016-04-25 02:30:34','2016-04-25 02:30:34',NULL,5007,'Will find out if a sign needs to be put up when diazomethane is generated.',NULL),(44,1,'2016-04-25 08:24:58','2016-04-25 08:24:58',NULL,5030,'Responses pertaining to hoods are for the four hoods in GSRC 427. The hood in GSRC 219 was found to only have a flow of 72 on 1/15/16. Auditor explained to lab personnel how to go about requesting that it be repaired.',NULL),(45,1,'2016-04-25 08:47:20','2016-04-25 08:47:20',NULL,5041,'A number of solid chemicals were stored in one of the hoods in GSRC 427. Auditor was told that they were there so air flow could help keep them dry. They should probably be in wooden cabinets with other solids or in flammables cabinets if necessary..',NULL),(46,1,'2016-04-25 08:46:00','2016-04-25 08:46:00',NULL,5042,'The refrigerator/freezer in GSRC 427 is not an explosion proof one. If there are any flammable chemicals stored there they need to be moved to a fire-rated flammables cabinet or lab needs to acquire explosion proof unit.',NULL),(47,1,'2016-04-26 02:27:26','2016-04-26 02:27:26',NULL,5265,'There are few chemicals other than ones used for class demonstrations in GSRC 210. Chemicals used by graduate student are actually part of Dr. Morgan\'s inventory.',NULL),(48,1,'2016-04-26 10:27:02','2016-04-26 10:27:02',NULL,5286,'Only GSRC 203 has hoods.',NULL),(49,1,'2016-04-26 11:10:37','2016-04-26 11:10:37',NULL,5328,'There was one container with red material in it that had a label with nothing written on it--needs to be looged in as unknown if no one can identify waste.',NULL),(50,1,'2016-05-04 05:02:57','2016-05-04 05:02:57',NULL,5700,'There are empty large bottles on upper shelf of cabinet in 226. Need to be discarded.',NULL),(51,1,'2016-05-04 05:10:16','2016-05-04 05:10:16',NULL,5710,'Sheets on gas cabinets stating what is inside and documenting usage are old and not up to date and are barely legible. Please replace with new signs.',NULL),(52,1,'2016-05-04 05:47:19','2016-05-04 05:47:19',NULL,5708,'In gas cabinet in GSRC 226 which Dr. Chen shares with Dr. Ferry are about 30 gas lecture bottles containing a variety of  gases used for standards. They are stored there and taken to GSRC 227 or 228 for up to several days as needed. Some of them contain PHSs such as nitrogen oxide and nitrogen dioxide. there needs to be a list of the contents on the door of the gas cabinet and the PHS ones and flammable ones need to be listed on the HIN for GSRC 226.',NULL),(53,1,'2016-05-04 06:12:50','2016-05-04 06:12:50',NULL,5723,'There are two monitors for use when 4.82%  CO in helium is in use.',NULL),(54,1,'2016-05-04 06:11:57','2016-05-04 06:11:57',NULL,5723,'Some of the toxic gases are in small lecture bottles and are used for standards . Lab personnel need to ask EH&S for help in determining if monitors are needed when those gases are in use.',NULL),(55,1,'2016-05-10 13:55:25','2016-05-10 13:55:25',NULL,6123,'Newer lab personnel need to sign.',NULL),(56,1,'2016-05-10 14:00:56','2016-05-10 14:00:56',NULL,6125,'Lab has a very nice safety manual generated specifically for the group\'s use. There is a walk-thru list that they use on a regular basis to document safety checks and housekeeping.',NULL),(57,1,'2016-06-03 05:35:47','2016-06-03 05:35:47',NULL,7188,'GSRC 218 does not have a safety shower in the room, but there is one in the hall.',NULL),(58,1,'2016-06-03 05:42:39','2016-06-03 05:42:39',NULL,7207,'Alarm in GSRC 218 goes off sometimes even when flow is sufficient',NULL),(59,1,'2016-06-03 05:49:35','2016-06-03 05:49:35',NULL,7214,'Some labels were hard to read.',NULL),(60,1,'2016-06-03 06:29:02','2016-06-03 06:29:02',NULL,7242,'HIN for GSRC 204 lists hydrofluoric acid, but personnel said it is not in the area. It is not listed on the HIN for GSRC 218, but at 2015 inspection it was stated that HF would be used there in the future and was stored there. If it is there, needs to be on the HIN and a SOP needs to be there. Please advise whether there is any HF in either lab .There are signs on the doors and on the HIN for 204  indicating that there is radiation emitting equipment present--lab personnel indicated that except for equipment for measuring radioactivity of small samples of water or sediment  there was no such equipment. signs and HINs should reflect what is actually present in the labs.',NULL),(61,1,'2016-06-03 06:14:10','2016-06-03 06:14:10',NULL,7246,'At time of inspection there were a number of items on the floor, but they were not blocking access.',NULL),(62,1,'2016-06-03 06:34:19','2016-06-03 06:34:19',NULL,7255,'There are no explosion proof refrigerator/freezers. There are a large empty refrigerator, a large freezer, and a refrigerator/freezer in 218, and two refrigerators in 204. . All have signs saying \"No organic solvents, no food\". There was a small old bottle of sodium azide in a refrigerator in 204. It has been disposed of.',NULL),(63,1,'2016-06-03 06:38:18','2016-06-03 06:38:18',NULL,7261,'If use of Hf happens, hazard signs must be out up.',NULL),(64,1,'2016-06-24 18:51:55','2016-06-24 18:51:55',NULL,7824,'I advised Dr. Waldman to discard his mercury thermometers as hazardous waste and replace them with alcohol thermometers.',NULL),(65,1,'2016-07-06 15:21:05','2016-07-06 15:21:05',NULL,8986,'Waste container looks like it has been sitting in the fume hood for a long time.',NULL),(66,1,'2016-07-06 15:22:41','2016-07-06 15:22:41',NULL,8987,'Other labs within the department that uses liquid nitrogen has access to CLS 708.',NULL),(67,1,'2016-07-06 15:26:14','2016-07-06 15:26:14',NULL,9005,'No active work currently and within the last year as of the date of inspection.',NULL),(68,1,'2016-08-31 18:46:31','2016-08-31 18:46:31',NULL,12755,'Sign of spill on carpet; could have been there before the lab moved in.',NULL),(69,1,'2016-08-31 18:48:17','2016-08-31 18:48:17',NULL,12760,'Minimal volume of flammable chemical in small refrigerator.',NULL),(70,1,'2016-08-31 18:49:31','2016-08-31 18:49:31',NULL,12764,'Need to refer to Jeff Brannon, the preferred way of disposing expired 30-ml bottles of bonding substances.',NULL),(71,1,'2016-08-31 18:50:52','2016-08-31 18:50:52',NULL,12772,'Floor is carpeted',NULL),(72,1,'2016-08-31 18:56:42','2016-08-31 18:56:42',NULL,12792,'Dr. Yu mentioned that it is ideal to have a separate laser room for class 4 laser.  They have only 1 room assigned so that the laser area is in front of the computer work desks.',NULL),(73,1,'2016-09-19 17:36:20','2016-09-19 17:36:20',NULL,12865,'Very minimal chemical used; access to eyewash in A230?',NULL),(74,1,'2016-09-19 17:36:58','2016-09-19 17:36:58',NULL,12866,'Very minimal chemical used; access to safety shower in A230?',NULL),(75,1,'2016-09-20 01:33:21','2016-09-20 01:33:21',NULL,13030,'CHP for labs had been misplaced. If not found, new one will be generated ,',NULL),(76,1,'2016-09-27 04:23:02','2016-09-27 04:23:02',NULL,13049,'No hood in SWGN 1D40--chemicals used there used inside glovebox',NULL),(77,0,'2016-09-29 17:04:08','2016-09-29 17:04:08',NULL,13658,'',NULL),(78,1,'2016-09-29 17:24:07','2016-09-29 17:24:07',NULL,13795,'Will consult with Rad Safety re use of lase class 4.',NULL),(79,1,'2016-09-30 13:36:00','2016-09-30 13:36:00',NULL,14098,'Need SOPs for use of hydrogen and ethylene.',NULL),(80,1,'2016-10-24 16:06:29','2016-10-24 16:06:29',NULL,14925,'Users of shared facility usually brings their own PPE.',NULL),(81,1,'2016-10-24 17:45:22','2016-10-24 17:45:22',NULL,15056,'equipment on power strip totals 12 amp',NULL),(82,1,'2016-11-07 18:05:24','2016-11-07 18:05:24',NULL,17281,'Inventory is on googlle docs and shared among all SAGE groups (Lauterbach, Hattrick-Simpers and Padak).',NULL),(83,1,'2016-11-07 18:06:32','2016-11-07 18:06:32',NULL,17283,'Eyewash checks done for all SAGE labs by Erdem and documented on the computer.',NULL),(84,1,'2016-11-07 18:07:09','2016-11-07 18:07:09',NULL,17284,'Emergency shower checks done by Erdem for all SAGE labs and documented on the computer.',NULL),(85,1,'2016-11-07 18:08:38','2016-11-07 18:08:38',NULL,17297,'Room 129 is a shared lab and accessible to all users from CEC.',NULL),(86,1,'2016-11-09 15:18:46','2016-11-09 15:18:46',NULL,17606,'Model 3 SN #83768',NULL),(87,1,'2016-11-09 15:27:58','2016-11-09 15:27:58',NULL,17622,'Updated radiation tape on fume hood',NULL),(88,1,'2016-11-09 15:28:42','2016-11-09 15:28:42',NULL,17629,'Model # 3 : SN# 215301',NULL),(89,1,'2016-11-09 15:45:15','2016-11-09 15:45:15',NULL,17617,'See recommendations and e- mail a copy of the results to Radiation Safety',NULL),(90,1,'2016-11-09 17:34:09','2016-11-09 17:34:09',NULL,17652,'Dr. Fan has a GM,Model 3,SN 056260. It is not calibrated because he is only authorized for the use of H-3.',NULL),(91,1,'2016-11-09 17:44:19','2016-11-09 17:44:19',NULL,17657,'Added solid trash can by hood to current drawing.',NULL),(92,1,'2016-11-09 17:46:56','2016-11-09 17:46:56',NULL,17661,'Last waste pick-up on 10/15/15. She has requested a waste pick-up before she goes out on maternity leave(11/11/16).',NULL),(93,0,'2016-11-09 17:51:16','2016-11-09 17:51:16',NULL,17668,'Refreshed radioactive tape in approved areas.',NULL),(94,1,'2016-11-09 17:50:28','2016-11-09 17:50:28',NULL,17669,'Refreshed rad tape around the sink',NULL),(95,1,'2016-11-09 17:52:15','2016-11-09 17:52:15',NULL,17675,'Model 3, SN# 297280',NULL),(96,1,'2016-11-10 14:40:50','2016-11-10 14:40:50',NULL,17692,'Designated Hot sink is prohibited.',NULL),(97,1,'2016-11-10 14:42:57','2016-11-10 14:42:57',NULL,17698,'Eberline 120: SN# 10719',NULL),(98,1,'2016-11-10 17:22:00','2016-11-10 17:22:00',NULL,17744,'Ludlum Model 3: SN# 195999',NULL),(99,1,'2016-11-10 17:4