act information and anyone else who could be called in the event of an emergency.',NULL),(261,1,'2016-08-16 13:52:29','2016-08-16 13:52:29',NULL,12337,'Please update the emergency procedures to include Mayomi\'s contact information.  I can email the template if it is needed.',NULL),(262,1,'2016-08-17 15:42:05','2016-08-17 15:42:05',NULL,12374,'Everyone in the lab needs to register for Mark Robbins biosafety training.  The next available class is September 7th.  This is an annual training that all students and staff must attend if they work in a BSL 2 lab.',NULL),(263,1,'2016-08-17 15:48:00','2016-08-17 15:48:00',NULL,12462,'Please request waste pick-up.  Hazardous waste should be picked up at least every 6 months.',NULL),(264,1,'2016-08-17 15:48:53','2016-08-17 15:48:53',NULL,12478,'Please update the hazard notification board.',NULL),(265,1,'2016-08-22 19:52:41','2016-08-22 19:52:41',NULL,12568,'In the future, chemical spills should be reported to EH&S right after they happen.',NULL),(266,1,'2016-08-22 19:58:39','2016-08-22 19:58:39',NULL,12618,'Please update your hazard information once per year with any required changes.',NULL),(267,1,'2016-08-22 19:59:49','2016-08-22 19:59:49',NULL,12623,'Please maintain an 18\" clearance between the ceiling and anything stored on the shelves.',NULL),(268,1,'2016-08-22 20:03:21','2016-08-22 20:03:21',NULL,12634,'There are obvious housekeeping issues in the lab that need to be addressed.  Old experiments have not been cleaned up, unlabeled bottles that belonged to former students, etc. that require attention.  Please tell your students that they are responsible for picking up after themselves, not just day-to-day but when they\'re getting ready to graduate or leave so the next person isn\'t stuck cleaning up their mess.',NULL),(269,1,'2016-08-31 14:24:42','2016-08-31 14:24:42',NULL,12646,'Please email the updated and current chemical inventory to ebair@mailbox.sc.edu.  I will review it.',NULL),(270,1,'2016-08-31 14:26:15','2016-08-31 14:26:15',NULL,12647,'Just a reminder that MSDS\'s are now SDS\'s and that OSHA has changed to a globally harmonized system (GHS) for identifying hazards associated with chemicals.  This renders all the \"MSDS\'s\" in your lab obsolete so please replace them as new chemicals are ordered.',NULL),(271,1,'2016-08-31 14:27:36','2016-08-31 14:27:36',NULL,12663,'I placed a work order with facilities on 8/31/16 for the fume hood in 418 because it has an alarm light blinking.',NULL),(272,1,'2016-08-31 14:28:45','2016-08-31 14:28:45',NULL,12664,'I asked Mark to submit a request to have all of the hazardous waste in the lab picked up as well as any old, expired and/or unused chemicals.',NULL),(273,1,'2016-08-31 14:30:00','2016-08-31 14:30:00',NULL,12680,'I submitted a work order with facilities on 8/31/16 to have a bracket installed in 417A for the compressed nitrogen cylinder in that room.',NULL),(274,1,'2016-08-31 14:33:21','2016-08-31 14:33:21',NULL,12715,'I asked Mark to post the current emergency procedures by the lab exits.',NULL),(275,1,'2016-08-31 14:33:53','2016-08-31 14:33:53',NULL,12719,'I asked Mark to removed some of the boxes that are being stored too close to the ceiling.',NULL),(276,1,'2016-09-19 14:35:16','2016-09-19 14:35:16',NULL,12835,'Add Laser and high voltage on Hazard Information Notice for Room 235.',NULL),(277,1,'2016-09-27 04:18:26','2016-09-27 04:18:26',NULL,13037,'Check safety shower using equipment available in SWGN',NULL),(278,1,'2016-09-27 04:20:46','2016-09-27 04:20:46',NULL,13044,'Gave lab personnel information for ordering better PPE for using HF',NULL),(279,1,'2016-09-27 04:24:39','2016-09-27 04:24:39',NULL,13051,'Hood deemed satisfactory by personnel inspecting it',NULL),(280,1,'2016-09-27 04:36:25','2016-09-27 04:36:25',NULL,13077,'SOPS on hand for most of the PHSs in the lab--need ones for flammables and heavy metals and possibly several more',NULL),(281,1,'2016-09-27 04:41:15','2016-09-27 04:41:15',NULL,13083,'Acquire gas specific d