 19:34:09',NULL,17881,'Waste removed from container must be properly labeled.  Pickup should be scheduled before waste needs to be removed from the container.',NULL),(295,1,'2017-01-30 19:23:12','2017-01-30 19:23:12',NULL,18072,'I told Meagan that we don\'t need to see old training certificates.  They can be recycled.',NULL),(296,1,'2017-01-30 19:34:30','2017-01-30 19:34:30',NULL,18138,'Please dispose of the broken glass containers that are full .',NULL),(297,1,'2017-01-30 19:37:22','2017-01-30 19:37:22',NULL,18155,'Please don\'t store anything within 18 inches of the sprinklers.  Lab 220 has some boxes close to the ceiling.',NULL),(298,1,'2017-02-02 16:47:06','2017-02-02 16:47:06',NULL,18212,'The eye washes need to be checked weekly and documented.',NULL),(299,1,'2017-02-02 17:05:00','2017-02-02 17:05:00',NULL,18271,'I asked Alyssa and Nilmini to tag the hazardous waste and mercury thermometers in the fume hood and the additional stuff we found while I was there.  Please log it into the hazardous waste website so Jeff can pick it up next Wednesday.  Hazardous waste should be discarded every 6 months.  Please also discard the mouse blood.',NULL),(300,1,'2017-02-02 17:12:45','2017-02-02 17:12:45',NULL,18302,'Please maintain an 18\" clearance to the ceilings.',NULL),(301,1,'2017-02-02 17:15:33','2017-02-02 17:15:33',NULL,18285,'Please discard the broken glass container.  Nilmini can request a new one from Jeff or just use a standard cardboard box for broken glass.',NULL),(302,1,'2017-02-02 17:37:49','2017-02-02 17:37:49',NULL,18409,'Please maintain an 18\" clearance from the ceilings.',NULL),(303,1,'2017-02-06 13:51:50','2017-02-06 13:51:50',NULL,18551,'Please be aware that there is a very specific limit on the amount of flammable organic solvents that can be stored on each floor of GSRC.  Please try to reduce the volume of flammable organic solvents being stored in GSRC 405 and 511.',NULL),(304,1,'2017-02-06 13:54:42','2017-02-06 13:54:42',NULL,18564,'I asked Derek t